INSERT INTO `tags` VALUES (1,'switch','Used with cfcase and cfdefaultcase. Evaluates a passed expression and passes control to the \n  cfcase tag that matches the expression result. You can optionally code a cfdefaultcase tag, which \n  receives control if there is no matching cfcase tag value.',1,3,0,0,4,1,'E27C9D722EAEBCD8B540C9766FC090DC'),(2,'application','Defines scoping for a ColdFusion application, enables or disables storing client variables, \n			and specifies a client variable storage mechanism. \n			By default, client variables are disabled. Also, enables session variables and sets timeouts \n			for session and application variables. Session and application variables are stored in memory.',1,3,0,0,4,1,'9BF24B7EAAE0406DF047D3D76C864BC4'),(3,'return','Returns result values from a component method. Contains an expression returned as result of the function.',1,3,0,0,4,1,'9D3B861755BB17B7505004B5F015A3DD'),(4,'break','Used to break out of a cfloop,cfwhile or cfforeach.',1,3,0,0,4,1,'06AB1EF842CE8FBF117048B64F990911'),(5,'mailparam','Can either attach a file or add a header to a message. It is nested within a cfmail tag. You can \n  use more than one cfmailparam tag within a cfmail tag.',1,3,0,0,4,1,'D04D50E6BDBDBA7ACA9BDA7D3DC3160E'),(6,'transaction','Groups multiple queries into a single unit. The cftransaction \n  tag provides commit and rollback processing.',1,3,0,0,4,1,'72897DE6F34508D7CD518CF79E9FC405'),(7,'directory','Handles interactions with directories.',1,3,0,0,4,1,'314E798BE7F2BCC18743D9A1601BF101'),(8,'rethrow','Rethrows the currently active exception. Preserves the exception\'s cfcatch.type and cfcatch.\n  agContext information.',1,3,0,0,4,1,'4834990F3FA057DCC312725530B16BAF'),(9,'log','Writes a message to a log file.',1,3,0,0,4,1,'1C154D056C64D4B5D1812CCE1F67AA4A'),(10,'else','Used with cfelse and cfelseif, cfif lets you create simple and compound conditional statements \n	 in CFML. The value in the cfif tag can be any expression.',1,3,0,0,4,1,'C668A6D50215E3D274537BE7503C6797'),(11,'invokeargument','Argument for the Invoke Tag',1,3,0,0,4,1,'8053D5749804CA4692597FEFE41FDD67'),(12,'report','Runs a predefined Crystal Reports report.',1,3,0,0,4,1,'517FC40DAC037D659B8C704B20045858'),(13,'schedule','Provides a programmatic interface to the ColdFusion scheduling engine. You can run a specified \n  page at scheduled intervals with the option to write out static HTML pages. This lets you offer users \n  access to pages that publish data, such as reports, without forcing users to wait while a database transaction \n  is performed in order to populate the data on the page. \n  ColdFusion scheduled events are registered using the ColdFusion Administrator. Execution of cfschedule \n  can be disabled in the Administrator. \n  Information supplied by the user includes the scheduled ColdFusion page to execute, the time and frequency \n  for executing the page, and whether the output from the task is published. If the output is published, \n  a path and file are specified. \n  The event submission and its success or failure status is written to the cfusion-log-schedule.log file.',1,3,0,0,4,1,'374FA85B1E0AB76C8F2A35CC307B4ADC'),(14,'form','Builds a form with CFML custom control tags that provide more functionality than standard \n  HTML form input elements.',1,3,0,0,4,1,'BC84D0CC20A1195BAE62982B1E3DF8C1'),(15,'loginuser','',1,3,0,0,4,1,'271709FBD5F41B9B13278A235B43EB3C'),(16,'wddx','Serializes and de-serializes CFML data structures to the XML-based WDDX format. \n  Generates JavaScript statements to instantiate JavaScript objects equivalent to the contents of a \n  WDDX packet or some CFML data structures.',1,3,0,0,4,1,'09D5276E5BAFA3DEF6017008EA6D1B15'),(17,'argument','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,3,0,0,4,1,'C08F3203BA6DFE0DC175565A323819C0'),(18,'httpparam','Required for cfhttp POST operations, cfhttpparam is used to specify the parameters necessary to \n	 build a cfhttp POST.',1,3,0,0,4,1,'59393AEF9968D5E6C74F426B571ADA8C'),(19,'textinput','Lets you place a single-line text entry box in a cfform. The tag also gives you control over \n  font characteristics.',1,3,0,0,4,1,'DA0B2BD51509437DCBD3397C6ABA9334'),(20,'import','To import a JSP Taglibrary or a CFML Custom Tag Directory',1,3,0,0,4,1,'502B6E5B9D224779470A5B77B06BB545'),(21,'output','Displays the results of a database query or other operation. To nest cfoutput tags, see the \"Usage\" section.',1,3,0,0,4,1,'514063D62C00A4B0D77734104A03DD25'),(22,'script','Encloses a code segment containing cfscript.',1,3,0,0,4,1,'0C6D839A197D321B1E4A76286111A4D9'),(23,'execute','Enables ColdFusion developers to execute a process on a server computer.',1,3,0,0,4,1,'250E07DEB8F4FBF62C7CA8E602F5D89B'),(24,'mail','Sends e-mail messages by an SMTP server.',1,3,0,0,4,1,'0C7C8C6AF452E5B5A507943E80C1D61D'),(25,'include','Lets you embed references to ColdFusion pages in CFML. You can embed cfinclude tags recursively. \n  For an additional method of encapsulating CFML',1,3,0,0,4,1,'359D7FE99446B8B8C68760006F484C4C'),(26,'slider','Used inside cfform, cfslider lets you place a slider control in a ColdFusion form. A slider \n  control is like a sliding volume control. The slider groove is the area over which the slider moves.',1,3,0,0,4,1,'73465CC26CABECA3EA5F9E526054B166'),(27,'processingdirective','Suppresses extra white space and other output, produced by CFML within the tag\'s scope.',1,3,0,0,4,1,'BA9DE994356A4BB014F7231576525CD3'),(28,'try','Used with one or more cfcatch tags, the cftry tag lets you catch and process exceptions in \n  ColdFusion pages. Exceptions include events that disrupt the normal flow of instructions in a \n  ColdFusion page, such as failed database operations, missing include files, and developer-specified \n  events.',1,3,0,0,4,1,'00AEB5BC77D9A0B40B722DB55BE08F06'),(29,'exit','Used to: Abort the processing of the currently executing CFML custom tag, exit the template \n	within the currently executing CFML custom tag and reexecute a section of code within the currently\n	executing CFML custom tag',1,3,0,0,4,1,'9CDDA6626D0162ED73985244BEC72523'),(30,'objectcache','Flushes the query cache',1,3,0,0,4,1,'BCB4F76F8F37BC7E940453975673A1DE'),(31,'search','Executes searches against data indexed in Verity collections. Collections can be created by \n  calling the cfcollection tag, by using the ColdFusion Administrator, or through native Verity indexing \n  tools. Collections are populated with data either with the cfindex tag, or externally, using native \n  Verity indexing tools. Collections must be created and populated before any searches can be executed.',1,3,0,0,4,1,'C9332797022E667B70278DC3CFB71E51'),(32,'graphdata','Specifies a data point to be displayed by a cfgraph tag.',1,3,0,0,4,1,'DBC8ACC45B005353617C8846192F39DE'),(33,'admin','Tag for the railo web/server administrator',1,3,0,0,4,1,'0D93978DE4EA03E9CD68E52E1EC8A7E5'),(34,'content','Defines the MIME type returned by the current page. Optionally, lets you specify the name of a file\n  to be returned with the page.',1,3,0,0,4,1,'B974BEEF8DF236C2DC21DED450279BD6'),(35,'col','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,3,0,0,4,1,'4013F1827007C9DA32CD7210DBD97A1F'),(36,'file','Handles all interactions with files. The attributes you use with cffile depend on the value of the action attribute. \n For example, if the action = \"write\", use the attributes associated with writing a text file.',1,3,0,0,4,1,'D046F0A71C3F2CF4E89104608F0749B0'),(37,'case','Handle one case of a cfswicth',1,3,0,0,4,1,'C8941BE0103086E4E38C3E5FB6F97106'),(38,'invoke','Invokes component methods from within a ColdFusion page or component. \n			You use this tag to reference a WSDL file and consume a web service from within a block of CFML code.',1,3,0,0,4,1,'B637137C98C082EB1042195A3F7A6FDF'),(39,'silent','Suppresses all output that is produced by the CFML within the tag\'s scope.',1,3,0,0,4,1,'BE9A62BF0C947D513D8CDD21D5FF4965'),(40,'ldap','Provides an interface to LDAP Lightweight Directory Access Protocol \n  directory servers like the Netscape Directory Server.',1,3,0,0,4,1,'A14FA50337359FB4E88C91CB5E0527A6'),(41,'cache','Speeds up page rendering when dynamic content does not have to be retrieved each time a user accesses\n  the page. To accomplish this, cfcache creates temporary files that contain the static HTML returned from\n  a ColdFusion page. You can use cfcache for simple URLs and URLs that contain URL parameters.',1,3,0,0,4,1,'A389024F81D59AF9A95EDA87FD0BFBFA'),(42,'update','Updates existing records in data sources.',1,3,0,0,4,1,'74770DE743FBBEBA26FB364678E7888D'),(43,'storedproc','Executes stored procedures by an ODBC or native connection to a server database. It specifies database connection \n  information and identifies the stored procedure.',1,3,0,0,4,1,'F268EE2D663718B560EB1703BE88FDD8'),(44,'insert','Inserts records in data sources.',1,3,0,0,4,1,'DED7837453F9B72F96E3C4C4C9490B52'),(45,'ftp','Lets users implement File Transfer Protocol (FTP) operations.',1,3,0,0,4,1,'B18F01766104F9E515359015D71C0C2B'),(46,'set','Define a ColdFusion variable. If the variable exists, cfset resets it to the specified value.',1,3,0,0,4,1,'33F68875F0C1DE0BE95F7DE491B57FFF'),(47,'function','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,3,0,0,4,1,'5D1770C923E83EED5A1BFFFE5B6AE47A'),(48,'mailpart','Specifies one part of a multipart e-mail message. Can only be used in the cfmail tag. You can use more than one cfmailpart tag within a cfmail tag',1,3,0,0,4,1,'8C52B8AF478D95ED418A6A866444C57F'),(49,'if','Used with cfelse and cfelseif, cfif lets you create simple and compound conditional statements \n  in CFML. The value in the cfif tag can be any expression.',1,3,0,0,4,1,'B565D1674097634D7C9879680C24D9C6'),(50,'gridupdate','Used in a cfgrid, cfgridupdate allows you to perform updates to data sources directly from edited \n  grid data. The cfgridupdate tag provides a direct interface with your data source. \n  The cfgridupdate tag applies delete row actions first, then INSERT row actions, and then UPDATE row \n  actions. If an error is encountered, row processing stops.',1,3,0,0,4,1,'E68D74A52C03429E6FF7122D6241DF2B'),(51,'query','Passes SQL statements to a data source. Not limited to queries.',1,3,0,0,4,1,'0F4C1FFA5155582034BD0F96063A4EDC'),(52,'defaultcase','Handles interactions with directories.',1,3,0,0,4,1,'B9FBF95849EA6E400893B9B2A3D5429C'),(53,'gridcolumn','Used with cfgrid in a cfform, you use cfgridcolumn to specify column data in a cfgrid control. Font and alignment \n  attributes used in cfgridcolumn override any global font or alignment settings defined in cfgrid.',1,3,0,0,4,1,'2121E1FA78727C75734C3B758C1C6DCF'),(54,'cookie','Defines cookie variables, including expiration and security options.',1,3,0,0,4,1,'2976B79AB7242D55FA281454FF1DCB92'),(55,'servlet','Executes a Java servlet on a JRun engine. This tag is used in conjunction with the \n  cfserletparam tag, which passes data to the servlet.',1,3,0,0,4,1,'762CB570E4DA0D621BC42EA53215377E'),(56,'authenticate','Authenticates a user, setting a security context for the application. \n			For more information, see the descriptions of IsAuthenticated and AuthenticatedContext.',1,3,0,0,4,1,'EBED9F29DBA577C19456BBAD42660A55'),(57,'savecontent','Saves the generated content inside the tag body in a variable.',1,3,0,0,4,1,'494A3800D4DC4F61ADA385933B47F32A'),(58,'component','Creates and defines a component object; encloses functionality that you build in CFML and enclose within cffunction tags. This tag contains one or more cffunction tags that define methods. Code within the body of this tag, other than cffunction tags, is executed when the component is instantiated.',1,3,0,0,4,1,'CA3F3EECE486C7B76C2892D10628C73F'),(59,'tree','Lets you put a tree control in a cfform. Validates user selections. Tree items are created with \n  cftreeitem tags inside the cftree tag block. You can use a ColdFusion query to supply data to the tree.',1,3,0,0,4,1,'247888CA878161C4039C842EFE11734B'),(60,'param','Tests for a parameter\'s existence, tests its data type, and provides a default value if one \n  is not assigned.',1,3,0,0,4,1,'F198574739F741620234AEBCB4900D47'),(61,'table','Builds a table in a ColdFusion page. Use the cfcol tag to define table column and row \n  characteristics. The cftable tag renders data either as preformatted text, or, with the HTMLTable \n  attribute, as an HTML table. Use cftable to create tables if you don\'t want to write HTML table tag \n  code, or if your data can be well presented as preformatted text.',1,3,0,0,4,1,'A563C0E6C89B380804B4CBADB997D947'),(62,'logout','',1,3,0,0,4,1,'F8549B923DAEAB7E72AA57F954A5812B'),(63,'grid','Used inside cfform, cfgrid lets you place a grid control in a ColdFusion form. A grid control is \n  	a table of data divided into rows and columns. The cfgrid tag column data is specified with cfgridcolumn tags.',1,3,0,0,4,1,'9165D4F121F0E2C869D12D13AAE42CEC'),(64,'applet','Used in a cfform tag, cfapplet lets you reference custom Java applets that you have registered \n			using the ColdFusion Administrator.\n			To register a Java applet, open the ColdFusion Administrator and click Applets.',1,3,0,0,4,1,'C2E133439182396140BB5DF21C71FE71'),(65,'stopwatch','Stops the time from starttag to endtag',1,3,0,0,4,1,'B678EC7F97AA8A20DD5EDEAF915B2F1D'),(66,'header','Generates custom HTTP response headers to return to the client.',1,3,0,0,4,1,'5EDB07177153A72D401C7C175605EAE4'),(67,'catch','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,3,0,0,4,1,'BC28A79CF24B15716ED7F94BB91D2833'),(68,'associate','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,3,0,0,4,1,'503753C06B273F8ECAA0A41092EA6DCD'),(69,'throw','The cfthrow tag raises a developer-specified exception that can be caught with cfcatch tag \n  having any of the following type specifications - cfcatch type = \'custom_type\', cfcatch type = \'Application\'\n  \'cfcatch\' type = \'Any\'',1,3,0,0,4,1,'E689AD7E49923782AA7B6A41730E83B6'),(70,'elseif','Used with cfelse and cfelseif, \n			cfif lets you create simple and compound conditional statements \n			in CFML. The value in the cfif tag can be any expression.',1,3,0,0,4,1,'76546A4D1152DBAC1E4FDFE241CF7A3D'),(71,'dump','Outputs variables for debugging purposes. Using cfdump, you can display the contents of simple variables, queries, \n  arrays, structures, and WDDX variables created with cfwddx. if no var attribute defined it dump the hole site information',1,3,0,0,4,1,'1FD4B8254556F032F2CB0CD91D0D80C4'),(72,'http','Lets you execute HTTP POST and GET operations on files. Using cfhttp, you can execute standard \n  GET operations and create a query object from a text file. POST operations lets you upload MIME file \n  types to a server, or post cookie, formfield, URL, file, or CGI variables directly to a specified server.',1,3,0,0,4,1,'F0E11D8228169062E6D35513895F9CAE'),(73,'treeitem','Populates a tree control, created with cftree, with elements. You can use the img values \n  supplied with ColdFusion or reference your own icons.',1,3,0,0,4,1,'CDBCA189F9ED9AF5351DC2C5345C38B0'),(74,'forward','forward the request to a other path.',1,3,0,0,4,1,'9CADC0404C0278085F1F3847750FBCF5'),(75,'abort','Stops processing of a page at the tag location. ColdFusion returns everything that was processed before the cfabort tag. The cfabort tag is often used with conditional logic to stop processing a page when a condition occurs.',1,3,0,0,4,1,'84B07B4A973AB80C5F4BCEB7FA21BC1D'),(76,'login','',1,3,0,0,4,1,'27BFD5A475C2FB3080E4434B6070829B'),(77,'registry','Reads, writes, and deletes keys and values in the system registry. The cfregistry tag is supported \n  on all platforms, including Linux, Solaris, and HP-UX.',1,3,0,0,4,1,'618E2A6F753C205F413F80129F8A5EF7'),(78,'lock','Provides two types of locks to ensure the integrity of shared data: Exclusive lock and Read-only \n  lock. An exclusive lock single-threads access to the CFML constructs in its body. Single-threaded access \n  implies that the body of the tag can be executed by at most one request at a time. A request executing \n  inside a cflock tag has an \"exclusive lock\" on the tag. No other requests can start executing inside the \n  tag while a request has an exclusive lock. ColdFusion issues exclusive locks on a first-come, first-served \n  basis. A read-only lock allows multiple requests to access the CFML constructs inside its body concurrently. \n  Therefore, read-only locks should be used only when the shared data is read only and not modified. If another \n  request already has an exclusive lock on the shared data, the request waits for the exclusive lock to be \n  released.',1,3,0,0,4,1,'41472FF7281ABBD57F9AC1C5916D6109'),(79,'flush','Flushes currently available data to the client.',1,3,0,0,4,1,'81C3171D3D9E89597B631E2547A7DD34'),(80,'collection','Allows you to create and administer Search collections.',1,3,0,0,4,1,'2223C8725149C8348F42DFA48181E235'),(81,'procresult','Specifies a result set name that other ColdFusion tags, such as cfoutput and cftable, use to access \n  the result set. It also lets you optionally identify which of the stored procedure\'s result sets to \n  return. The cfprocresult tag is nested within a cfstoredproc tag.',1,3,0,0,4,1,'C67E7EA1B2365238280B602239F66551'),(82,'property','Defines components as complex types that are used for web services authoring. The attributes of this tag are exposed as component metadata and are subject to inheritance rules.',1,3,0,0,4,1,'2300090EF5D7FFDAA804B04777836AF7'),(83,'loop','Looping is a very powerful programming technique that lets you repeat a set of instructions or \n  display output repeatedly until one or more conditions are met. cfloop supports five types of loops.',1,3,0,0,4,1,'CBDE59491DAE41ECABE3F0931F85BC20'),(84,'error','Enables the display of customized HTML pages when errors occur. This lets you maintain a \n  consistent look and feel within your application, even when errors occur.',1,3,0,0,4,1,'C1FFF845651D5DE0E752EAA068230240'),(85,'setting','Controls various aspects of page processing, such as the output of HTML code in pages. One \n  benefit of this option is managing whitespace that can occur in output pages served by ColdFusion.',1,3,0,0,4,1,'02B57CA6140447C819307A8B4DF5AC19'),(86,'object','Lets you call methods in COM, CORBA, and JAVA objects.',1,3,0,0,4,1,'921D4F96880D21BFC65B32A8D1C2A509'),(87,'graph','Displays a graphical representation of data.',1,3,0,0,4,1,'06F1DACDD057CE46E49B0C87D8712F80'),(88,'htmlhead','Writes the text specified in the text attribute to the \'head\' section of a generated HTML page. \n	 The cfhtmlhead tag can be useful for embedding JavaScript code, or placing other HTML tags such, as \n	 META, LINK, TITLE, or BASE in an HTML page header.',1,3,0,0,4,1,'C71A7102345F27C48CFCC027491E0C44'),(89,'queryparam','Checks the data type of a query parameter. The cfqueryparam tag is nested within a cfquery tag. \n  It is embedded within the query SQL statement. If you specify its optional parameters, cfqueryparam \n  also performs data validation.',1,3,0,0,4,1,'4E2CD430689DC9F99622BC9B004485A5'),(90,'procparam','Specifies parameter information, including type, name, value, and length. The cfprocparam tag \n  is nested within a cfstoredproc tag.',1,3,0,0,4,1,'CFA4ECEAEF9DB5DC16DF2C6609197ABC'),(91,'pop','Retrieves and deletes e-mail messages from a POP mail server.',1,3,0,0,4,1,'DFA30D2735C397E6EDD895D0335A1D55'),(92,'select','Used inside cfform, cfselect lets you construct a drop-down list box form control. You can \n  populate the drop-down list box from a query, or using the option tag. Use option elements to populate \n  lists. The syntax for the option tag is the same as for its HTML counterpart.',1,3,0,0,4,1,'89AAB1AF54130C1BB3B9957885EBDD7D'),(93,'index','Populates collections with indexed data. The cfindex and cfsearch tags encapsulate the Verity \n  indexing and searching utilities. Verity collections can be populated from text files in a directory \n  you specify, or from a query generated by a ColdFusion query. Before you can populate a Verity collection, \n  you must create the collection using either the cfcollection tag or the ColdFusion Administrator. Use \n  cfsearch to search collections you populate with cfindex.',1,3,0,0,4,1,'E7A36FBAEFF96CDB92D46771C48DCEDA'),(94,'while','same like loop-contition but easier to use',1,3,0,0,4,1,'84009121067F8C832F5C54F4F338DA39'),(95,'location','Opens a ColdFusion page or HTML file. For example, you might use cflocation to specify a standard \n  message or response that you use in several ColdFusion applications. Use the addToken attribute to verify \n  client requests.',1,3,0,0,4,1,'A7A2B8BE428307ED799CFBC0BDAF24FD'),(96,'gridrow','Lets you define a cfgrid that does not use a query as source for row data. If a query attribute is\n  specified in cfgrid, the cfgridrow tags are ignored.',1,3,0,0,4,1,'AE239BA2FD40D42834F088D59EDFDC1C'),(97,'module','Invokes a custom tag for use in ColdFusion application pages. The cfmodule tag can help deal with \n  custom tag name conflicts. Use the template attribute to name a ColdFusion page that contains the custom \n  tag definition, including its path. Use the name attribute to refer to the custom tag using a dot \n  notation scheme to indicate the location of the custom tag in the ColdFusion installation directory.',1,3,0,0,4,1,'1B259577A2ACA9B62FB46B801D91489E'),(98,'xml','Creates a ColdFusion XML document object that contains the markup in the tag body. This tag can include XML and CFML tags. ColdFusion processes the CFML code in the tag body, then assigns the resulting text to an XML document object variable.',1,3,0,0,4,1,'31F68B7E097B95FA1B6F6C0EFFA73201'),(99,'input','Used inside cfform to place radio buttons, checkboxes, or text boxes. Provides input \n  validation for the specified control type.',1,3,0,0,4,1,'8096302CB463DABCD4CF70398C64328A'),(100,'servletparam','A child of cfservlet. It passes data to the servlet. Each cfservletparam tag within the cfservlet \n  block passes a separate piece of data to the servlet.',1,3,0,0,4,1,'91919BAB5802E9E4AB01F78790576028'),(101,'sleep','Pauses the execution of the page for a given interval',1,3,0,0,4,1,'E2698C794E03DB564DBC346349839D74'),(102,'application','Defines scoping for a ColdFusion application, enables or disables storing client variables, \n			and specifies a client variable storage mechanism. \n			By default, client variables are disabled. Also, enables session variables and sets timeouts \n			for session and application variables. Session and application variables are stored in memory.',1,3,0,0,4,2,'8AC18379DB3A1BB89BA8FABC483D7C51'),(103,'textarea','Puts a multiline text entry box in a cfform tag and controls its display characteristics',1,3,0,0,4,2,'C595D95AB0D9A804B0A541E351A6EF77'),(104,'reportparam','Runs a predefined Crystal Reports report.',1,3,0,0,4,2,'8B93CA6C187D78219F721C9C52C6EA84'),(105,'directory','Handles interactions with directories.',1,3,0,0,4,2,'B7D5B0F55A524730533DB390C150ABEE'),(106,'log','Writes a message to a log file.',1,3,0,0,4,2,'3B78DF1AEF8A2E97DEB5FF0BA1C5C3BB'),(107,'invokeargument','Argument for the Invoke Tag',1,3,0,0,4,2,'3290024C7B7E51CF6A51BAAA6706143E'),(108,'report','Runs a predefined Crystal Reports report.',1,3,0,0,4,2,'0F38DE88D16A14629692E63871E17195'),(109,'schedule','Provides a programmatic interface to the ColdFusion scheduling engine. You can run a specified \n  page at scheduled intervals with the option to write out static HTML pages. This lets you offer users \n  access to pages that publish data, such as reports, without forcing users to wait while a database transaction \n  is performed in order to populate the data on the page. \n  ColdFusion scheduled events are registered using the ColdFusion Administrator. Execution of cfschedule \n  can be disabled in the Administrator. \n  Information supplied by the user includes the scheduled ColdFusion page to execute, the time and frequency \n  for executing the page, and whether the output from the task is published. If the output is published, \n  a path and file are specified. \n  The event submission and its success or failure status is written to the cfusion-log-schedule.log file.',1,3,0,0,4,2,'CCA9BB31BE9D58C75C9DF8472DACD1CA'),(110,'form','Builds a form with CFML custom control tags that provide more functionality than standard \n  HTML form input elements.',1,3,0,0,4,2,'DCD12327E528EAF20626958607EC7763'),(111,'httpparam','Required for cfhttp POST operations, cfhttpparam is used to specify the parameters necessary to \n	 build a cfhttp POST.',1,3,0,0,4,2,'B1A38742C1BDB73946C0A54A73AA7036'),(112,'formitem','',1,3,0,0,4,2,'ECBA5CFF671679BB36AA33047DE60014'),(113,'calendar','',1,3,0,0,4,2,'00611A552FC72D65A99A432C0128B0C1'),(114,'documentitem','',1,3,0,0,4,2,'6B9CE307AB24A7980B0F62AC48DEF7C3'),(115,'mail','Sends e-mail messages by an SMTP server.',1,3,0,0,4,2,'4F8476A06D1A2E7FB30284634C64C5FB'),(116,'documentsection','',1,3,0,0,4,2,'550FFBC5E1D1C8EAEB2ECBA143389648'),(117,'search','Executes searches against data indexed in Verity collections. Collections can be created by \n  calling the cfcollection tag, by using the ColdFusion Administrator, or through native Verity indexing \n  tools. Collections are populated with data either with the cfindex tag, or externally, using native \n  Verity indexing tools. Collections must be created and populated before any searches can be executed.',1,3,0,0,4,2,'1DD83F4B8D3453BBD51D8C61499136FB'),(118,'content','Defines the MIME type returned by the current page. Optionally, lets you specify the name of a file\n  to be returned with the page.',1,3,0,0,4,2,'7AA8095F7E3828E8266E9B11D634769C'),(119,'file','Handles all interactions with files. The attributes you use with cffile depend on the value of the action attribute. \n For example, if the action = \"write\", use the attributes associated with writing a text file.',1,3,0,0,4,2,'02101722F4B97A389102427030A5484E'),(120,'invoke','Invokes component methods from within a ColdFusion page or component. \n			You use this tag to reference a WSDL file and consume a web service from within a block of CFML code.',1,3,0,0,4,2,'88D06F04184FD350C84C0A9F33E45576'),(121,'ldap','Provides an interface to LDAP Lightweight Directory Access Protocol \n  directory servers like the Netscape Directory Server.',1,3,0,0,4,2,'8D8A591D21F6565D6FB31038C46417E9'),(122,'cache','Speeds up page rendering when dynamic content does not have to be retrieved each time a user accesses\n  the page. To accomplish this, cfcache creates temporary files that contain the static HTML returned from\n  a ColdFusion page. You can use cfcache for simple URLs and URLs that contain URL parameters.',1,3,0,0,4,2,'7B59A12963B94A97742DAF7F948E637B'),(123,'storedproc','Executes stored procedures by an ODBC or native connection to a server database. It specifies database connection \n  information and identifies the stored procedure.',1,3,0,0,4,2,'E892554ECE952E3F1FDCCC2295E55021'),(124,'ftp','Lets users implement File Transfer Protocol (FTP) operations.',1,3,0,0,4,2,'064899926FEDF90CFD69D864E551FFD9'),(125,'function','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,3,0,0,4,2,'551752D4DA1CD0096A55D93CF0C3B7CD'),(126,'finally','',1,3,0,0,4,2,'4B3CE2364CFCEB2E8E52E52F88A5233E'),(127,'query','Passes SQL statements to a data source. Not limited to queries.',1,3,0,0,4,2,'FC7508C2949FF7BFCF7DEF9482944D61'),(128,'document','',1,3,0,0,4,2,'DAF0E707303081C8ABA6AD0DBFFEA23B'),(129,'timer','',1,3,0,0,4,2,'0A49C5034C17DDFA7C36C514307310C3'),(130,'trace','Displays and logs debugging data about the state of an application at the time the cftrace tag executes. \n			Tracks runtime logic flow, variable values, and execution time. Displays output at the end of the request \n			or in the debugging section at the end of the request; or, in Dreamweaver MX and later, in the Server Debug \n			tab of the Results window.',1,3,0,0,4,2,'A9FCD55DCFFC6733F805893E6069667B'),(131,'gridcolumn','Used with cfgrid in a cfform, you use cfgridcolumn to specify column data in a cfgrid control. Font and alignment \n  attributes used in cfgridcolumn override any global font or alignment settings defined in cfgrid.',1,3,0,0,4,2,'50FC6933F47D55792A1BAEDD425D16C1'),(132,'continue','',1,3,0,0,4,2,'6F2E383E8D24AD3A9869201D5B0FCCC8'),(133,'component','Creates and defines a component object; encloses functionality that you build in CFML and enclose within cffunction tags. This tag contains one or more cffunction tags that define methods. Code within the body of this tag, other than cffunction tags, is executed when the component is instantiated.',1,3,0,0,4,2,'44B21EFE5F53375EFD1A4D61B99C922B'),(134,'tree','Lets you put a tree control in a cfform. Validates user selections. Tree items are created with \n  cftreeitem tags inside the cftree tag block. You can use a ColdFusion query to supply data to the tree.',1,3,0,0,4,2,'622E3F4CC03A13193A38662C5A7A38E6'),(135,'param','Tests for a parameter\'s existence, tests its data type, and provides a default value if one \n  is not assigned.',1,3,0,0,4,2,'5EF6CCB45DF9A93B227EBC546FF2171A'),(136,'grid','Used inside cfform, cfgrid lets you place a grid control in a ColdFusion form. A grid control is \n  	a table of data divided into rows and columns. The cfgrid tag column data is specified with cfgridcolumn tags.',1,3,0,0,4,2,'F446C593E11BE8D96B0A4DA0FA100BD3'),(137,'chartseries','Used with the cfchart and cfchartseries tags. This tag defines chart data points. Its data is submitted to the cfchartseries tag.',1,3,0,0,4,2,'6204278E6ACAF1006DB35D1CBE8204E5'),(138,'throw','The cfthrow tag raises a developer-specified exception that can be 