access the CFML constructs inside its body concurrently. \n  Therefore, read-only locks should be used only when the shared data is read only and not modified. If another \n  request already has an exclusive lock on the shared data, the request waits for the exclusive lock to be \n  released.',1,3,0,0,4,2,'91409163298F408E8638CE5D60A5F9B5'),(144,'collection','Allows you to create and administer Search collections.',1,3,0,0,4,2,'1A03027B6C8B262CB3301A62FE6F0DFB'),(145,'procresult','Specifies a result set name that other ColdFusion tags, such as cfoutput and cftable, use to access \n  the result set. It also lets you optionally identify which of the stored procedure\'s result sets to \n  return. The cfprocresult tag is nested within a cfstoredproc tag.',1,3,0,0,4,2,'B2367DEF6D1E141F33A6DBD458E34062'),(146,'property','Defines components as complex types that are used for web services authoring. The attributes of this tag are exposed as component metadata and are subject to inheritance rules.',1,3,0,0,4,2,'53BA327734A3E7F5A069ED05DCC53D13'),(147,'setting','Controls various aspects of page processing, such as the output of HTML code in pages. One \n  benefit of this option is managing whitespace that can occur in output pages served by ColdFusion.',1,3,0,0,4,2,'9F52E010C56EBDFA994CEFAF41DE8EAB'),(148,'object','Lets you call methods in COM, CORBA, and JAVA objects.',1,3,0,0,4,2,'003A755D7031E58BB3554C69F2054B8A'),(149,'chartdata','Used with the cfchart and cfchartseries tags. This tag defines chart data points. Its data is submitted to the cfchartseries tag.',1,3,0,0,4,2,'D33B0D504E1E312374088E017683D68B'),(150,'formgroup','',1,3,0,0,4,2,'DB230E485A431EB3564A94DFE58554FB'),(151,'procparam','Specifies parameter information, including type, name, value, and length. The cfprocparam tag \n  is nested within a cfstoredproc tag.',1,3,0,0,4,2,'87C7CCA05064F5909547A0BFF28AF5AB'),(152,'select','Used inside cfform, cfselect lets you construct a drop-down list box form control. You 