heduled events are registered using the ColdFusion Administrator. Execution of cfschedule \n  can be disabled in the Administrator. \n  Information supplied by the user includes the scheduled ColdFusion page to execute, the time and frequency \n  for executing the page, and whether the output from the task is published. If the output is published, \n  a path and file are specified. \n  The event submission and its success or failure status is written to the cfusion-log-schedule.log file.',1,3,0,0,2,56,'3EFE9134D586A8578A8BA1BC12B23952'),(201,'form','Builds a form with CFML custom control tags that provide more functionality than standard \n  HTML form input elements.',1,3,0,0,4,56,'D4AFC994D2346AD92F40DED7F61A333A'),(202,'interface','',1,3,0,0,4,56,'C42A043EBFEA82195546DEBDC3D58163'),(203,'loginuser','',1,3,0,0,2,56,'D585E9D4E7FD7ECD2F0F5DBBD35ADFE4'),(204,'wddx','Serializes and de-serializes CFML data structures to the XML-based WDDX format. \n  Generates JavaScript statements to instantiate JavaScript objects equivalent to the contents of a \n  WDDX packet or some CFML data structures.',1,3,0,0,2,56,'AEB1494A6A52CDB9DD2EDE6736EA34B5'),(205,'argument','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,3,0,0,2,56,'7B84539C370EB795BEFA347621485454'),(206,'httpparam','Required for cfhttp POST operations, cfhttpparam is used to specify the parameters necessary to \n	 build a cfhttp POST.',1,3,0,0,2,56,'5A1F87141F012CD6873B08E46C8525FD'),(207,'formitem','',1,3,0,0,4,56,'B719CFADDD7CBEB7931F5985EA93AB34'),(208,'calendar','',1,3,0,0,2,56,'3D89DE9BF8CAEA90C6216EA13A141992'),(209,'videoplayerparam','play a video',1,3,0,0,2,56,'B5F5C89659865459A6BB048812F6E52D'),(210,'textinput','Lets you place a single-line text entry box in a cfform. The tag also gives you control over \n  font characteristics.',1,3,0,0,2,56,'4CD5FFA191BE7D8B99B1B2EE14A101DE'),(211,'import','To import a JSP Taglibrary or a CFML Custom Tag Directory',1,3,0,0,2,56,'6624552A8D4