presented as preformatted text.',1,3,0,0,4,56,'EE57D453AF42811AA331E4F8E4C21556'),(266,'logout','',1,3,0,0,2,56,'9DCD57B988AEED5C3FE3D67BB3A702A5'),(267,'grid','Used inside cfform, cfgrid lets you place a grid control in a ColdFusion form. A grid control is \n  	a table of data divided into rows and columns. The cfgrid tag column data is specified with cfgridcolumn tags.',1,3,0,0,4,56,'25B402F492FC7E840B73054BC4EB5C1A'),(268,'applet','Used in a cfform tag, cfapplet lets you reference custom Java applets that you have registered \n			using the ColdFusion Administrator.\n			To register a Java applet, open the ColdFusion Administrator and click Applets.',1,3,0,0,2,56,'1BD6A685E5B01EBDEDEB4197CE012190'),(269,'ajaxproxy','',1,3,0,0,2,56,'BAC16A5B83E91C9EE8405CE3D0EC0C42'),(270,'stopwatch','Stops the time from starttag to endtag',1,3,0,0,4,56,'65ECBB56203D65DBE167A3E02BC373BF'),(271,'feed','',1,3,0,0,2,56,'D9BB095636085B16F17FB206C7746D41'),(272,'chartseries','Used with the cfchart and cfchartseries tags. This tag defines chart data points. Its data is submitted to the cfchartseries tag.',1,3,0,0,4,56,'5AB315A7313B1DA3B99EDCEBCEF20A52'),(273,'header','Generates custom HTTP response headers to return to the client.',1,3,0,0,2,56,'2D5E9F82B4DC06503B0645FF31C6C80C'),(274,'catch','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,4,0,0,4,56,'9DA9CE5C68758F4D3F0D0E29ECDFE650'),(275,'throw','The cfthrow tag raises a developer-specified exception that can be caught with cfcatch tag \n  having any of the following type specifications - cfcatch type = \'custom_type\', cfcatch type = \'Application\'\n  \'cfcatch\' type = \'Any\'',1,3,0,0,2,56,'0A4D7625A7AE54C189BF85CFA929C2D6'),(276,'associate','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,3,0,0,2,56,'C14AF28779BEC2B610B01F8118AA599F'),(277,'elseif','Used with cfelse and cfelseif, \n			cfif lets you create simple and compound conditional statements \n			in CFML. The value in the cfif tag can be any expression.',1,1,0,0,2,56,'EF40862BB9D5A8A16A686AA8E762BDF5'),(278,'dump','Outputs variables for debugging purposes. Using cfdump, you can display the contents of simple variables, queries, \n  arrays, structures, and WDDX variables created with cfwddx. if no var attribute defined it dump the hole site information',1,3,0,0,2,56,'9255300F6468E92B38D9E37997DAEC0D'),(279,'http','Lets you execute HTTP POST and GET operations on files. Using cfhttp, you can execute standard \n  GET operations and create a query object from a text file. POST operations lets you upload MIME file \n  types to a server, or post cookie, formfield, URL, file, or CGI variables directly to a specified server.',1,3,0,0,4,56,'000419109295424B6FEA92D3278EF922'),(280,'treeitem','Populates a tree control, created with cftree, with elements. You can use the img values \n  supplied with ColdFusion or reference your own icons.',1,3,0,0,2,56,'4E09F3F757884BF3439366E92DDDABDB'),(281,'forward','forward the request to a other path.',1,3,0,0,2,56,'855487A146832A734083EBD39B57A777'),(282,'abort','Stops processing of a page at the tag location. ColdFusion returns everything that was processed before the cfabort tag. The cfabort tag is often used with conditional logic to stop processing a page when a condition occurs.',1,3,0,0,2,56,'073C40A84B3942F4A362F4067EA098DE'),(283,'textareaxxx','Puts a multiline text entry box in a cfform tag and controls its display characteristics',1,3,0,0,4,56,'07627343E7BB17296671D98B8A1D971F'),(284,'login','',1,3,0,0,4,56,'36546B7FB89E8EC711A8C97C3FF610BD'),(285,'registry','Reads, writes, and deletes keys and values in the system registry. The cfregistry tag is supported \n  on all platforms, including Linux, Solaris, and HP-UX.',1,3,0,0,2,56,'C84611A9CBE256AFA05626E0F43B3DE8'),(286,'lock','Provides two types of locks to ensure the integrity of shared data: Exclusive lock and Read-only \n  lock. An exclusive lock single-threads access to the CFML constructs in its body. Single-threaded access \n  implies that the body of the tag can be executed by at most one request at a time. A request executing \n  inside a cflock tag has an \"exclusive lock\" on the tag. No other requests can start executing inside the \n  tag while a request has an exclusive lock. ColdFusion issues exclusive locks on a first-come, first-served \n  basis. A read-only lock allows multiple requests to access the CFML constructs inside its body concurrently. \n  Therefore, read-only locks should be used only when the shared data is read only and not modified. If another \n  request already has an exclusive lock on the shared data, the request waits for the exclusive lock to be \n  released.',1,3,0,0,4,56,'210EFF21F9462684EB6D7B1FC0349261'),(287,'pdf','',1,3,0,0,4,56,'3E605B8A159DFF31EAE97B47D3C99A79'),(288,'flush','Flushes currently available data to the client.',1,3,0,0,2,56,'047E58752010F9BBD1AB8CE09A7C125A'),(289,'collection','Allows you to create and administer Search collections.',1,3,0,0,2,56,'82D31654EFA0464DA874CFAE9EF47721'),(290,'procresult','Specifies a result set name that other ColdFusion tags, such as cfoutput and cftable, use to access \n  the result set. It also lets you optionally identify which of the stored procedure\'s result sets to \n  return. The cfprocresult tag is nested within a cfstoredproc tag.',1,3,0,0,2,56,'9820E153AFAD85EFE17D426CC2523E66'),(291,'property','Defines components as complex types that are used for web services authoring. The attributes of this tag are exposed as component metadata and are subject to inheritance rules.',1,3,0,0,2,56,'7F10FBD4608637601408E644770919C0'),(292,'loop','Looping is a very powerful programming technique that lets you repeat a set of instructions or \n  display output repeatedly until one or more conditions are met. cfloop supports five types of loops.',1,3,0,0,4,56,'01D0242BC58324A66E4F0B68BAEC9436'),(293,'error','Enables the display of customized HTML pages when errors occur. This lets you maintain a \n  consistent look and feel within your application, even when errors occur.',1,3,0,0,2,56,'8547B643206E79A730D09A1A7552389D'),(294,'setting','Controls various aspects of page processing, such as the output of HTML code in pages. One \n  benefit of this option is managing whitespace that can occur in output pages served by ColdFusion.',1,3,0,0,4,56,'61B9FA9E24FAD1F3980CFA0A210247CA'),(295,'image','Lets you resize and add labels to GIF and JPEG format images.',1,3,0,0,2,56,'5592164A5399FC5AC151D08DFA86EAE6'),(296,'object','Lets you call methods in COM, CORBA, and JAVA objects.',1,3,0,0,2,56,'8B01D821300CE6657E34A1B2173DE0EA'),(297,'graph','Displays a graphical representation of data.',1,3,0,0,4,56,'D182D5CCCCB6FC24BE40BC0599B03598'),(298,'chartdata','Used with the cfchart and cfchartseries tags. This tag defines chart data points. Its data is submitted to the cfchartseries tag.',1,3,0,0,2,56,'46C281F3A34AFD64A11AB1FB415A3E01'),(299,'htmlhead','Writes the text specified in the text attribute to the \'head\' section of a generated HTML page. \n	 The cfhtmlhead tag can be useful for embedding JavaScript code, or placing other HTML tags such, as \n	 META, LINK, TITLE, or BASE in an HTML page header.',1,3,0,0,2,56,'1BC81BD8F1106D2ED619EB3E881A40B3'),(300,'formgroup','',1,3,0,0,4,56,'A7DA7F69F478114F02B80EEA13AE117B'),(301,'queryparam','Checks the data type of a query parameter. The cfqueryparam tag is nested within a cfquery tag. \n  It is embedded within the query SQL statement. If you specify its optional parameters, cfqueryparam \n  also performs data validation.',1,3,0,0,2,56,'138E0FAC528CF8FA4161F04348512573'),(302,'procparam','Specifies parameter information, including type, name, value, and length. The cfprocparam tag \n  is nested within a cfstoredproc tag.',1,3,0,0,2,56,'D120742EF8647BF61439D4750E0ADED4'),(303,'pop','Retrieves and deletes e-mail messages from a POP mail server.',1,3,0,0,2,56,'B0323DCFF0E334221960FE1326DEE9E3'),(304,'select','Used inside cfform, cfselect lets you construct a drop-down list box form control. You can \n  populate the drop-down list box from a query, or using the option tag. Use option elements to populate \n  lists. The syntax for the option tag is the same as for its HTML counterpart.',1,3,0,0,4,56,'C8D73ACC27161A94F8FC2FEF2711F904'),(305,'pdfparam','Provides additional information for the cfpdf tag. The cfpdfparam tag applies only to the merge action of the cfpdf tag and is always a child tag of the cfpdf tag.',1,3,0,0,2,56,'C71DFDF2E34EEE512CF51D8488E734F0'),(306,'chart','',1,3,0,0,4,56,'38BC240A46B009BD3A42E457DB406FB2'),(307,'index','Populates collections with indexed data. The cfindex and cfsearch tags encapsulate the Verity \n  indexing and searching utilities. Verity collections can be populated from text files in a directory \n  you specify, or from a query generated by a ColdFusion query. Before you can populate a Verity collection, \n  you must create the collection using either the cfcollection tag or the ColdFusion Administrator. Use \n  cfsearch to search collections you populate with cfindex.',1,3,0,0,2,56,'32C3CED4924238C8D5602230852B6053'),(308,'ntauthenticate','',1,3,0,0,2,56,'475D7D7462E8EC6B9B085BF78D084928'),(309,'while','same like loop-contition but easier to use',1,1,0,0,4,56,'68D37D96A9E3CD2461774EE668CFD75B'),(310,'location','Opens a ColdFusion page or HTML file. For example, you might use cflocation to specify a standard \n  message or response that you use in several ColdFusion applications. Use the addToken attribute to verify \n  client requests.',1,3,0,0,2,56,'AC25D25AD9F0C6C6B3009EC314328067'),(311,'gridrow','Lets you define a cfgrid that does not use a query as source for row data. If a query attribute is\n  specified in cfgrid, the cfgridrow tags are ignored.',1,3,0,0,2,56,'4334F3F14B0A0C99ABBC500EB9FEACB4'),(312,'module','Invokes a custom tag for use in ColdFusion application pages. The cfmodule tag can help deal with \n  custom tag name conflicts. Use the template attribute to name a ColdFusion page that contains the custom \n  tag definition, including its path. Use the name attribute to refer to the custom tag using a dot \n  notation scheme to indicate the location of the custom tag in the ColdFusion installation directory.',1,4,0,0,4,56,'9C56E215A173C4C886B30CCF1B5E2218'),(313,'xml','Creates a ColdFusion XML document object that contains the markup in the tag body. This tag can include XML and CFML tags. ColdFusion processes the CFML code in the tag body, then assigns the resulting text to an XML document object variable.',1,3,0,0,4,56,'895D2B9A43F751B956E1B86B63792879'),(314,'input','Used inside cfform to place radio buttons, checkboxes, or text boxes. Provides input \n  validation for the specified control type.',1,3,0,0,2,56,'200E5064F96801425423332FF4F4B819'),(315,'servletparam','A child of cfservlet. It passes data to the servlet. Each cfservletparam tag within the cfservlet \n  block passes a separate piece of data to the servlet.',1,3,0,0,2,56,'088018CACCB139FC714F50FBCF95B8F3'),(316,'imap','Retrieves and deletes e-mail messages from a Imap mail server.',1,3,0,0,2,56,'8BB48891B00A30079A20EB58D512770B'),(317,'sleep','Pauses the execution of the page for a given interval',1,3,0,0,2,56,'3FDAE09B28AB7ABA9EF8DCF756203D4D'),(318,'application','Defines scoping for a ColdFusion application, enables or disables storing client variables, \n			and specifies a client variable storage mechanism. \n			By default, client variables are disabled. Also, enables session variables and sets timeouts \n			for session and application variables. Session and application variables are stored in memory.',1,3,0,0,2,57,'A2594BEA651E75082D3821A86E7401AB'),(319,'thread','',1,3,0,0,4,57,'50A7880F02CCC3D333133C421BA14BC8'),(320,'schedule','Provides a programmatic interface to the ColdFusion scheduling engine. You can run a specified \n  page at scheduled intervals with the option to write out static HTML pages. This lets you offer users \n  access to pages that publish data, such as reports, without forcing users to wait while a database transaction \n  is performed in order to populate the data on the page. \n  ColdFusion scheduled events are registered using the ColdFusion Administrator. Execution of cfschedule \n  can be disabled in the Administrator. \n  Information supplied by the user includes the scheduled ColdFusion page to execute, the time and frequency \n  for executing the page, and whether the output from the task is published. If the output is published, \n  a path and file are specified. \n  The event submission and its success or failure status is written to the cfusion-log-schedule.log file.',1,3,0,0,2,57,'59E91D172515FA4BFE22F687C27D2A0A'),(321,'videoplayerparam','play a video',1,3,0,0,2,57,'678CFCD3CED0FF3FC74BC0061829C966'),(322,'dbinfo','Lets you retrieve information about a data source, including details about the database, tables, queries, procedures, foreign keys, indexes, and version information about the database, driver, and JDBC. This tag supports only JDBC drivers, and does not support ODBC-based drivers, including the Microsoft Access driver.',1,3,0,0,2,57,'356FE2DC71236A9C3AD5E93E00CBD909'),(323,'storedproc','Executes stored procedures by an ODBC or native connection to a server database. It specifies database connection \n  information and identifies the stored procedure.',1,3,0,0,4,57,'A4766CC166FC0B04BC607F7FEE6320CE'),(324,'savecontent','Saves the generated content inside the tag body in a variable.',1,3,0,0,4,57,'5EDB1430468FCD65EBA74C0E9F58EA3E'),(325,'execute','Enables ColdFusion developers to execute a process on a server computer.',1,3,0,0,4,58,'1BF9BE178A688BCD0E7FEDEFDA7853BA'),(326,'silent','Suppresses all output that is produced by the CFML within the tag\'s scope.',1,3,0,0,4,59,'CEA69A0257693E6CBBC37F8371CA56B0'),(327,'application','Defines scoping for a ColdFusion application, enables or disables storing client variables, \n			and specifies a client variable storage mechanism. \n			By default, client variables are disabled. Also, enables session variables and sets timeouts \n			for session and application variables. Session and application variables are stored in memory.',1,3,0,0,2,62,'7B494BDD651009876017041D22EFA599'),(328,'thread','',1,3,0,0,4,62,'CC264783BEFE157B8839C44627E50CB8'),(329,'reportparam','Runs a predefined Crystal Reports report.',1,3,0,0,2,62,'610CC4387A91C2FE2D71FC88232895A4'),(330,'directory','Handles interactions with directories.',1,3,0,0,2,62,'BAB2C688E9CD122ED53D0541E6A40C3C'),(331,'invokeargument','Argument for the Invoke Tag',1,3,0,0,2,62,'03944754A4745544D7896548F9DF6DA8'),(332,'schedule','Provides a programmatic interface to the ColdFusion scheduling engine. You can run a specified \n  page at scheduled intervals with the option to write out static HTML pages. This lets you offer users \n  access to pages that publish data, such as reports, without forcing users to wait while a database transaction \n  is performed in order to populate the data on the page. \n  ColdFusion scheduled events are registered using the ColdFusion Administrator. Execution of cfschedule \n  can be disabled in the Administrator. \n  Information supplied by the user includes the scheduled ColdFusion page to execute, the time and frequency \n  for executing the page, and whether the output from the task is published. If the output is published, \n  a path and file are specified. \n  The event submission and its success or failure status is written to the cfusion-log-schedule.log file.',1,3,0,0,2,62,'17DD94EDE6CEBF0E5BA8772190A8FC99'),(333,'form','Builds a form with CFML custom control tags that provide more functionality than standard \n  HTML form input elements.',1,3,0,0,4,62,'7CF1C0634200A3FEA0A9B519DF448934'),(334,'loginuser','',1,3,0,0,2,62,'65153B5D213FAF44092998E9A658FE5F'),(335,'wddx','Serializes and de-serializes CFML data structures to the XML-based WDDX format. \n  Generates JavaScript statements to instantiate JavaScript objects equivalent to the contents of a \n  WDDX packet or some CFML data structures.',1,3,0,0,2,62,'417B8B04FA6713D148E2CC10DC413092'),(336,'argument','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,3,0,0,2,62,'49F7F4F713AC135DCC7EEF6CF616959B'),(337,'httpparam','Required for cfhttp POST operations, cfhttpparam is used to specify the parameters necessary to \n	 build a cfhttp POST.',1,3,0,0,2,62,'AAC9BA46B18D85572C231F195EF0EE31'),(338,'formitem','',1,3,0,0,4,62,'6A483EE9CCCD1C9685F700CC84885485'),(339,'textinput','Lets you place a single-line text entry box in a cfform. The tag also gives you control over \n  font characteristics.',1,3,0,0,2,62,'20FBD3709FE6C6F99650D64AF60A5E49'),(340,'execute','Enables ColdFusion developers to execute a process on a server computer.',1,3,0,0,4,62,'D21B90102F88878B5B02D8D08AD0E483'),(341,'mail','Sends e-mail messages by an SMTP server.',1,3,0,0,4,62,'0341C99B248B527D17238F6D4E4CCE77'),(342,'videoplayer','play a video',1,3,0,0,4,62,'CC301D584A24961828DA42271F1B2D71'),(343,'search','Executes searches against data indexed in Verity collections. Collections can be created by \n  calling the cfcollection tag, by using the ColdFusion Administrator, or through native Verity indexing \n  tools. Collections are populated with data either with the cfindex tag, or externally, using native \n  Verity indexing tools. Collections must be created and populated before any searches can be executed.',1,3,0,0,2,62,'B1CE50AF273B721846D04A94F18EEC96'),(344,'zipparam','',1,3,0,0,2,62,'F9400BDDDF09269AA228A98D11926F86'),(345,'content','Defines the MIME type returned by the current page. Optionally, lets you specify the name of a file\n  to be returned with the page.',1,3,0,0,4,62,'FB14B3925E3096C50432169A9DD086FC'),(346,'file','Handles all interactions with files. The attributes you use with cffile depend on the value of the action attribute. \n For example, if the action = \"write\", use the attributes associated with writing a text file.',1,3,0,0,2,62,'99DD8E813560205452E98B94D72C246A'),(347,'invoke','Invokes component methods from within a ColdFusion page or component. \n			You use this tag to reference a WSDL file and consume a web service from within a block of CFML code.',1,3,0,0,4,62,'FC0141F3EEA277C9D8A88FA0C7B1FCE2'),(348,'cache','Speeds up page rendering when dynamic content does not have to be retrieved each time a user accesses\n  the page. To accomplish this, cfcache creates temporary files that contain the static HTML returned from\n  a ColdFusion page. You can use cfcache for simple URLs and URLs that contain URL parameters.',1,3,0,0,4,62,'D5C8A72E94E601D11DF41E1973EC7074'),(349,'function','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,3,0,0,4,62,'5C9363FA2231E932B40CC498631CE9A2'),(350,'video','play a video',1,3,0,0,2,62,'2F3CE7A2737E79EDBF8644923E741D79'),(351,'gridupdate','Used in a cfgrid, cfgridupdate allows you to perform updates to data sources directly from edited \n  grid data. The cfgridupdate tag provides a direct interface with your data source. \n  The cfgridupdate tag applies delete row actions first, then INSERT row actions, and then UPDATE row \n  actions. If an error is encountered, row processing stops.',1,3,0,0,2,62,'14A9AEF45F9FD7D6D26FFCA3D5BFAD11'),(352,'trace','Displays and logs debugging data about the state of an application at the time the cftrace tag executes. \n			Tracks runtime logic flow, variable values, and execution time. Displays output at the end of the request \n			or in the debugging section at the end of the request; or, in Dreamweaver MX and later, in the Server Debug \n			tab of the Results window.',1,3,0,0,4,62,'D670F0584CCC3DA9292F49F8265B2E60'),(353,'gridcolumn','Used with cfgrid in a cfform, you use cfgridcolumn to specify column data in a cfgrid control. Font and alignment \n  attributes used in cfgridcolumn override any global font or alignment settings defined in cfgrid.',1,3,0,0,2,62,'6CB9A548384F89F9B23FE161B5770F9D'),(354,'servlet','Executes a Java servlet on a JRun engine. This tag is used in conjunction with the \n  cfserletparam tag, which passes data to the servlet.',1,3,0,0,2,62,'FE3AEBEF70B2CE0B559C47891CEAF49B'),(355,'param','Tests for a parameter\'s existence, tests its data type, and provides a default value if one \n  is not assigned.',1,3,0,0,2,62,'0C6D2316B1E3D6EC71F6D93B497DC608'),(356,'zip','',1,3,0,0,4,62,'5FC2E860B8D9C5B7FC04A0964DAA0D57'),(357,'table','Builds a table in a ColdFusion page. Use the cfcol tag to define table column and row \n  characteristics. The cftable tag renders data either as preformatted text, or, with the HTMLTable \n  attribute, as an HTML table. Use cftable to create tables if you don\'t want to write HTML table tag \n  code, or if your data can be well presented as preformatted text.',1,3,0,0,4,62,'5A5FB4B9D4CE15807E82B78412414B72'),(358,'grid','Used inside cfform, cfgrid lets you place a grid control in a ColdFusion form. A grid control is \n  	a table of data divided into rows and columns. The cfgrid tag column data is specified with cfgridcolumn tags.',1,3,0,0,4,62,'4AF14998BE48F3AEA840A46C750A3605'),(359,'ajaxproxy','',1,3,0,0,2,62,'BD1667CD544B037BCA0A9E90659C72B8'),(360,'stopwatch','Stops the time from starttag to endtag',1,3,0,0,4,62,'E3ECCE1409AE8A93A3773B31C5EEF064'),(361,'feed','',1,3,0,0,2,62,'3BB7E6C487D6E8A76BDD392B207A4597'),(362,'chartseries','Used with the cfchart and cfchartseries tags. This tag defines chart data points. Its data is submitted to the cfchartseries tag.',1,3,0,0,4,62,'A0596D224E3C592A9B6A7BD2220ABA00'),(363,'throw','The cfthrow tag raises a developer-specified exception that can be caught with cfcatch tag \n  having any of the following type specifications - cfcatch type = \'custom_type\', cfcatch type = \'Application\'\n  \'cfcatch\' type = \'Any\'',1,3,0,0,2,62,'5CA9F540162D4750119DF11B19E7B9A6'),(364,'associate','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,3,0,0,2,62,'E9E7A7F14EA00FB3DCA405B6E39404EF'),(365,'dump','Outputs variables for debugging purposes. Using cfdump, you can display the contents of simple variables, queries, \n  arrays, structures, and WDDX variables created with cfwddx. if no var attribute defined it dump the hole site information',1,3,0,0,2,62,'CE745CB07E17827379448D937103C811'),(366,'treeitem','Populates a tree control, created with cftree, with elements. You can use the img values \n  supplied with ColdFusion or reference your own icons.',1,3,0,0,2,62,'D5D2E0D08C8A2447EEADE797284A3AE0'),(367,'registry','Reads, writes, and deletes keys and values in the system registry. The cfregistry tag is supported \n  on all platforms, including Linux, Solaris, and HP-UX.',1,3,0,0,2,62,'85E0A2F004AC8D30F2EC65C46251F884'),(368,'lock','Provides two types of locks to ensure the integrity of shared data: Exclusive lock and Read-only \n  lock. An exclusive lock single-threads access to the CFML constructs in its body. Single-threaded access \n  implies that the body of the tag can be executed by at most one request at a time. A request executing \n  inside a cflock tag has an \"exclusive lock\" on the tag. No other requests can start executing inside the \n  tag while a request has an exclusive lock. ColdFusion issues exclusive locks on a first-come, first-served \n  basis. A read-only lock allows multiple requests to access the CFML constructs inside its body concurrently. \n  Therefore, read-only locks should be used only when the shared data is read only and not modified. If another \n  request already has an exclusive lock on the shared data, the request waits for the exclusive lock to be \n  released.',1,3,0,0,4,62,'17289A6C0521D44E0CD4A4115B174872'),(369,'pdf','',1,3,0,0,4,62,'EFDEB440668A4908B96AE2FE44C34401'),(370,'loop','Looping is a very powerful programming technique that lets you repeat a set of instructions or \n  display output repeatedly until one or more conditions are met. cfloop supports five types of loops.',1,3,0,0,4,62,'CFF4B1FCD5A92D0F5DDE6739453DF277'),(371,'setting','Controls various aspects of page processing, such as the output of HTML code in pages. One \n  benefit of this option is managing whitespace that can occur in output pages served by ColdFusion.',1,3,0,0,4,62,'5342BAD8FAA26751C0391E9E1F2335C4'),(372,'image','Lets you resize and add labels to GIF and JPEG format images.',1,3,0,0,2,62,'4A97E84548BAB084847D4F6461DB90DD'),(373,'object','Lets you call methods in COM, CORBA, and JAVA objects.',1,3,0,0,2,62,'42BD703D8841E7742257E6A3C09676BC'),(374,'graph','Displays a graphical representation of data.',1,3,0,0,4,62,'12DAE4E64B4F5F4144FE39C7D1ED70E1'),(375,'formgroup','',1,3,0,0,4,62,'1BBCEBDE061E1F6F8E04394BF877E3D0'),(376,'queryparam','Checks the data type of a query parameter. The cfqueryparam tag is nested within a cfquery tag. \n  It is embedded within the query SQL statement. If you specify its optional parameters, cfqueryparam \n  also performs data validation.',1,3,0,0,2,62,'5702A4EDB2C1A3A7BEACF6837A5291DA'),(377,'procparam','Specifies parameter information, including type, name, value, and length. The cfprocparam tag \n  is nested within a cfstoredproc tag.',1,3,0,0,2,62,'B4DB37DCEE6AA39831563BA8FCC13139'),(378,'select','Used inside cfform, cfselect lets you construct a drop-down list box form control. You can \n  populate the drop-down list box from a query, or using the option tag. Use option elements to populate \n  lists. The syntax for the option tag is the same as for its HTML counterpart.',1,3,0,0,4,62,'B7B5A9D69C155D97DD9B349017F367FF'),(379,'pdfparam','Provides additional information for the cfpdf tag. The cfpdfparam tag applies only to the merge action of the cfpdf tag and is always a child tag of the cfpdf tag.',1,3,0,0,2,62,'9FA7212C364A33A96F39EEE698C95244'),(380,'index','Populates collections with indexed data. The cfindex and cfsearch tags encapsulate the Verity \n  indexing and searching utilities. Verity collections can be populated from text files in a directory \n  you specify, or from a query generated by a ColdFusion query. Before you can populate a Verity collection, \n  you must create the collection using either the cfcollection tag or the ColdFusion Administrator. Use \n  cfsearch to search collections you populate with cfindex.',1,3,0,0,2,62,'FCA90DE208268F1AE244E966A8731CEE'),(381,'input','Used inside cfform to place radio buttons, checkboxes, or text boxes. Provides input \n  validation for the specified control type.',1,3,0,0,2,62,'99910FFC700BF791CCAB0EB4EEDC410C'),(382,'servletparam','A child of cfservlet. It passes data to the servlet. Each cfservletparam tag within the cfservlet \n  block passes a separate piece of data to the servlet.',1,3,0,0,2,62,'EEE27EC6950D74E118EC6F15B096DF6A'),(383,'cookie','Defines cookie variables, including expiration and security options.',1,3,0,0,2,64,'1CA0BE75A9DD17A9B831B1745A9434A9'),(384,'switch','Used with cfcase and cfdefaultcase. Evaluates a passed expression and passes control to the \n  cfcase tag that matches the expression result. You can optionally code a cfdefaultcase tag, which \n  receives control if there is no matching cfcase tag value.',1,2,0,0,4,83,'49B473E87087F32714FE23C163684CA4'),(385,'application','Defines scoping for a ColdFusion application, enables or disables storing client variables, \n			and specifies a client variable storage mechanism. \n			By default, client variables are disabled. Also, enables session variables and sets timeouts \n			for session and application variables. Session and application variables are stored in memory.',1,2,0,0,2,83,'1546F931698683AB3FABE0EEF1C934CA'),(386,'ajaximport','',1,2,0,0,2,83,'C8C55264868F683F1B73DB8B64AF0F56'),(387,'break','Used to break out of a cfloop,cfwhile or cfforeach.',1,2,0,0,2,83,'36754C206C370B8C37DB26EB645489A2'),(388,'mailparam','Can either attach a file or add a header to a message. It is nested within a cfmail tag. You can \n  use more than one cfmailparam tag within a cfmail tag.',1,2,0,0,2,83,'AF4B3B1222879870F0AB4E28C28999CE'),(389,'transaction','Groups multiple queries into a single unit. The cftransaction \n  tag provides commit and rollback processing.',1,2,0,0,4,83,'C17FCF9AFF88A9706C630C78FF980323'),(390,'reportparam','Runs a predefined Crystal Reports report.',1,2,0,0,2,83,'01C6DE48DB8FC1E3B874A2F750CF8EC8'),(391,'directory','Handles interactions with directories.',1,2,0,0,2,83,'8E9A602CAE58EA99BA78948544F6B543'),(392,'rethrow','Rethrows the currently active exception. Preserves the exception\'s cfcatch.type and cfcatch.\n  agContext information.',1,2,0,0,2,83,'684B4567F428856266FB84C743B3C353'),(393,'log','Writes a message to a log file.',1,2,0,0,2,83,'287E788D567E7630C7017553407DA1FF'),(394,'else','Used with cfelse and cfelseif, cfif lets you create simple and compound conditional statements \n	 in CFML. The value in the cfif tag can be any expression.',1,2,0,0,2,83,'A0C1C0715EFB8EA9C8E4D78EFD821356'),(395,'invokeargument','Argument for the Invoke Tag',1,2,0,0,2,83,'8F6C81B538F9F854DFC7BE8E84C420FF'),(396,'report','Runs a predefined Crystal Reports report.',1,2,0,0,4,83,'9091DFC3CCF949A3D6A328674D884FF8'),(397,'schedule','Provides a programmatic interface to the ColdFusion scheduling engine. You can run a specified \n  page at scheduled intervals with the option to write out static HTML pages. This lets you offer users \n  access to pages that publish data, such as reports, without forcing users to wait while a database transaction \n  is performed in order to populate the data on the page. \n  ColdFusion scheduled events are registered using the ColdFusion Administrator. Execution of cfschedule \n  can be disabled in the Administrator. \n  Information supplied by the user includes the scheduled ColdFusion page to execute, the time and frequency \n  for executing the page, and whether the output from the task is published. If the output is published, \n  a path and file are specified. \n  The event submission and its success or failure status is written to the cfusion-log-schedule.log file.',1,2,0,0,2,83,'202A9824EF4B866EB8AC89D30EBE1CEC'),(398,'form','Builds a form with CFML custom control tags that provide more functionality than standard \n  HTML form input elements.',1,2,0,0,4,83,'D2CD369878CA6B4F1DEFF24A901474CC'),(399,'interface','',1,2,0,0,4,83,'0E247A57179D1D7016FCABDE71CD8DF8'),(400,'loginuser','',1,2,0,0,2,83,'D48177CC4649DD879740BE558A548EA8'),(401,'wddx','Serializes and de-serializes CFML data structures to the XML-based WDDX format. \n  Generates JavaScript statements to instantiate JavaScript objects equivalent to the contents of a \n  WDDX packet or some CFML data structures.',1,2,0,0,2,83,'44F6BF0A4AA03A43FF1598C6E16A41F3'),(402,'argument','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,3,0,0,2,83,'627A2A930D2BDC299031F021C5A70971'),(403,'httpparam','Required for cfhttp POST operations, cfhttpparam is used to specify the parameters necessary to \n	 build a cfhttp POST.',1,2,0,0,2,83,'DDE3CFF315DEDB3866B5F91144C84A0B'),(404,'formitem','',1,2,0,0,4,83,'43707AB83AA860B2AE84598BE602E9AC'),(405,'calendar','',1,2,0,0,2,83,'F0D83A76B2F5182C10C6320B4F05AB3E'),(406,'videoplayerparam','play a video',1,2,0,0,2,83,'297F6EC8112D7CFE6B08CEA7D58B97CB'),(407,'textinput','Lets you place a single-line text entry box in a cfform. The tag also gives you control over \n  font characteristics.',1,2,0,0,2,83,'51C7FDB5015AE1341B02413417D384CB'),(408,'import','To import a JSP Taglibrary or a CFML Custom Tag Directory',1,2,0,0,2,83,'EFABAB4473087BB7C4336913B9E900DF'),(409,'output','Displays the results of a database query or other operation. To nest cfoutput tags, see the \"Usage\" section.',1,2,0,0,4,83,'582792BF22012BFB07E5182C6A3DFB6F'),(410,'script','Encloses a code segment containing cfscript.',1,2,0,0,4,83,'D30995E7605AA0897E886B8ECCBC7A1D'),(411,'documentitem','',1,2,0,0,4,83,'4D2A0E8DE812075C27DC2799EF774718'),(412,'div','',1,2,0,0,4,83,'7CDFD60C57B7022130A2945539573439'),(413,'execute','Enables ColdFusion developers to execute a process on a server computer.',1,2,0,0,4,83,'933528B42CC7261A0016CB55F16F5C9C'),(414,'mail','Sends e-mail messages by an SMTP server.',1,2,0,0,4,83,'D1EF50E15CC9871EAE0E8063A078DD20'),(415,'include','Lets you embed references to ColdFusion pages in CFML. You can embed cfinclude tags recursively. \n  For an additional method of encapsulating CFML',1,2,0,0,2,83,'BC48F137E81FDB5A069E21EDD9D3C5C5'),(416,'slider','Used inside cfform, cfslider lets you place a slider control in a ColdFusion form. A slider \n  control is like a sliding volume control. The slider groove is the area over which the slider moves.',1,2,0,0,2,83,'C56F55B612D4CF5524851D429037A62B'),(417,'processingdirective','Suppresses extra white space and other output, produced by CFML within the tag\'s scope.',1,2,0,0,4,83,'475ED78276E7765C155841C86D266F73'),(418,'try','Used with one or more cfcatch tags, the cftry tag lets you catch and process exceptions in \n  ColdFusion pages. Exceptions include events that disrupt the normal flow of instructions in a \n  ColdFusion page, such as failed database operations, missing include files, and developer-specified \n  events.',1,2,0,0,4,83,'937BD073688639BAEB35198B649966C5'),(419,'videoplayer','play a video',1,2,0,0,4,83,'4737ACDCB62E249C8EF8C83A494EF7FC'),(420,'exit','Used to: Abort the processing of the currently executing CFML custom tag, exit the template \n	within the currently executing CFML custom tag and reexecute a section of code within the currently\n	executing CFML custom tag',1,2,0,0,2,83,'DF7B7F540359C9636319AE7689E2F7E5'),(421,'documentsection','',1,2,0,0,4,83,'5F7359C1F7CB8924ED281FA936F114D6'),(422,'objectcache','Flushes the query cache',1,2,0,0,2,83,'B148D3B67C99C7F0C20F70F17AC14D71'),(423,'search','Executes searches against data indexed in Verity collections. Collections can be created by \n  calling the cfcollection tag, by using the ColdFusion Administrator, or through native Verity indexing \n  tools. Collections are populated with data either with the cfindex tag, or externally, using native \n  Verity indexing tools. Collections must be created and populated before any searches can be executed.',1,2,0,0,2,83,'420B46DDFF3DF1EB0E86B6649CEB66CC'),(424,'zipparam','',1,2,0,0,2,83,'B7E3A707FED2B4022FCD5BCD0B287E50'),(425,'graphdata','Specifies a data point to be displayed by a cfgraph tag.',1,2,0,0,2,83,'8BFA18DA96AC750B9E92954801E7FF6D'),(426,'dbinfo','Lets you retrieve information about a data source, including details about the database, tables, queries, procedures, foreign keys, indexes, and version information about the database, driver, and JDBC. This tag supports only JDBC drivers, and does not support ODBC-based drivers, including the Microsoft Access driver.',1,2,0,0,2,83,'5695AD9755C7E66605AA638B80CA62BF'),(427,'content','Defines the MIME type returned by the current page. Optionally, lets you specify the name of a file\n  to be returned with the page.',1,2,0,0,4,83,'F2F8FB6AAF4FB544467F76B3ECF7A64E'),(428,'col','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,2,0,0,2,83,'7F8C3D82BD2BD8A79499C1F93FDD7991'),(429,'file','Handles all interactions with files. The attributes you use with cffile depend on the value of the action attribute. \n For example, if the action = \"write\", use the attributes associated with writing a text file.',1,2,0,0,2,83,'9185792A293F42ECFC10084B7F75E1B5'),(430,'case','Handle one case of a cfswicth',1,2,0,0,4,83,'DCCADD5E18686566438254AB1DD02792'),(431,'invoke','Invokes component methods from within a ColdFusion page or component. \n			You use this tag to reference a WSDL file and consume a web service from within a block of CFML code.',1,3,0,0,4,83,'13C6FA37E771AFBD104972EBE6D95E08'),(432,'silent','Suppresses all output that is produced by the CFML within the tag\'s scope.',1,2,0,0,4,83,'86F1D08D6EC941C8DD24F3250F5DC375'),(433,'ldap','Provides an interface to LDAP Lightweight Directory Access Protocol \n  directory servers like the Netscape Directory Server.',1,2,0,0,2,83,'87FCBCB14DBDCA88EB5F7909354440E9'),(434,'cache','Speeds up page rendering when dynamic content does not have to be retrieved each time a user accesses\n  the page. To accomplish this, cfcache creates temporary files that contain the static HTML returned from\n  a ColdFusion page. You can use cfcache for simple URLs and URLs that contain URL parameters.',1,2,0,0,4,83,'E58EE7F9F41970AB5C64C2D472332169'),(435,'update','Updates existing records in data sources.',1,2,0,0,2,83,'12EE9DB69E476457B90E4F978EE9BF3A'),(436,'storedproc','Executes stored procedures by an ODBC or native connection to a server database. It specifies database connection \n  information and identifies the stored procedure.',1,2,0,0,4,83,'169E55637E17D20F9AD9CC726C3F314E'),(437,'insert','Inserts records in data sources.',1,2,0,0,2,83,'FEDCA19C0ECCDEDC1D5B7DF54ABB998E'),(438,'ftp','Lets users implement File Transfer Protocol (FTP) operations.',1,2,0,0,2,83,'BF02840FEA730C28EFF57F6DBFB42E6C'),(439,'video','play a video',1,2,0,0,2,83,'1A01F73D59FFA2DD4D731744AC5C441A'),(440,'mailpart','Specifies one part of a multipart e-mail message. Can only be used in the cfmail tag. You can use more than one cfmailpart tag within a cfmail tag',1,2,0,0,4,83,'FBF4080CCDDA4EE7897A4A3300EC16F9'),(441,'finally','',1,2,0,0,4,83,'5B0BCEE4364E78A4AC6267B2CA23AE5F'),(442,'gridupdate','Used in a cfgrid, cfgridupdate allows you to perform updates to data sources directly from edited \n  grid data. The cfgridupdate tag provides a direct interface with your data source. \n  The cfgridupdate tag applies delete row actions first, then INSERT row actions, and then UPDATE row \n  actions. If an error is encountered, row processing stops.',1,2,0,0,2,83,'8396E3D997DC15CB848948C2771C64CA'),(443,'query','Passes SQL statements to a data source. Not limited to queries.',1,2,0,0,4,83,'79085AA4D08244FA2CF84894858F3AE2'),(444,'defaultcase','Handles interactions with directories.',1,2,0,0,4,83,'69AAE5680EC8241A1F8EB77F2409BDCD'),(445,'document','',1,2,0,0,4,83,'D2EE22D34826660135A533751940CE3B'),(446,'timer','',1,2,0,0,4,83,'CBA75549957D56114003600D7DE5103A'),(447,'gridcolumn','Used with cfgrid in a cfform, you use cfgridcolumn to specify column data in a cfgrid control. Font and alignment \n  attributes used in cfgridcolumn override any global font or alignment settings defined in cfgrid.',1,2,0,0,2,83,'A7202F9DF4C272A0541387AECF9712E9'),(448,'trace','Displays and logs debugging data about the state of an application at the time the cftrace tag executes. \n			Tracks runtime logic flow, variable values, and execution time. Displays output at the end of the request \n			or in the debugging section at the end of the request; or, in Dreamweaver MX and later, in the Server Debug \n			tab of the Results window.',1,2,0,0,4,83,'D48F7E2D71980556368C7C1DC582C525'),(449,'cookie','Defines cookie variables, including expiration and security options.',1,2,0,0,2,83,'6F4E55FE7F2BBAD90EEE00F5B9EA9806'),(450,'servlet','Executes a Java servlet on a JRun engine. This tag is used in conjunction with the \n  cfserletparam tag, which passes data to the servlet.',1,2,0,0,2,83,'9D3BCE9BC38AE388B81BAEDAEF85D946'),(451,'continue','',1,2,0,0,2,83,'BE0D6FABD0A42CFBF9077EB951487704'),(452,'authenticate','Authenticates a user, setting a security context for the application. \n			For more information, see the descriptions of IsAuthenticated and AuthenticatedContext.',1,2,0,0,2,83,'16F338A909268D68A800A497BC6433F2'),(453,'savecontent','Saves the generated content inside the tag body in a variable.',1,2,0,0,4,83,'641C6177647FFD65F3E6AFA28EEF642B'),(454,'param','Tests for a parameter\'s existence, tests its data type, and provides a default value if one \n  is not assigned.',1,2,0,0,2,83,'D4003E15A8AF2B2D6A28E841CBBBB89B'),(455,'tree','Lets you put a tree control in a cfform. Validates user selections. Tree items are created with \n  cftreeitem tags inside the cftree tag block. You can use a ColdFusion query to supply data to the tree.',1,2,0,0,4,83,'F47FF483EC8FA614020D7BC2F461327E'),(456,'logout','',1,2,0,0,2,83,'E8CA0860A05C9182E3386A7F284CD1C8'),(457,'table','Builds a table in a ColdFusion page. Use the cfcol tag to define table column and row \n  characteristics. The cftable tag renders data either as preformatted text, or, with the HTMLTable \n  attribute, as an HTML table. Use cftable to create tables if you don\'t want to write HTML table tag \n  code, or if your data can be well presented as preformatted text.',1,2,0,0,4,83,'5A9A8FF0C91057CCFE1F464FBB7375F5'),(458,'zip','',1,2,0,0,4,83,'A4EC5F7C310642FDEC915AB233B43609'),(459,'grid','Used inside cfform, cfgrid lets you place a grid control in a ColdFusion form. A grid control is \n  	a table of data divided into rows and columns. The cfgrid tag column data is specified with cfgridcolumn tags.',1,2,0,0,4,83,'29C6EE4D119F8905B5DF1CBAF32717C5'),(460,'applet','Used in a cfform tag, cfapplet lets you reference custom Java applets that you have registered \n			using the ColdFusion Administrator.\n			To register a Java applet, open the ColdFusion Administrator and click Applets.',1,2,0,0,2,83,'0F332203C32D58B67D0891369B82E848'),(461,'ajaxproxy','',1,2,0,0,2,83,'4776316CED002B4280EF64DAB3B48CD5'),(462,'stopwatch','Stops the time from starttag to endtag',1,2,0,0,4,83,'0034937612EE85DD2D311DC752C1FAB0'),(463,'feed','',1,2,0,0,2,83,'C5634207BFB6679FB191A8B52D12B383'),(464,'header','Generates custom HTTP response headers to return to the client.',1,2,0,0,2,83,'503E21A897C25E95E0D7F3A56D283A26'),(465,'chartseries','Used with the cfchart and cfchartseries tags. This tag defines chart data points. Its data is submitted to the cfchartseries tag.',1,2,0,0,4,83,'DFA0049C37EDBDA4723D14C5316BE482'),(466,'associate','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,2,0,0,2,83,'D6B672BA4EBF7D7B78DDE4693B8708AC'),(467,'throw','The cfthrow tag raises a developer-specified exception that can be caught with cfcatch tag \n  having any of the following type specifications - cfcatch type = \'custom_type\', cfcatch type = \'Application\'\n  \'cfcatch\' type = \'Any\'',1,2,0,0,2,83,'F05B1368966FAF4D4FE7D0992B202D76'),(468,'http','Lets you execute HTTP POST and GET operations on files. Using cfhttp, you can execute standard \n  GET operations and create a query object from a text file. POST operations lets you upload MIME file \n  types to a server, or post cookie, formfield, URL, file, or CGI variables directly to a specified server.',1,2,0,0,4,83,'3A978C37345815271ED04323B738BE9A'),(469,'dump','',1,3,0,0,4,83,'D84B9A0CCCCFF200A9B53BDEDE649A73'),(470,'treeitem','Populates a tree control, created with cftree, with elements. You can use the img values \n  supplied with ColdFusion or reference your own icons.',1,2,0,0,2,83,'E7770480A9427DE5A67728FC4EA79D4E'),(471,'abort','Stops processing of a page at the tag location. CFML returns everything that was processed before the cfabort tag. The cfabort tag is often used with conditional logic to stop processing a page when a condition occurs.',1,2,0,0,2,83,'6193196829FD61403FA16B2397407638'),(472,'forward','forward the request to a other path.',1,2,0,0,2,83,'54DCD0C325F3AD66B1088ED936F3F7CD'),(473,'login','',1,2,0,0,4,83,'6C90A404011A5030A49D85DDF4DEFF62'),(474,'registry','Reads, writes, and deletes keys and values in the system registry. The cfregistry tag is supported \n  on all platforms, including Linux, Solaris, and HP-UX.',1,2,0,0,2,83,'33B491F4B65AC014F372C510175B3346'),(475,'lock','Provides two types of locks to ensure the integrity of shared data: Exclusive lock and Read-only \n  lock. An exclusive lock single-threads access to the CFML constructs in its body. Single-threaded access \n  implies that the body of the tag can be executed by at most one request at a time. A request executing \n  inside a cflock tag has an \"exclusive lock\" on the tag. No other requests can start executing inside the \n  tag while a request has an exclusive lock. ColdFusion issues exclusive locks on a first-come, first-served \n  basis. A read-only lock allows multiple requests to access the CFML constructs inside its body concurrently. \n  Therefore, read-only locks should be used only when the shared data is read only and not modified. If another \n  request already has an exclusive lock on the shared data, the request waits for the exclusive lock to be \n  released.',1,2,0,0,4,83,'D554D7924A979BA709240DD4D2202955'),(476,'pdf','',1,2,0,0,4,83,'BEC3DD962442CC207D875F953D074E96'),(477,'flush','Flushes currently available data to the client.',1,2,0,0,2,83,'13CB550F93D8290168465B8D75B5E614'),(478,'collection','Allows you to create and administer Search collections.',1,2,0,0,2,83,'8AD9E39E325FD99B6DA51789AA665812'),(479,'procresult','Specifies a result set name that other ColdFusion tags, such as cfoutput and cftable, use to access \n  the result set. It also lets you optionally identify which of the stored procedure\'s result sets to \n  return. The cfprocresult tag is nested within a cfstoredproc tag.',1,2,0,0,2,83,'C5402748B6879260403FCD2246CA639A'),(480,'loop','Looping is a very powerful programming technique that lets you repeat a set of instructions or \n  display output repeatedly until one or more conditions are met. cfloop supports five types of loops.',1,2,0,0,4,83,'5836107D1B69D194C95121253E06F284'),(481,'error','Enables the display of customized HTML pages when errors occur. This lets you maintain a \n  consistent look and feel within your application, even when errors occur.',1,2,0,0,2,83,'9F1EC3E56EA8C3400EB74E6528E74C2D'),(482,'setting','Controls various aspects of page processing, such as the output of HTML code in pages. One \n  benefit of this option is managing whitespace that can occur in