ding JavaScript code, or placing other HTML tags such, as \n	 META, LINK, TITLE, or BASE in an HTML page header.',1,2,0,0,2,91,'13A3791533DD9DDD41859D808785CEDC'),(514,'mailparam','Can either attach a file or add a header to a message. It is nested within a cfmail tag. You can \n  use more than one cfmailparam tag within a cfmail tag.',1,2,0,0,2,93,'BE046E7A78E4501F47D35896649EFFFA'),(515,'directory','Handles interactions with directories.',1,2,0,0,2,93,'207622D3A496AD19EB461E6CD4BE2F3C'),(516,'mail','Sends e-mail messages by an SMTP server.',1,2,0,0,4,93,'8C4A15DF64A91E60043C1DE4C2BEE68C'),(517,'query','Passes SQL statements to a data source. Not limited to queries.',1,2,0,0,4,93,'39F020309AF2BACE35500A20FBB328A7'),(518,'import','To import a JSP Taglibrary or a CFML Custom Tag Directory',1,2,0,0,2,94,'94D592EEC4372212AA027C189B6A951D'),(519,'map','',1,3,0,0,4,96,'8C6B03AADA323A2329766344C1E568CF'),(520,'update','Updates existing records in data sources.',1,2,0,0,2,96,'C6FB4A08BF1F04887556DF1E845A3D22'),(521,'insert','Inserts records in data sources.',1,2,0,0,2,96,'8F5A6A11B053AD9DC7D8AF14717D1437'),(522,'throw','The cfthrow tag raises a developer-specified exception that can be caught with cfcatch tag \n  having any of the following type specifications - cfcatch type = \'custom_type\', cfcatch type = \'Application\'\n  \'cfcatch\' type = \'Any\'',1,2,0,0,2,96,'B8962615AA9B83739123FB625C6CDF50'),(523,'http','Lets you execute HTTP POST and GET operations on files. Using cfhttp, you can execute standard \n  GET operations and create a query object from a text file. POST operations lets you upload MIME file \n  types to a server, or post cookie, formfield, URL, file, or CGI variables directly to a specified server.',1,2,0,0,4,96,'C958F1A9F1C86F22AB3B0C9751C0C40E'),(524,'mapitem','',1,3,0,0,4,96,'1A05B2A6B86CE550C47A050027658455'),(525,'layoutarea','',1,3,0,0,4,99,'7DF6DDED612F4F2E309D8F0A17EB573C'),(526,'layout','',1,3,0,0,4,99,'CB0188357C45E1DDCCB874D535CE0E85'),(527,