ts.',1,2,0,0,4,103,'E0045E461A7540604FE74EF8437946D4'),(537,'interface','',1,2,0,0,4,103,'A2E561162EB430B79E0C760848D1B696'),(538,'execute','Enables developers to execute a process on a server computer.',1,2,0,0,4,103,'59CAACCBDEFB33EAA44EA223694ECB21'),(539,'mail','Sends e-mail messages by an SMTP server.',1,2,0,0,4,103,'D1DC96064583BB1C1906F9CFA03FC572'),(540,'include','Lets you embed references to pages in CFML. You can embed cfinclude tags recursively. \n  For an additional method of encapsulating CFML',1,2,0,0,2,103,'AE0F2B40050C43770BCF98B1498D5DE1'),(541,'slider','Used inside cfform, cfslider lets you place a slider control in a CFML form. A slider \n  control is like a sliding volume control. The slider groove is the area over which the slider moves.',1,2,0,0,2,103,'7B15DE250ADF36292F96D2DCCDFA49CD'),(542,'try','Used with one or more cfcatch tags, the cftry tag lets you catch and process exceptions in \n  CFML pages. Exceptions include events that disrupt the normal flow of instructions in a \n  CFML page, such as failed database operations, missing include files, and developer-specified \n  events.',1,2,0,0,4,103,'C257153C5C852B690F8ECC5D549FBB89'),(543,'search','Executes searches against data indexed',1,2,0,0,2,103,'7E5D3B5399D514FE85166967EB10CDFF'),(544,'invoke','Invokes component methods from within a page or component. \n			You use this tag to reference a WSDL file and consume a web service from within a block of CFML code.',1,3,0,0,4,103,'C22C9CCEBCE7467F8CD3EADBEB8232B6'),(545,'ldap','Provides an interface to LDAP Lightweight Directory Access Protocol \n  directory servers like the Netscape Directory Server.',1,2,0,0,2,103,'E8FADBABCB2116E20816A609E414EC41'),(546,'cache','Speeds up page rendering when dynamic content does not have to be retrieved each time a user accesses\n  the page. To accomplish this, cfcache creates temporary files that contain the static HTML returned from\n  a page. You can use cfcache for simple URLs and URLs that contain URL parameters.',1,2,0,0,4,103,'13F625345CC50BF26191DDABA90924B0'),(547,'storedproc','Executes stored procedures by an ODBC or native connection to a server database. It specifies database connection \n  information and identifies the stored procedure.',1,2,0,0,4,103,'3D85B7BB1811B6923165AB9B92DB8610'),(548,'set','Define a CFML variable. If the variable exists, cfset resets it to the specified value.',1,1,0,0,2,103,'57F0DB5A3A89137C89A4659FD0191E42'),(549,'function','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,3,0,0,4,103,'8471886C3C3AABFD63414DAEB3808942'),(550,'gridupdate','Used in a cfgrid, cfgridupdate allows you to perform updates to data sources directly from edited \n  grid data. The cfgridupdate tag provides a direct interface with your data source. \n  The cfgridupdate tag applies delete row actions first, then INSERT row actions, and then UPDATE row \n  actions. If an error is encountered, row processing stops.',1,2,0,0,2,103,'6530CA70C101A4AA4E707E9C8AF065E1'),(551,'query','Passes SQL statements to a data source. Not limited to queries.',1,2,0,0,4,103,'806E949BC3567AAE983B00E429F89E4C'),(552,'servlet','This tag has been deprecated and is non-functional.',1,2,0,0,2,103,'82DA8A49834D3F2A3C424A468794E743'),(553,'component','Creates and defines a component object; encloses functionality that you build in CFML and enclose within cffunction tags. This tag contains one or more cffunction tags that define methods. Code within the body of this tag, other than cffunction tags, is executed when the component is instantiated.',1,3,0,0,4,103,'78586DCD6B8768A5A14B5B68C0A7DD38'),(554,'tree','This Tag is not supported yet.\n		Lets you put a tree control in a cfform. Validates user selections. Tree items are created with \n  cftreeitem tags inside the cftree tag block. You can use a CFML query to supply data to the tree.',1,2,0,0,4,103,'DA4B7CF53CDA9241D528CC1DA80A2A94'),(555,'table','Builds a table in a CFML page. Use the cfcol tag to define table column and row \n  characteristics. The cftable tag renders data either as preformatted text, or, with the HTMLTable \n  attribute, as an HTML table. Use cftable to create tables if you don\'t want to write HTML table tag \n  code, or if your data can be well presented as preformatted text.',1,2,0,0,4,103,'3AF9287C474BF65353C2FEC83CC7776E'),(556,'grid','Used inside cfform, cfgrid lets you place a grid control in a form. A grid control is \n  	a table of data divided into rows and columns. The cfgrid tag column data is specified with cfgridcolumn tags.',1,2,0,0,4,103,'09378296D401E269D3304ACEA06FDF26'),(557,'applet','Used in a cfform tag, cfapplet lets you reference custom Java applets that you have registered \n			using the Railo Administrator.',1,2,0,0,2,103,'50DF2DC68DBF6BD5A2AE795BBCD02C24'),(558,'throw','The cfthrow tag raises a developer-specified exception that can be caught with cfcatch tag \n  having any of the following type specifications - cfcatch type = \'custom_type\', cfcatch type = \'Application\'\n  \'cfcatch\' type = \'Any\'',1,2,0,0,2,103,'DB7F758FFC45EB7ABD052274E91E4C28'),(559,'http','Lets you execute HTTP POST and GET operations on files. Using cfhttp, you can execute standard \n  GET operations and create a query object from a text file. POST operations lets you upload MIME file \n  types to a server, or post cookie, formfield, URL, file, or CGI variables directly to a specified server.',1,2,0,0,4,103,'524B5AD8ECEA53010B1AD533737BB7A4'),(560,'treeitem','Populates a tree control, created with cftree, with elements. You can use the img values \n  supplied with CFML or reference your own icons.',1,2,0,0,2,103,'D2F1E9BEE1705B31AE545E78E64E66EC'),(561,'lock','Provides two types of locks to ensure the integrity of shared data: Exclusive lock and Read-only \n  lock. An exclusive lock single-threads access to the CFML constructs in its body. Single-threaded access \n  implies that the body of the tag can be executed by at most one request at a time. A request executing \n  inside a cflock tag has an \"exclusive lock\" on the tag. No other requests can start executing inside the \n  tag while a request has an exclusive lock. Railo issues exclusive locks on a first-come, first-served \n  basis. A read-only lock allows multiple requests to access the CFML constructs inside its body concurrently. \n  Therefore, read-only locks should be used only when the shared data is read only and not modified. If another \n  request already has an exclusive lock on the shared data, the request waits for the exclusive lock to be \n  released.',1,2,0,0,4,103,'0137B1D0AB0EAD3D39D3F87EABC9E775'),(562,'pdf','',1,2,0,0,4,103,'7E8ECE281BDD8055580F3AE15AD63817'),(563,'procresult','Specifies a result set name that other tags, such as cfoutput and cftable, use to access \n  the result set. It also lets you optionally identify which of the stored procedure\'s result sets to \n  return. The cfprocresult tag is nested within a cfstoredproc tag.',1,2,0,0,2,103,'53339E2BAA7C5E82D6CC1337467C00EF'),(564,'loop','Looping is a very powerful programming technique that lets you repeat a set of instructions or \n  display output repeatedly until one or more conditions are met. cfloop supports five types of loops.',1,2,0,0,4,103,'E50C4C45D12A42E8BE41E7170285027E'),(565,'setting','Controls various aspects of page processing, such as the output of HTML code in pages. One \n  benefit of this option is managing whitespace that can occur in output pages served by CFML.',1,2,0,0,4,103,'7178B3CF434CCBC80CDEFEDACEBFA5EB'),(566,'image','Lets you resize and add labels to GIF and JPEG format images.',1,2,0,0,2,103,'40BDF9B141E16792FF53F886B68D2B02'),(567,'queryparam','Checks the data type of a query parameter. The cfqueryparam tag is nested within a cfquery tag. \n  It is embedded within the query SQL statement. If you specify its optional parameters, cfqueryparam \n  also performs data validation.',1,2,0,0,2,103,'8CE0A4639FFFBF4E62C70D2CB2685161'),(568,'procparam','Specifies parameter information, including type, name, value, and length. The cfprocparam tag \n  is nested within a cfstoredproc tag.',1,2,0,0,2,103,'FD90FF0C6F675732C54E2B548850299A'),(569,'pop','Retrieves and deletes e-mail messages from a POP mail server.',1,2,0,0,2,103,'8B4027EAAE4F5F37954C27495E8656AF'),(570,'chart','',1,2,0,0,4,103,'EDBF1630BFEBC1529B22FF16F329E7DB'),(571,'index','Populates collections with indexed data. The cfindex and cfsearch tags encapsulate the \n  indexing and searching utilities. Collections can be populated from text files in a directory \n  you specify, or from a query generated by a query. Before you can populate a collection, \n  you must create the collection using either the cfcollection tag or the Railo Administrator. Use \n  cfsearch to search collections you populate with cfindex.',1,2,0,0,2,103,'CE6E89C688BAAAF0782480F1966158DE'),(572,'location','Opens a CFML page or HTML file. For example, you might use cflocation to specify a standard \n  message or response that you use in several applications. Use the addToken attribute to verify \n  client requests.',1,2,0,0,2,103,'F03634D50204EC74E83A6B48593BDB21'),(573,'module','Invokes a custom tag for use in cfml templates. The cfmodule tag can help deal with \n  custom tag name conflicts. Use the template attribute to name a template that contains the custom \n  tag definition, including its path..',1,4,0,0,4,103,'04E7A2DF913285EE2BB493A404CA5A4F'),(574,'xml','Creates a CFML XML document object that contains the markup in the tag body. This tag can include XML and CFML tags. \n		Railo processes the CFML code in the tag body, then assigns the resulting text to an XML document object variable.',1,2,0,0,4,103,'6C4B5087C1FF54579B88583E7B703D60'),(575,'servletparam','This tag has been deprecated and is non-functional.',1,2,0,0,2,103,'3723DD52A1FD4974405B56F3B97AE537'),(576,'switch','Used with cfcase and cfdefaultcase. Evaluates a passed expression and passes control to the \n  cfcase tag that matches the expression result. You can optionally code a cfdefaultcase tag, which \n  receives control if there is no matching cfcase tag value.',1,2,0,0,4,104,'6F4C1D42BB8209291D7BFBE916BDE490'),(577,'application','Defines scoping for a application, enables or disables storing client variables, \n			and specifies a client variable storage mechanism. \n			By default, client variables are disabled. Also, enables session variables and sets timeouts \n			for session and application variables. Session and application variables are stored in memory.',1,2,0,0,2,104,'FBC90301E9A5878BDBCFE99A6F1360EF'),(578,'ajaximport','',1,3,0,0,4,104,'FB0E873119D37FDECB2B8650034FF73C'),(579,'return','Returns result values from a component method. Contains an expression returned as result of the function.',1,1,0,0,2,104,'07520434ABE263661A655BFC2D6E08B5'),(580,'break','Used to break out of a cfloop,cfwhile or cfforeach.',1,2,0,0,2,104,'AF1937226794D9C1F7CA16308EC31C6F'),(581,'mailparam','Can either attach a file or add a header to a message. It is nested within a cfmail tag. You can \n  use more than one cfmailparam tag within a cfmail tag.',1,2,0,0,2,104,'3983133237B27431CAC49A2C776B8A43'),(582,'thread','',1,3,0,0,4,104,'8DFF22D464D8D89DC0E9270662942CC7'),(583,'transaction','Groups multiple queries into a single unit. The cftransaction \n  tag provides commit and rollback processing.',1,2,0,0,4,104,'6D294D414CBC0D33A5EBF98968FABDC6'),(584,'reportparam','Runs a predefined Crystal Reports report.',1,2,0,0,2,104,'4475862EB04B549387F78BF584F39EC8'),(585,'directory','Handles interactions with directories.',1,2,0,0,2,104,'20F4ECAA5B82816DC09D053703B1AFCB'),(586,'rethrow','Rethrows the currently active exception. Preserves the exception\'s cfcatch.type and cfcatch.\n  agContext information.',1,2,0,0,2,104,'56B0A74638D1C7624308EE8F57D2ABA6'),(587,'log','Writes a message to a log file.',1,2,0,0,2,104,'8BE3B75015BC3D7E6092A3FA40E2316E'),(588,'else','Used with cfelse and cfelseif, cfif lets you create simple and compound conditional statements \n	 in CFML. The value in the cfif tag can be any expression.',1,2,0,0,2,104,'8BA7588834135F1297C1F841C3E0F9B1'),(589,'invokeargument','Argument for the Invoke Tag',1,2,0,0,2,104,'D0F6D270973F2406FA22FAD27B34C32D'),(590,'report','Runs a predefined Crystal Reports report.',1,2,0,0,4,104,'CAD99095DAB9667C61AD17F7B906B0EE'),(591,'schedule','Provides a programmatic interface to the scheduling engine. You can run a specified \n  page at scheduled intervals with the option to write out static HTML pages. This lets you offer users \n  access to pages that publish data, such as reports, without forcing users to wait while a database transaction \n  is performed in order to populate the data on the page.',1,2,0,0,2,104,'532C196E09D27191D36DA34C29C44023'),(592,'form','Builds a form with CFML custom control tags that provide more functionality than standard \n  HTML form input elements.',1,2,0,0,4,104,'954FB70949A5D107D76BA38BE7A885EC'),(593,'interface','',1,2,0,0,4,104,'D2D3DFF556657F34C19DC9EA2242EC3B'),(594,'loginuser','',1,2,0,0,2,104,'9C097C1EC77C730F175B5C52304AD097'),(595,'wddx','Serializes and de-serializes CFML data structures to the XML-based WDDX format. \n  Generates JavaScript statements to instantiate JavaScript objects equivalent to the contents of a \n  WDDX packet or some CFML data structures.',1,2,0,0,2,104,'4A8A6DC95D3155622E9681F314A2654F'),(596,'argument','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,3,0,0,2,104,'ED0CE8960D6FE901AFB9A8641233CF89'),(597,'httpparam','Required for cfhttp POST operations, cfhttpparam is used to specify the parameters necessary to \n	 build a cfhttp POST.',1,2,0,0,2,104,'9AA0264D9373EE07BA72205CB12D821A'),(598,'formitem','',1,2,0,0,4,104,'CDBE01CEF581EB9E7D0D18FB0E6F5F62'),(599,'calendar','',1,2,0,0,2,104,'FB51457D57808A77D2F29F1EF355168F'),(600,'videoplayerparam','play a video',1,2,0,0,2,104,'D0845B7C1E3F3C3CC4E47D4E13