,2,0,0,4,104,'CD8BC10FB6F04FCED2F2675786519BC1'),(614,'exit','Used to: Abort the processing of the currently executing CFML custom tag, exit the template \n	within the currently executing CFML custom tag and reexecute a section of code within the currently\n	executing CFML custom tag',1,2,0,0,2,104,'BF7CE8429E529F22CD4A5B4682CDC5AD'),(615,'documentsection','',1,2,0,0,4,104,'A9FC541249791F1FB8FDE8E8A56F73B7'),(616,'map','',1,3,0,0,4,104,'F2466564C7E8524657447F6AEC600C2E'),(617,'objectcache','Flushes the query cache',1,2,0,0,2,104,'919565FD94E6AD080B16BA0641F5A7ED'),(618,'search','Executes searches against data indexed',1,2,0,0,2,104,'D035B9154AF353CF0517B2A6E9FEFC4B'),(619,'zipparam','',1,2,0,0,2,104,'AAD98D48AD4F11D3938B377F6C821819'),(620,'graphdata','Specifies a data point to be displayed by a cfgraph tag.',1,2,0,0,2,104,'94ED5ADA6EDE7B4B7E7DF3ADDF5FEA86'),(621,'dbinfo','Lets you retrieve information about a data source, including details about the database, tables, queries, procedures, foreign keys, indexes, and version information about the database, driver, and JDBC. This tag supports only JDBC drivers, and does not support ODBC-based drivers, including the Microsoft Access driver.',1,2,0,0,2,104,'E3B336E6F892F86BBCF22B7D8241E8DD'),(622,'admin','Tag for the railo web/server administrator',1,4,0,0,2,104,'1F2DD22D9D4B2121E415843A1B651C4F'),(623,'content','Defines the MIME type returned by the current page. Optionally, lets you specify the name of a file\n  to be returned with the page.',1,2,0,0,4,104,'0392D73C77515CF12ADF0B42869D50E2'),(624,'col','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,2,0,0,2,104,'40B34F3FAD65BABA23EBD8BDF85C0D09'),(625,'file','Handles all interactions with files. The attributes you use with cffile depend on the value of the action attribute. \n For example, if the action = \"write\", use the attributes associated with writing a text file.',1,2,0,0,2,104,'345DAB00AF12B4FEA9ACBA53EB015CCC'),(626,'case','Handle one case of a cfswicth',1,2,0,0,4,104,'73D63FC0FF270D4972AED4006B6EBCF8'),(627,'invoke','Invokes component methods from within a page or component. \n			You use this tag to reference a WSDL file and consume a web service from within a block of CFML code.',1,3,0,0,4,104,'F3C6DA0CED43EA15031AB66C173FB37D'),(628,'silent','Suppresses all output that is produced by the CFML within the tag\'s scope.',1,2,0,0,4,104,'BD363FE0CE0F844A20754D56555A3C0F'),(629,'ldap','Provides an interface to LDAP Lightweight Directory Access Protocol \n  directory servers like the Netscape Directory Server.',1,2,0,0,2,104,'F2116BF6B900725099CC15FCE2B589FE'),(630,'cache','Speeds up page rendering when dynamic content does not have to be retrieved each time a user accesses\n  the page. To accomplish this, cfcache creates temporary files that contain the static HTML returned from\n  a page. You can use cfcache for simple URLs and URLs that contain URL parameters.',1,2,0,0,4,104,'B56CA5F7232184B8F09BCA1E8DF1FFB8'),(631,'update','Updates existing records in data sources.',1,2,0,0,2,104,'D89818352FE67B8C2A7F5CABBBB0D364'),(632,'storedproc','Executes stored procedures by an ODBC or native connection to a server database. It specifies database connection \n  information and identifies the stored procedure.',1,2,0,0,4,104,'0C7714797C440B1C05CC2C93675C17A5'),(633,'insert','Inserts records in data sources.',1,2,0,0,2,104,'1FF78999C2A30534FF004A98A2F0AF39'),(634,'ftp','Lets users implement File Transfer Protocol (FTP) operations.',1,2,0,0,2,104,'2C0EC9C3B8577A5763149ADF34FBB039'),(635,'set','Define a CFML variable. If the variable exists, cfset resets it to the specified value.',1,1,0,0,2,104,'D4D2E53A84CF9773A7628F5CAFD1B7E4'),(636,'function','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,3,0,0,4,104,'31A8694CF1FBC4A2B6193FE67B5B131C'),(637,'video','play a video',1,2,0,0,2,104,'E66357BF33CAA61053FD517FA53F463E'),(638,'mailpart','Specifies one part of a multipart e-mail message. Can only be used in the cfmail tag. You can use more than one cfmailpart tag within a cfmail tag',1,2,0,0,4,104,'EF7C765404EE7A173B637FD9E9C4B7DD'),(639,'if','Used with cfelse and cfelseif, cfif lets you create simple and compound conditional statements \n  in CFML. The value in the cfif tag can be any expression.',1,1,0,0,4,104,'B9C99621425912D5A1FF4897B5A043F5'),(640,'finally','',1,2,0,0,4,104,'4C5BA82C04E178231AFC7105FB7CB22E'),(641,'gridupdate','Used in a cfgrid, cfgridupdate allows you to perform updates to data sources directly from edited \n  grid data. The cfgridupdate tag provides a direct interface with your data source. \n  The cfgridupdate tag applies delete row actions first, then INSERT row actions, and then UPDATE row \n  actions. If an error is encountered, row processing stops.',1,2,0,0,2,104,'E6FDAAF67C320FC4963DDDA2DEAE8312'),(642,'query','Passes SQL statements to a data source. Not limited to queries.',1,2,0,0,4,104,'872D6EB4745A221E3E2EE8BC2B8090D2'),(643,'defaultcase','Handles interactions with directories.',1,2,0,0,4,104,'374604D35EF3749AF9F23A35709A32EA'),(644,'document','',1,2,0,0,4,104,'FACD35846173C03DB00137912D1ADA23'),(645,'timer','',1,2,0,0,4,104,'C865CA99B27D72D5A7CAE0A02CAED0B2'),(646,'gridcolumn','Used with cfgrid in a cfform, you use cfgridcolumn to specify column data in a cfgrid control. Font and alignment \n  attributes used in cfgridcolumn override any global font or alignment settings defined in cfgrid.',1,2,0,0,2,104,'E8F5518C84877A6E9B2D67F9E8EA71A4'),(647,'trace','Displays and logs debugging data about the state of an application at the time the cftrace tag executes. \n			Tracks runtime logic flow, variable values, and execution time. Displays output at the end of the request \n			or in the debugging section at the end of the request; or, in Dreamweaver MX and later, in the Server Debug \n			tab of the Results window.',1,2,0,0,4,104,'990EFCF6198FB621871FEF4BE265F28B'),(648,'cookie','Defines cookie variables, including expiration and security options.',1,2,0,0,2,104,'486AADF976DC30EA2828756D89B86427'),(649,'servlet','This tag has been deprecated and is non-functional.',1,2,0,0,2,104,'4B6DBADDA0612F4349CF0528BA3984AB'),(650,'continue','',1,2,0,0,2,104,'5CF02666B8C94CBC70B8E3B9A9CD34E1'),(651,'authenticate','Authenticates a user, setting a security context for the application. \n			For more information, see the descriptions of IsAuthenticated and AuthenticatedContext.',1,2,0,0,2,104,'1EA0D510859C53532FCA37CB71D798D4'),(652,'savecontent','Saves the generated content inside the tag body in a variable.',1,2,0,0,4,104,'7E4799FB18F2AB14E3FCA3D4FB93637A'),(653,'component','Creates and defines a component object; encloses functionality that you build in CFML and enclose within cffunction tags. This tag contains one or more cffunction tags that define methods. Code within the body of this tag, other than cffunction tags, is executed when the component is instantiated.',1,3,0,0,4,104,'B6AD708674A789E2F1F0FCAE257FC514'),(654,'param','Tests for a parameter\'s existence, tests its data type, and provides a default value if one \n  is not assigned.',1,2,0,0,2,104,'B5BA371C5C3A1949080766E42FAE0E3A'),(655,'tree','This Tag is not supported yet.\n		Lets you put a tree control in a cfform. Validates user selections. Tree items are created with \n  cftreeitem tags inside the cftree tag block. You can use a CFML query to supply data to the tree.',1,2,0,0,4,104,'7973A7A244BB7F0E570E3FDBD55C2B92'),(656,'logout','',1,2,0,0,2,104,'2585FEA9E5B7F7AE7409B19579B0D91D'),(657,'table','Builds a table in a CFML page. Use the cfcol tag to define table column and row \n  characteristics. The cftable tag renders data either as preformatted text, or, with the HTMLTable \n  attribute, as an HTML table. Use cftable to create tables if you don\'t want to write HTML table tag \n  code, or if your data can be well presented as preformatted text.',1,2,0,0,4,104,'338B75EBFDC332F213C7DFB43E7A2E12'),(658,'zip','',1,2,0,0,4,104,'E314EC350B087D3BB13271FDCDC7390B'),(659,'grid','Used inside cfform, cfgrid lets you place a grid control in a form. A grid control is \n  	a table of data divided into rows and columns. The cfgrid tag column data is specified with cfgridcolumn tags.',1,2,0,0,4,104,'18A5687569E5E38F577DD4380CA618C9'),(660,'ajaxproxy','',1,3,0,0,4,104,'4F067FCBFDBEF20F15348CE1BA56136A'),(661,'stopwatch','Stops the time from starttag to endtag',1,2,0,0,4,104,'0E8509F81E9EAD9E6701D3B21802EEE3'),(662,'feed','',1,2,0,0,2,104,'750BDBB9B427DF9629812E209BE2DD78'),(663,'header','Generates custom HTTP response headers to return to the client.',1,2,0,0,2,104,'B2609BE071865DA0515A672007099A8B'),(664,'chartseries','Used with the cfchart and cfchartseries tags. This tag defines chart data points. Its data is submitted to the cfchartseries tag.',1,2,0,0,4,104,'9E63B2D338A80936AE8D98FCA320348B'),(665,'catch','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,4,0,0,4,104,'643A2F313B2EDE2F4451B92EAC5CBEF9'),(666,'associate','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,2,0,0,2,104,'09F4A3523FDD5B776247F0F582F08830'),(667,'throw','The cfthrow tag raises a developer-specified exception that can be caught with cfcatch tag \n  having any of the following type specifications - cfcatch type = \'custom_type\', cfcatch type = \'Application\'\n  \'cfcatch\' type = \'Any\'',1,2,0,0,2,104,'87195E0AA21B8E47D9B1AA116D90775D'),(668,'layoutarea','',1,3,0,0,4,104,'41573CB0DF552B81DEAB6EDC3260C51C'),(669,'layout','',1,3,0,0,4,104,'5F16067D73443D32DA5CAC8E8D0E2CEE'),(670,'elseif','Used with cfelse and cfelseif, \n			cfif lets you create simple and compound conditional statements \n			in CFML. The value in the cfif tag can be any expression.',1,1,0,0,2,104,'14FAF6CC306E22E4238D87DDA2C7A40F'),(671,'http','Lets you execute HTTP POST and GET operations on files. Using cfhttp, you can execute standard \n  GET operations and create a query object from a text file. POST operations lets you upload MIME file \n  types to a server, or post cookie, formfield, URL, file, or CGI variables directly to a specified server.',1,2,0,0,4,104,'255EDD481EC46D9F28145F18C97ACA6A'),(672,'dump','',1,3,0,0,4,104,'762D9091F0265864AC1E14189242F545'),(673,'treeitem','Populates a tree control, created with cftree, with elements. You can use the img values \n  supplied with CFML or reference your own icons.',1,2,0,0,2,104,'7F96EA051E6ECB115DD3C427CAFAF84C'),(674,'abort','Stops processing of a page at the tag location. CFML returns everything that was processed before the cfabort tag. The cfabort tag is often used with conditional logic to stop processing a page when a condition occurs.',1,2,0,0,2,104,'A0D6AB0CD0FA1DAA165B2FD365DDF879'),(675,'forward','forward the request to a other path.',1,2,0,0,2,104,'1ABFF4D078784A98ED166EB7A5A436A0'),(676,'login','',1,2,0,0,4,104,'906E9C76134692C1BAE317A433339EB0'),(677,'mapitem','',1,3,0,0,4,104,'6F2786C3B2A15D7F0411B60A1C8E8F11'),(678,'registry','Reads, writes, and deletes keys and values in the system registry. The cfregistry tag is supported \n  on all platforms, including Linux, Solaris, and HP-UX.',1,2,0,0,2,104,'A56DC38C5BD1703C934FE547CD0B5BEA'),(679,'lock','Provides two types of locks to ensure the integrity of shared data: Exclusive lock and Read-only \n  lock. An exclusive lock single-threads access to the CFML constructs in its body. Single-threaded access \n  implies that the body of the tag can be executed by at most one request at a time. A request executing \n  inside a cflock tag has an \"exclusive lock\" on the tag. No other requests can start executing inside the \n  tag while a request has an exclusive lock. Railo issues exclusive locks on a first-come, first-served \n  basis. A read-only lock allows multiple requests to access the CFML constructs inside its body concurrently. \n  Therefore, read-only locks should be used only when the shared data is read only and not modified. If another \n  request already has an exclusive lock on the shared data, the request waits for the exclusive lock to be \n  released.',1,2,0,0,4,104,'CFB6197BA30B6B60AD5C35786349C496'),(680,'pdf','',1,2,0,0,4,104,'5F8289B99E05F488F49E2F687B758E11'),(681,'flush','Flushes currently available data to the client.',1,2,0,0,2,104,'1940186738BCA01525543D6D6EFE06E6'),(682,'collection','Allows you to create and administer Search collections.',1,2,0,0,2,104,'CC0A2AF735722B0170E89232C40CDF75'),(683,'procresult','Specifies a result set name that other tags, such as cfoutput and cftable, use to access \n  the result set. It also lets you optionally identify which of the stored procedure\'s result sets to \n  return. The cfprocresult tag is nested within a cfstoredproc tag.',1,2,0,0,2,104,'C7FD879823F0EDB2E1C963185FCD37F7'),(684,'loop','Looping is a very powerful programming technique that lets you repeat a set of instructions or \n  display output repeatedly until one or more conditions are met. cfloop supports five types of loops.',1,2,0,0,4,104,'F54C27C1A81CB4E631B82711B1E90E12'),(685,'property','Defines components as complex types that are used for web services authoring. The attributes of this tag are exposed as component metadata and are subject to inheritance rules.',1,3,0,0,2,104,'233A15DAFD136AFEF6BBCC0C8BA159F1'),(686,'error','Enables the display of customized HTML pages when errors occur. This lets you maintain a \n  consistent look and feel within your application, even when errors occur.',1,2,0,0,2,104,'19BE74A1C4527E424169D9CAD37F354E'),(687,'setting','Controls various aspects of page processing, such as the output of HTML code in pages. One \n  benefit of this option is managing whitespace that can occur in output pages served by CFML.',1,2,0,0,4,104,'671478D8573BFF23C820D4FEC974F3E3'),(688,'image','Lets you resize and add labels to GIF and JPEG format images.',1,2,0,0,2,104,'B11816DB65C22312C26579E1B12522FC'),(689,'object','Lets you call methods in COM, CORBA, and JAVA objects.',1,2,0,0,2,104,'375CA2FF4CEDDB663F03811474987BA2'),(690,'graph','Displays a graphical representation of data.',1,2,0,0,4,104,'6E4FAC60C72517E48AFAF2B4F35C8601'),(691,'htmlhead','Writes the text specified in the text attribute to the \'head\' section of a generated HTML page. \n	 The cfhtmlhead tag can be useful for embedding JavaScript code, or placing other HTML tags such, as \n	 META, LINK, TITLE, or BASE in an HTML page header.',1,2,0,0,2,104,'DABC82A836F456A8545A10E4D0CE5D18'),(692,'chartdata','Used with the cfchart and cfchartseries tags. This tag defines chart data points. Its data is submitted to the cfchartseries tag.',1,2,0,0,2,104,'3379AFE19C71525C033A809A4660CD90'),(693,'formgroup','',1,2,0,0,4,104,'DF4ABB0C12055E96D4149E6079EE4D54'),(694,'queryparam','Checks the data type of a query parameter. The cfqueryparam tag is nested within a cfquery tag. \n  It is embedded within the query SQL statement. If you specify its optional parameters, cfqueryparam \n  also performs data validation.',1,2,0,0,2,104,'D4C294151EDC27B66E82F2150D161E96'),(695,'procparam','Specifies parameter information, including type, name, value, and length. The cfprocparam tag \n  is nested within a cfstoredproc tag.',1,2,0,0,2,104,'5C3FEC1041E33145ED2DBD71F7DCF427'),(696,'pop','Retrieves and deletes e-mail messages from a POP mail server.',1,2,0,0,2,104,'72D1FF834AF150D84852F66E9725BE83'),(697,'window','',1,3,0,0,4,104,'1B64854D6446299E877B419D93BAC53A'),(698,'select','Used inside cfform, cfselect lets you construct a drop-down list box form control. You can \n  populate the drop-down list box from a query, or using the option tag. Use option elements to populate \n  lists. The syntax for the option tag is the same as for its HTML counterpart.',1,2,0,0,4,104,'F89355C42396EC57F4EF58064E09E396'),(699,'pdfparam','Provides additional information for the cfpdf tag. The cfpdfparam tag applies only to the merge action of the cfpdf tag and is always a child tag of the cfpdf tag.',1,2,0,0,2,104,'F9306F4C3121D3CBAF68AEAD1BCB76E2'),(700,'chart','',1,2,0,0,4,104,'31DCD4894120EF02681EA9E993FD1852'),(701,'index','Populates collections with indexed data. The cfindex and cfsearch tags encapsulate the \n  indexing and searching utilities. Collections can be populated from text files in a directory \n  you specify, or from a query generated by a query. Before you can populate a collection, \n  you must create the collection using either the cfcollection tag or the Railo Administrator. Use \n  cfsearch to search collections you populate with cfindex.',1,2,0,0,2,104,'A09EE0DFBAE2EED1AE87B9596DAD45F1'),(702,'ntauthenticate','',1,2,0,0,2,104,'9F4890DA532185136CE4778A8BA8CCB7'),(703,'while','same like loop-contition but easier to use',1,1,0,0,4,104,'1F17EC6A8474150371490AB9B9DA3CF8'),(704,'location','Opens a CFML page or HTML file. For example, you might use cflocation to specify a standard \n  message or response that you use in several applications. Use the addToken attribute to verify \n  client requests.',1,2,0,0,2,104,'83D696F24CBC7F75C634050E4EE80266'),(705,'gridrow','Lets you define a cfgrid that does not use a query as source for row data. If a query attribute is\n  specified in cfgrid, the cfgridrow tags are ignored.',1,2,0,0,2,104,'5EA6847065785200400514147F1EC4A6'),(706,'module','Invokes a custom tag for use in cfml templates. The cfmodule tag can help deal with \n  custom tag name conflicts. Use the template attribute to name a template that contains the custom \n  tag definition, including its path..',1,4,0,0,4,104,'2486BD1CAA6F2A0511755C7B93AB23BB'),(707,'xml','Creates a CFML XML document object that contains the markup in the tag body. This tag can include XML and CFML tags. \n		Railo processes the CFML code in the tag body, then assigns the resulting text to an XML document object variable.',1,2,0,0,4,104,'BFA24738720C4D9858DD752C8C765660'),(708,'input','Used inside cfform to place radio buttons, checkboxes, or text boxes. Provides input \n  validation for the specified control type.',1,2,0,0,2,104,'201E03581397528326330835D931A9E2'),(709,'imap','Retrieves and deletes e-mail messages from a Imap mail server.',1,2,0,0,2,104,'7F015E67444817FD344031F6B5905B61'),(710,'servletparam','This tag has been deprecated and is non-functional.',1,2,0,0,2,104,'BC08594BF07ACEDA252577E410E1FC5A'),(711,'sleep','Pauses the execution of the page for a given interval',1,2,0,0,2,104,'A33A84420A322E2677FEEB4AFF78D433'),(712,'switch','Used with cfcase and cfdefaultcase. Evaluates a passed expression and passes control to the \n  cfcase tag that matches the expression result. You can optionally code a cfdefaultcase tag, which \n  receives control if there is no matching cfcase tag value.',1,2,0,0,4,106,'B3F95E452FDFA9F549226E46B86792D3'),(713,'application','Defines scoping for a application, enables or disables storing client variables, \n			and specifies a client variable storage mechanism. \n			By default, client variables are disabled. Also, enables session variables and sets timeouts \n			for session and application variables. Session and application variables are stored in memory.',1,2,0,0,2,106,'3352526D6EF84DA5D077F08097F031D4'),(714,'AjaxImport','Controls the JavaScript files that are imported for use on pages that use Railox AJAX tags and features.',1,2,0,0,4,106,'56201748E52D25BF8C198CD6D853C74A'),(715,'return','Returns result values from a component method. Contains an expression returned as result of the function.',1,1,0,0,2,106,'4C066DA83D0E7A844227E04A7F0CE5FE'),(716,'break','Used to break out of a cfloop,cfwhile or cfforeach.',1,2,0,0,2,106,'B7350242442EC901C496B17DA6DC7C25'),(717,'mailparam','Can either attach a file or add a header to a message. It is nested within a cfmail tag. You can \n  use more than one cfmailparam tag within a cfmail tag.',1,2,0,0,2,106,'0E15CE2374F97819ADBC2A03DE76F0B4'),(718,'thread','The cfthread tag enables you to create threads, independent streams of code execution, in your application. \n		You use this tag to run or end a thread, temporarily stop thread execution, or join together multiple threads.',1,3,0,0,4,106,'390C3AC6C4DED1DB03875EE9B250AEF7'),(719,'transaction','Groups multiple queries into a single unit. The cftransaction \n  tag provides commit and rollback processing.',1,2,0,0,4,106,'9ACDBB4CD68B7C0BD1436AE65A010073'),(720,'directory','Handles interactions with directories.',1,2,0,0,2,106,'335769B206075F386B24214A068DD2D2'),(721,'rethrow','Rethrows the currently active exception. Preserves the exception\'s cfcatch.type and cfcatch.\n  agContext information.',1,2,0,0,2,106,'2E1768C13AF12482953EA79D48A3DE88'),(722,'log','Writes a message to a log file.',1,2,0,0,2,106,'9D73ED789257B5C9D42093C1907CD49B'),(723,'else','Used with cfelse and cfelseif, cfif lets you create simple and compound conditional statements \n	 in CFML. The value in the cfif tag can be any expression.',1,2,0,0,2,106,'01D114735978A75CED6CF5B840A58F36'),(724,'invokeargument','Argument for the Invoke Tag',1,2,0,0,2,106,'C4F03C2944DE2900831CCB2C458ECB5A'),(725,'schedule','Provides a programmatic interface to the scheduling engine. You can run a specified \n  page at scheduled intervals with the option to write out static HTML pages. This lets you offer users \n  access to pages that publish data, such as reports, without forcing users to wait while a database transaction \n  is performed in order to populate the data on the page.',1,2,0,0,2,106,'22A1B1263CC0C895E1819D17AC92A225'),(726,'form','Builds a form with CFML custom control tags that provide more functionality than standard \n  HTML form input elements (XML and Flash type no supported).',1,2,0,0,4,106,'093B969215C9D14A26BD2859B17A7C9C'),(727,'interface','Defines an interface that consists of a set of signatures for functions. \n		The interface does not include the full function definitions; instead, you implement the functions in a Component. The interfaces that you define by using this tag can make up the structure of a reusable application framework.',1,2,0,0,4,106,'C2134111BD8E278AB09C82958D6B5B50'),(728,'loginuser','Identifies an authenticated user to ColdFusion. Specifies the user ID and roles. Used within a cflogin tag.',1,2,0,0,2,106,'CBC3739EA5875948E7A82A6EB1FB6964'),(729,'wddx','Serializes and de-serializes CFML data structures to the XML-based WDDX format. \n  Generates JavaScript statements to instantiate JavaScript objects equivalent to the contents of a \n  WDDX packet or some CFML data structures.',1,2,0,0,2,106,'31B41BF1FC6BDEF717139CE49CB35B2A'),(730,'argument','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,3,0,0,2,106,'78F25D8DB0EA147469845A7859C008E1'),(731,'httpparam','Required for cfhttp POST operations, cfhttpparam is used to specify the parameters necessary to \n	 build a cfhttp POST.',1,2,0,0,2,106,'42DDB28E4B46EF47EFC7BB45C56B4BA2'),(732,'videoplayerparam','play a video',1,2,0,0,2,106,'94BACCCA4331AECA012411BEBFBDC9C7'),(733,'textinput','Lets you place a single-line text entry box in a cfform. The tag also gives you control over \n  font characteristics.',1,2,0,0,2,106,'0E28AD3773669FD9A1F45561A07683E7'),(734,'import','To import a JSP Taglibrary or a CFML Custom Tag Directory',1,2,0,0,2,106,'C11817279BF107D48E00F8DF459941FB'),(735,'output','Displays the results of a database query or other operation. To nest cfoutput tags, see the \"Usage\" section.',1,2,0,0,4,106,'0A41564A85E7EDAD09EC7B6B97656837'),(736,'script','Encloses a code segment containing cfscript.',1,2,0,0,4,106,'7D6DEA9090CD813054E71F7C2F67A1FD'),(737,'documentitem','Specifies action items for a PDF document created by the cfdocument tag.',1,2,0,0,4,106,'14E1087E00C1BA348D7ECB00CB69CCB4'),(738,'Div','Creates an HTML tag with specified contents and lets you to use bind expressions to dynamically control the tag contents.',1,2,0,0,4,106,'A39BCAE7FF94F7B586FCF97D2860D73A'),(739,'execute','Enables developers to execute a process on a server computer.',1,2,0,0,4,106,'91383D0A114D4DE4D843BA7D0E9150C2'),(740,'mail','Sends e-mail messages by an SMTP server.',1,2,0,0,4,106,'5F22F1EC7785DCDFFB67D2CFACEAF14E'),(741,'include','Lets you embed references to pages in CFML. You can embed cfinclude tags recursively. \n  For an additional method of encapsulating CFML',1,2,0,0,2,106,'9FC6820688A8CD1AE110AFB2F779EDF4'),(742,'slider','Used inside cfform, cfslider lets you place a slider control in a CFML form. A slider \n  control is like a sliding volume control. The slider groove is the area over which the slider moves.',1,2,0,0,2,106,'33C0A596DCE2A3DFB3FCFDC3C0C45CCE'),(743,'processingdirective','Suppresses extra white space and other output, produced by CFML within the tag\'s scope.',1,2,0,0,4,106,'44DF081FFC7C1105FA6F5ECB87580C58'),(744,'try','Used with one or more cfcatch tags, the cftry tag lets you catch and process exceptions in \n  CFML pages. Exceptions include events that disrupt the normal flow of instructions in a \n  CFML page, such as failed database operations, missing include files, and developer-specified \n  events.',1,2,0,0,4,106,'EF1F0FD993D8E13884ADFEF08A69B736'),(745,'videoplayer','The tag CFVIDEOPLAYER allows you to display a video in flash (flv) format. \n		It includes the complete functionality to display the player with the necessary html code. Read more on the multimedia functionality.',1,2,0,0,4,106,'6F120B7E5C601129AE9C17754F2B6A43'),(746,'exit','Used to: Abort the processing of the currently executing CFML custom tag, exit the template \n	within the currently executing CFML custom tag and reexecute a section of code within the currently\n	executing CFML custom tag',1,2,0,0,2,106,'9FE70E75BFC7E6D2C393AADAA44A81E7'),(747,'documentsection','Divides a PDF document into sections. \n		By using this tag in conjunction with a cfdocumentitem tag, each section can have unique headers, footers, and page numbers.',1,2,0,0,4,106,'BDABC8C61119A229FA48235799D54DF4'),(748,'objectcache','Flushes the query cache',1,2,0,0,2,106,'4E5745161AAA6CBF8A20A8C9198BF5CF'),(749,'search','Executes searches against data indexed',1,2,0,0,2,106,'024C0261A3BCECB8EE82A079BB1E4415'),(750,'zipparam','The cfzipparam tag is always a child tag of the cfzip tag. see tag zip for more details.',1,2,0,0,2,106,'8A2272BFC3CB2DCFB5947A5D61530330'),(751,'graphdata','Specifies a data point to be displayed by a cfgraph tag.',1,2,0,0,2,106,'796C49436E22F63500359E18C1636ECF'),(752,'dbinfo','Lets you retrieve information about a data source, including details about the database, tables, queries, procedures, foreign keys, indexes, and version information about the database, driver, and JDBC. This tag supports only JDBC drivers, and does not support ODBC-based drivers, including the Microsoft Access driver.',1,2,0,0,2,106,'20FEEB9545C7CCA61F086641FEC61924'),(753,'admin','Tag for the railo web/server administrator',1,4,0,0,2,106,'C490D80AD9B3B692EEE2DD0CFFE80F39'),(754,'content','Defines the MIME type returned by the current page. Optionally, lets you specify the name of a file\n  to be returned with the page.',1,2,0,0,4,106,'5709833A6BFF81E9CD62E3F132FC0127'),(755,'col','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,2,0,0,2,106,'2282306BD7CF0334D64F367BAA5E6609'),(756,'file','Handles all interactions with files. The attributes you use with cffile depend on the value of the action attribute. \n For example, if the action = \"write\", use the attributes associated with writing a text file.',1,2,0,0,2,106,'9D1237451AAF5426CC287E5381ECEFE8'),(757,'case','Handle one case of a cfswicth',1,2,0,0,4,106,'A28C69075634DC53BC04E07CEFDEAF55'),(758,'invoke','Invokes component methods from within a page or component. \n			You use this tag to reference a WSDL file and consume a web service from within a block of CFML code.',1,3,0,0,4,106,'AC1AC400279A3DB6D400716ABA2E38A8'),(759,'silent','Suppresses all output that is produced by the CFML within the tag\'s scope.',1,2,0,0,4,106,'C2528E534BC9C61A48464B12691F46EC'),(760,'ldap','Provides an interface to LDAP Lightweight Directory Access Protocol \n  directory servers like the Netscape Directory Server.',1,2,0,0,2,106,'FC408FA5D2C776D682681812A3BE7B89'),(761,'cache','Speeds up page rendering when dynamic content does not have to be retrieved each time a user accesses\n  the page. To accomplish this, cfcache creates temporary files that contain the static HTML returned from\n  a page. You can use cfcache for simple URLs and URLs that contain URL parameters.',1,2,0,0,4,106,'AA5DE196330EBBE5C30B8F6F530CE17C'),(762,'update','Updates existing records in data sources.',1,2,0,0,2,106,'F57F0238C86FA402579BA6A9D24BDA5A'),(763,'storedproc','Executes stored procedures by an ODBC or native connection to a server database. It specifies database connection \n  information and identifies the stored procedure.',1,2,0,0,4,106,'60D7103F679640C7BBF247B68D5086D8'),(764,'insert','Inserts records in data sources.',1,2,0,0,2,106,'469CBFFA9A9457E920FEC9F98D783BAD'),(765,'ftp','Lets users implement File Transfer Protocol (FTP) operations.',1,2,0,0,2,106,'6FA229F404BD46198FA7BEDEB728E360'),(766,'set','Define a CFML variable. If the variable exists, cfset resets it to the specified value.',1,1,0,0,2,106,'203BA594D29E7FE4E7A15346B83FA32E'),(767,'function','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,3,0,0,4,106,'38B19078665BC16B0049FAABDD80CEED'),(768,'video','play a video',1,2,0,0,2,106,'C50F7A8152C8DB9BC39768AE8EC0FD64'),(769,'mailpart','Specifies one part of a multipart e-mail message. Can only be used in the cfmail tag. You can use more than one cfmailpart tag within a cfmail tag',1,2,0,0,4,106,'1756AE1D5E5265662108FDD19CE65C49'),(770,'if','Used with cfelse and cfelseif, cfif lets you create simple and compound conditional statements \n  in CFML. The value in the cfif tag can be any expression.',1,1,0,0,4,106,'D3CF8E1A1299E4B197A35A5DDAC2BCFD'),(771,'finally','Used inside a cftry tag. \n		Code in the cffinally block is processed after the main cftry code and, if an exception occurs, the cfcatch code. \n		The cffinally block code always executes, whether or not there is an exception.',1,2,0,0,4,106,'B7FF4F6F83E811C9DC977699EBF460BA'),(772,'query','Passes SQL statements to a data source. Not limited to queries.',1,2,0,0,4,106,'F3A1625BA5709AD061FED3ECEE520DAC'),(773,'defaultcase','Handles interactions with directories.',1,2,0,0,4,106,'8DE088F38843CEABA7B58B930A3ABF95'),(774,'document','Creates a PDF document from a text block containing CFML and HTML.',1,2,0,0,4,106,'DAD1AA8944989632072A5E9243DBB241'),(775,'timer','Displays execution time for a specified section of CFML code. \n		Railo displays the timing information along with any output produced by the timed code.',1,2,0,0,4,106,'DD6BA2C59C34D6A1B18097569C039BED'),(776,'trace','Displays and logs debugging data about the state of an application at the time the cftrace tag executes.',1,2,0,0,4,106,'A1FE478D5D2840C571BD82AA522C8CE2'),(777,'cookie','Defines cookie variables, including expiration and security options.',1,2,0,0,2,106,'15EE7D7945208CA7FDFC736EE2DCB67F'),(778,'servlet','This tag has been deprecated and is non-functional.',1,2,0,0,2,106,'D359D3BD2328E1160BBF8C9B5688EE74'),(779,'continue','Used within a cfloop tag. Returns processing to the top of a loop.',1,2,0,0,2,106,'8D45FE7E290011AD31474D864DA6D351'),(780,'authenticate','Authenticates a user, setting a security context for the application. \n			For more information, see the descriptions of IsAuthenticated and AuthenticatedContext.',1,2,0,0,2,106,'7F26C1B107B108340F009A03556BC34E'),(781,'savecontent','Saves the generated content inside the tag body in a variable.',1,2,0,0,4,106,'1EF37ED4D650AD253BC8164F69EAA377'),(782,'component','Creates and defines a component object; encloses functionality that you build in CFML and enclose within cffunction tags. This tag contains one or more cffunction tags that define methods. Code within the body of this tag, other than cffunction tags, is executed when the component is instantiated.',1,3,0,0,4,106,'A88C6C0DF785E995FBAB67683F18C43D'),(783,'param','Tests for a parameter\'s existence, tests its data type, and provides a default value if one \n  is not assigned.',1,2,0,0,2,106,'739F5D57F7E1FFBC9097F245340990ED'),(784,'logout','Logs the current user out. Removes knowledge of the user ID, password, and roles from the server. \n		If you do not use this tag, the user is automatically logged out when the session ends.',1,2,0,0,2,106,'FFB47BEA4061E3CE4D240C98DF7A712F'),(785,'table','Builds a table in a CFML page. Use the cfcol tag to define table column and row \n  characteristics. The cftable tag renders data either as preformatted text, or, with the HTMLTable \n  attribute, as an HTML table. Use cftable to create tables if you don\'t want to write HTML table tag \n  code, or if your data can be well presented as preformatted text.',1,2,0,0,4,106,'866E866EC5DA39CD1F63FB9C976643CF'),(786,'zip','Manipulates ZIP and Java Archive (JAR) files. \n		In addition to the basic zip and unzip functions, use the cfzip tag to delete entries from an archive, filter files, \n		read files in binary format, list the contents of an archive, and specify an entry path used in an executable JAR file.',1,2,0,0,4,106,'ECD39EE147886FCEE832A3CE0F3FC018'),(787,'applet','Used in a cfform tag, cfapplet lets you reference custom Java applets that you have registered \n			using the Railo Administrator.',1,2,0,0,2,106,'5EBEA92B691C5011B76D594D048DE875'),(788,'AjaxProxy','Creates a JavaScript proxy for a component, for use in an AJAX client. Alternatively, creates a proxy for a single CFC method, JavaScript function, or URL that is bound to one or more control attribute values.',1,2,0,0,4,106,'52E82EA28742634789A5854944FCBC68'),(789,'stopwatch','Stops the time from starttag to endtag',1,2,0,0,4,106,'8C10D53912ED88F6163EDCADEAF00988'),(790,'feed','Reads or creates an RSS or Atom syndication feed. \n		This tag can read various RSS and Atom 0.3 versions. It can create RSS 2.0 or Atom 1.0 feeds.',1,2,0,0,2,106,'92276D9DA4081FAAD6EC6B51A8C6CFDD'),(791,'header','Generates custom HTTP response headers to return to the client.',1,2,0,0,2,106,'69DB7BD006CD2C0D5F797ADB6D696159'),(792,'chartseries','Used with the cfchart and cfchartseries tags. This tag defines chart data points. Its data is submitted to the cfchartseries tag.',1,2,0,0,4,106,'213AD85F4A6298AAE15A980336276598'),(793,'catch','Defines table column header, width, alignment, and text. Used only inside a cftable.',1,4,0,0,4,106,'E94CCC1AD08BDD99CAB75130C0275914'),(794,'associate','Allows subtag data to be saved with the base tag. Applies only to custom tags.',1,2,0,0,2,106,'B97861649513523699B2D6E75E94631F'),(795,'throw','The cfthrow tag raises a developer-specified exception that can be caught with cfcatch tag \n  having any of the following type specifications - cfcatch type = \'custom_type\', cfcatch type = \'Application\'\n  \'cfcatch\' type = \'Any\'',1,2,0,0,2,106,'40CA79FD683440C1CC73C517B939CF8B'),(796,'LayoutArea','',1,2,0,0,4,106,'B2DEFCA0AA1B46D36FD9B4127AF8919C'),(797,'Layout','',1,2,0,0,4,106,'F81177052F504AC2ACCAE407B110E9AB'),(798,'elseif','Used with cfelse and cfelseif, \n			cfif lets you create simple and compound conditional statements \n			in CFML. The value in the cfif tag can be any expression.',1,1,0,0,2,106,'DAF39AF4E609C80779279D41B41D8A42'),(799,'http','Lets you execute HTTP POST and GET operations on files. Using cfhttp, you can execute standard \n  GET operations and create a query object from a text file. POST operations lets you upload MIME file \n  types to a server, or post cookie, formfield, URL, file, or CGI variables directly to a specified server.',1,2,0,0,4,106,'0455A06CFB2820EF39C6555B6C7873FC'),(800,'Dump','Outputs the elements, variables and values of most kinds of CFML objects. Useful for debugging. You can display the contents of simple and complex variables, objects, components, user-defined functions, and other elements.',1,2,0,0,4,106,'5F94BA72212B458D950ACFB55AA3C829'),(801,'abort','Stops processing of a page at the tag location. CFML returns everything that was processed before the cfabort tag. The cfabort tag is often used with conditional logic to stop processing a page when a condition occurs.',1,2,0,0,2,106,'AC50C203B6A42432EE6A993A99634820'),(802,'forward','Leads the request to a different page. \n		This tag acts like the tag cflocation except that the relocation is done directly on the server.',1,2,0,0,2,106,'DB298A4409393ABC1753307DDAEFCDEB'),(803,'login','A container for user login and authentication code. \n		Railo runs the code in this tag if a user is not already logged in.\n		You put code in the tag that authenticates the user and identifies the user with a set of roles. Used with cfloginuser tag.',1,2,0,0,4,106,'0A8AFFD799961F6555D75540DB09F188'),(804,'MapItem','',1,2,0,0,4,106,'0A6E6395D9C6F7A8B31ED89F30789165'),(805,'registry','Reads, writes, and deletes keys and values in the system registry. The cfregistry tag is supported \n  on all platforms, including Linux, Solaris, and HP-UX.',1,2,0,0,2,106,'3170E02B3FFE4F6857E685C5694646BC'),(806,'lock','Provides two types of locks to ensure the integrity of shared data: Exclusive lock and Read-only \n  lock. An exclusive lock single-threads access to the CFML constructs in its body. Single-threaded access \n  implies that the body of the tag can be executed by at most one request at a time. A request executing \n  inside a cflock tag has an \"exclusive lock\" on the tag. No other requests can start executing inside the \n  tag while a request has an exclusive lock. Railo issues exclusive locks on a first-come, first-served \n  basis. A read-only lock allows multiple requests to access the CFML constructs inside its body concurrently. \n  Therefore, read-only locks should be used only when the shared data is read only and not modified. If another \n  request already has an exclusive lock on the shared data, the request waits for the exclusive lock to be \n  released.',1,2,0,0,4,106,'A490E47BB40496F8DFEF624C0A511B80'),(807,'pdf','Manipulates existing PDF documents. The following list describes some of the tasks you can perform with the cfpdf tag:\n- Merge several PDF documents into one PDF document.\n- Delete pages from a PDF document.\n- Merge pages from one or more PDF documents and generate a new PDF document.\n- Linearize PDF documents for faster web display.\n- Remove interactivity from forms created in Acrobat(c) to generate flat PDF documents.\n- Encrypt and add password protection to PDF documents.\n- Generate thumbnail images from PDF documents or pages.\n- Add or remove watermarks from PDF documents or pages.\n- Retrieve information associated with a PDF document, such as the software used to generate the file or the author, and set information for a PDF document, such as the title, author and keywords.\n- Create PDF portfolios\n- Add and remove header/footer from PDF documents\n- Optimize PDF documents',1,2,0,0,4,106,'C8FFF6B4F7CBE4CF3ECFB35381F15286'),(808,'flush','Flushes currently available data to the client.',1,2,0,0,2,106,'646BA76E6B9642307852827708BB9C6C'),(809,'collection','Allows you to create and administer Search collections.',1,2,0,0,2,106,'086D67378E78EC9C71BEE4412762236B'),(810,'procresult','Specifies a result set name that other tags, such as cfoutput and cftable, use to access \n  the result set. It also lets you optionally identify which of the stored procedure\'s result sets to \n  return. The cfprocresult tag is nested within a cfstoredproc tag.',1,2,0,0,2,106,'D1F29835C8F958DF2C3A3684C60906BA'),(811,'loop','Looping is a very powerful programming technique that lets you repeat a set of instructions or \n  display output repeatedly until one or more conditions are met. cfloop supports five types of loops.',1,2,0,0,4,106,'8DE774734EF6F16F2E1F5C3260C0324C'),(812,'property','Defines components as complex types that are used for web services authoring. The attributes of this tag are exposed as component metadata and are subject to inheritance rules.',1,3,0,0,2,106,'41FBD680131198CCCC34F64EA97538FB'),(813,'error','Enables the display of customized HTML pages when errors occur. This lets you maintain a \n  consistent look and feel within your application, even when errors occur.',1,2,0,0,2,106,'36EFB03454228869246C5F04E380CF05'),(814,'setting','Controls various aspects of page processing, such as the output of HTML code in pages. One \n  benefit of this option is managing whitespace that can occur in output pages served by CFML.',1,2,0,0,4,106,'63CF2C4D2BF589908FE4D23A06ECE6D8'),(815,'image','Lets you resize and add labels to GIF and JPEG format images.',1,2,0,0,2,106,'1ABF9A9227428B71CC04FF7EE2F3E4AD'),(816,'object','Lets you call methods in COM, CORBA, and JAVA objects.',1,2,0,0,2,106,'A7CC1627E17A45481C07547F4903F9FC'),(817,'graph','Displays a graphical representation of data.',1,2,0,0,4,106,'7BBE26FB999DBA444AAD55C8BA65D7DE'),(818,'htmlhead','Writes the text specified in the text attribute to the \'head\' section of a generated HTML page. \n	 The cfhtmlhead tag can be useful for embedding JavaScript code, or placing other HTML tags such, as \n	 META, LINK, TITLE, or BASE in an HTML page header.',1,2,0,0,2,106,'9F208C132E2FCFF8C3AE9BDDD08CD4A8'),(819,'chartdata','Used with the cfchart and cfchartseries tags. This tag defines chart data points. Its data is submitted to the cfchartseries tag.',1,2,0,0,2,106,'6B8187C64D4FC4E70183B6598E6A50AC'),(820,'queryparam','Checks the data type of a query parameter. The cfqueryparam tag is nested within a cfquery tag. \n  It is embedded within the query SQL statement. If you specify its optional parameters, cfqueryparam \n  also performs data validation.',1,2,0,0,2,106,'DDFC2C81C711323CE5214581E42ABCDB'),(821,'procparam','Specifies parameter information, including type, name, value, and length. The cfprocparam tag \n  is nested within a cfstoredproc tag.',1,2,0,0,2,106,'F3B5DF7DFE8F0FE5E0A72DE568FC7261'),(822,'pop','Retrieves and deletes e-mail messages from a POP mail server.',1,2,0,0,2,106,'B6DEB39ED9F7C03F08F19463D8565987'),(823,'Window','',1,2,0,0,4,106,'CA62B8BD27BD8F1511B5A89E9E62E02E'),(824,'select','Used inside cfform, cfselect lets you construct a drop-down list box form control. You can \n  populate the drop-down list box from a query, or using the option tag. Use option elements to populate \n  lists. The syntax for the option tag is the same as for its HTML counterpart.',1,2,0,0,4,106,'9B91DEA836319757F127861F0BEA0F34'),(825,'pdfparam','Provides additional information for the cfpdf tag. The cfpdfparam tag applies only to the merge action of the cfpdf tag and is always a child tag of the cfpdf tag.',1,2,0,0,2,106,'4064CF1108056C814E4ED63DA92BCAA6'),(826,'chart','Generates and displays a chart.',1,2,0,0,4,106,'D559F8202980AB47FE60CDD2CDC11E2F'),(827,'index','Populates collections with indexed data. The cfindex and cfsearch tags encapsulate the \n  indexing and searching utilities. Collections can be populated from text files in a directory \n  you specify, or from a query generated by a query. Before you can populate a collection, \n  you must create the collection using either the cfcollection tag or the Railo Administrator. Use \n  cfsearch to search collections you populate with cfindex.',1,2,0,0,2,106,'BF6AC957C12BD6BECB46FF54AC49D622'),(828,'while','Simplification of the tag cfloop-contition, analog to the cfscript \"while\" loop.',1,1,0,0,4,106,'DBF21687880574EAAE89E28319072F80'),(829,'location','Opens a CFML page or HTML file. For example, you might use cflocation to specify a standard \n  message or response that you use in several applications. Use the addToken attribute to verify \n  client requests.',1,2,0,0,2,106,'4EF84EC8C393AE0E915806BFD3CCAB9F'),(830,'module','Invokes a custom tag for use in cfml templates. The cfmodule tag can help deal with \n  custom tag name conflicts. Use the template attribute to name a template that contains the custom \n  tag definition, including its path..',1,4,0,0,4,106,'9152289C685300DD1DAB1A029DA118B1'),(831,'xml','Creates a CFML XML document object that contains the markup in the tag body. This tag can include XML and CFML tags. \n		Railo processes the CFML code in the tag body, then assigns the resulting text to an XML document object variable.',1,2,0,0,4,106,'12D82A9C5CD97ACA3B43453779C35D67'),(832,'input','Used inside cfform to place radio buttons, checkboxes, or text boxes. Provides input \n  validation for the specified control type.',1,2,0,0,2,106,'CF02D60BCD6552311F415B8CE8139180'),(833,'imap','Retrieves and deletes e-mail messages from a Imap mail server.\n		This tag works exactly the same way as the cfmail tag. It has the same attributes.\n		The Internet Message Access Protocol or IMAP is one of two of the most prevalent Internet standard protocols for e-mail retrieval, \n		the other being POP3. Virtually all modern e-mail clients and servers support both protocols as a means of transferring e-mail messages from a server, \n		such as those used by Gmail, to a client, such as Mozilla Thunderbird and Microsoft Outlook.\n		Many implementations of webmail use IMAP to retrieve e-mail messages from a server and display them within a web browser, \n		making the use of this protocol transparent to the user.',1,2,0,0,2,106,'5323C4AD055D4A08504B21DCFD415CA0'),(834,'servletparam','This tag has been deprecated and is non-functional.',1,2,0,0,2,106,'FDD6DFE61B39ABA86D82F86D807E64B2'),(835,'sleep','Pauses the execution of the page for a given interval',1,2,0,0,2,106,'F7514563A4E3C5BCC57DDC792B5CDB42'),(836,'throw','The cfthrow tag raises a developer-specified exception that can be caught with cfcatch tag \n  having any of the following type specifications - cfcatch type = \'custom_type\', cfcatch type = \'Application\'\n  \'cfcatch\' type = \'Any\'',1,2,0,0,2,107,'2B99AE2A0D6913D361B5BE3CAC37D208'),(837,'Dump','Outputs the elements, variables and values of most kinds of CFML objects. Useful for debugging. You can display the contents of simple and complex variables, objects, components, user-defined functions, and other elements.',1,2,0,0,4,107,'AF9C57097689600B73A021B3164F7681'),(838,'Window','Creates a pop-up window in the browser. Does not create a separate browser pop-up instance. ',1,2,0,0,4,107,'926D4ED8530B13F10393C6ECCA7BD9CE');
