s true.',15,9,106,'F8A34973B06AE03400AABDABFC82340C'),(2571,'string_expression2',6,1,'Expression to evaluate and return if condition is false.',15,10,106,'2AB6751CE96F53B9CB9BEF3EA1868E66'),(2572,'entity',16,1,'name of the entity',1579,1,106,'1646514622043A995F2FC06A637B5C23'),(2573,'timezone',6,0,'A datetime object is independent of a specific timezone, it is only a offset in milliseconds from 1970-1-1 00.00:00 UTC (Coordinated Universal Time).\nThis means that the timezone only comes into play when you need specific information like hours in a day, minutes in a hour or which day it is since those calculations depend on the timezone.\nFor these calculations, a timezone must be specified in order to translate the date object to something else. If you do not provide the timezone in the function call, it will default to the timezone specified in the Railo Administrator (Settings/Regional), or the timezone specified for the current request using the function setTimezone.\nYou can find a list of all available timezones in the Railo administrator (Settings/Regional). Some examples of valid timezones:\n       - AGT (for time in Argentina)\n       - Europe/Zurich (for time in Zurich/Switzerland)\n       - HST (Hawaiian Standard Time in the USA)',18,4,106,'069FCD366F3B34360EB02077D3E34501'),(2574,'attributeCollection',11,0,'The structure used to specify the line attributes:\n- width: Pen width, which is measured perpendicularly to the pen trajectory.\n- endcaps: Decoration applied to the ends of unclosed subpaths and dash segments. Subpaths that start and end on the same point are considered unclosed if they do not have a close segment, valid values are ( butt.round,square )\n- lineJoins: Type of line joins, valid values are (bevel,miter,join)\n- miterLimit:The limit to trim a line join that has a mitered join decoration. (Use only when lineJoins = \"miter\".) A line join is trimmed when the ratio of miter length to stroke width is greater than the miterLimit value. The miter length is the diagonal length of the miter, which is the distance between the inside corner and the outside corner of the intersection. The smaller the angle formed by two line segments, the longer the miter length and the sharper the angle of intersection. The default value is 10.0, which trims all angles less than 11 degrees. Trimming miters converts the decoration of the line join to bevel.\n- dashArray: An array of numbers that indicates the dash pattern. For example. if dashArray is (8,4), the dash pattern is 8 pixels solid, 4 pixels blank, 8 pixels solid, 4 pixels blank, and so on.\n- dash_phases: An offset into the dash pattern. For example, a dash_phase of 2, and a dashArray of (8,4) produces the dash pattern of 6 pixels solid, 4 pixels blank, 8 pixels solid, 4 pixels blank, and so on.',379,4,106,'F1BDB3DD763B9342A6A8DA871D72F477'),(2575,'thickness',5,0,'Thickness of the border in pixels. The default value is 1. The border is added to the outside edge of the image; the image area is increased accordingly.',360,8,106,'3BC37BC3CC957F43B4BA3D004035F7A5'),(2576,'color',6,0,'Optional. Border color. The default border color is black. See Usage.\nOnly valid if the borderType is not specified or if borderType = \"constant\".',360,9,106,'3A5F0D971033529F85776EA33AE1D583'),(2577,'borderType',6,0,'The type of border:\n- zero: Sets the border color to black.\n- constant: Sets the border to the specified color (default).\n- copy: Sets sample values to copies of the nearest valid pixel. For example, pixels to the left of the valid rectangle assume the value of the valid edge pixel in the same row. Pixels both above and to the left of the valid rectangle assume the value of the upper-left pixel.\n- reflect: Mirrors the edges of the source image. For example, if the left edge of the valid rectangle is located at x = 10, pixel (9, y) is a copy of pixel (10, y) and pixel (6, y) is a copy of pixel (13, y).\n- wrap: Tiles the source image in the plane.',360,10,106,'33C0C114B208E839AB3345E64A5E73D7'),(2578,'locale',6,0,'Locale to use instead of the locale of the page when processing the function',20,6,106,'B91A2C2C59F3270A322FD666B53B0813'),(2579,'charset',6,0,'The character encoding in which the string is encoded.',21,7,106,'B371A2E256CC520F844FF0A600B980C2'),(2580,'string',6,1,'String in which to search.',22,6,106,'9D5529A6902B1D693A7EB521619D8BEA'),(2581,'start',5,0,'Start position of search.',22,7,106,'0281CD97AC6C93411E2E0BD98FE6C42F'),(2582,'start',5,1,'',29,2,106,'FD5E8344CCBE5C9B7FFD495C937F7507'),(2583,'count',5,1,'',29,3,106,'76C2AAB20BD21876091FEB4A99902A82'),(2584,'addNewLine',4,0,'',2704,1,106,'A23409B5BCC5DCF098BF6561A636B203'),(2585,'doErrorStream',4,0,'',2704,2,106,'CF63D9C9424B6E7FD439EAF5CF5D4316'),(2586,'binaryencoding',6,1,'A string specifying the algorithm used to encode the original\n            binary data into a string; must be one of the following:\n- hex: characters 0-9 and A-F represent the hexadecimal value of each byte\n- UU: data is encoded using the UNIX UUencode algorithm\n- base64: data is encoded using the Base64 algorithm',31,6,106,'EE3DCC34E65441EE3D0DD914E7186FB1'),(2587,'number',5,1,'a integer',32,2,106,'996CC25DA8A5E476C385381BA0BF74DF'),(2588,'string2',6,1,'A string or a variable that contains one',36,6,106,'5A7AF00222D50C284D5901D204940625'),(2589,'fitWidth',6,1,'The width of the bounding box in pixels. You can specify an integer, or an empty string (\"\") if the fitHeight is specified.',380,10,106,'4933C44766458795C0780D4A83DC9806'),(2590,'fitHeight',6,1,'The height of the bounding box in pixels. You can specify an integer, or an empty string (\"\") if the fitWidth is specified.',380,11,106,'F8D3D16035BF65D380601C858B9B13EE'),(2591,'interpolation',6,0,'The interpolation method for resampling. You can specify a specific interpolation algorithm by name (for example, hamming), by image quality (for example, mediumQuality), or by performance (for example, highestPerformance). Valid values are:\n- highestQuality (default)\n- highQuality\n- mediumQuality\n- highestPerformance\n- highPerformance\n- mediumPerformance\n- nearest\n- bilinear\n- bicubic\n- bessel\n- blackman\n- hamming\n- hanning\n- hermite\n- lanczos\n- mitchell\n- quadratic',380,12,106,'7FB76B6CC5E3559FFD7661CC546D10A3'),(2592,'blurFactor',5,0,'The blur factor used for resampling. The higher the blur factor, the more blurred the image (also, the longer it takes to resize the image). Valid values are 1-10.',380,13,106,'593AA5CEAF83EDB281595C870C17814A'),(2593,'array',7,1,'array to slice',37,5,106,'CC2BA0886F8D3FDF155C50E8197D48F1'),(2594,'offset',5,1,'start position in the original array to slice',37,6,106,'BD65DAF8FE87F1AC705E40923CBD1D0E'),(2595,'length',5,0,'maximal elements to slice from offset',37,7,106,'49335C78841826215E6EC3634781094B'),(2596,'section',6,1,'Section of the initialization file in which the entry is\n            to be set',38,10,106,'DB21EDF68FFB70DF1629A7D03C99E789'),(2597,'entry',6,1,'Name of the entry to set',38,11,106,'E0D8497F266730C3B34B336F84E6AB7E'),(2598,'value',6,1,'Value to which to set the entry',38,12,106,'D4AF050AAA0D7D76DFDCF35A3098D2D3'),(2599,'section',6,1,'Section of initialization file from which to extract information',39,2,106,'7D0FCD5D9A833B33F412533C33D4A0AB'),(2600,'entry',6,1,'Name of value to get',39,3,106,'64E96E494ADC778D6852B7A22F065340'),(2601,'array',7,1,'the array to reverse',2716,1,106,'EE8D14AF5FE05F1D7C5E1942D247AD3C'),(2602,'source2',1,1,'the image that is the top layer (overlaid on the source1 image) in the image.',381,9,106,'CF4CC4B6CC278174E3F07F44A0638533'),(2603,'index',5,1,'index to check for.',2718,1,106,'ABEE6EDCDEFE84C6234855DA27CF4685'),(2604,'delimeter',6,0,'Characters that separate list elements. The default value is comma.',2718,2,106,'CB0CEA41300987DB5C9BF72B0A9AB008'),(2605,'mask',6,0,'Characters that show how Railo displays a date:\n- d: Day of the month as digits; no leading zero for single-digit days.\n- dd: Day of the month as digits; leading zero for single-digit days.\n- ddd: Day of the week as a three-letter abbreviation.\n- dddd: Day of the week as its full name.\n- m: Month as digits; no leading zero for single-digit months.\n- mm: Month as digits; leading zero for single-digit months.\n- mmm: Month as a three-letter abbreviation.\n- mmmm: Month as its full name.\n- yy: Year as last two digits; leading zero for years less than 10.\n- yyyy: Year represented by four digits.\n- gg: Period/era string. Ignored. Reserved. The following masks tell how to format the full date and cannot be combined with other masks:\n- short: equivalent to m/d/y\n- medium: equivalent to mmm d, yyyy\n- long: equivalent to mmmm d, yyyy\n- full: equivalent to dddd, mmmm d, yyyy',45,7,106,'3A544B78600C739B6FCF457B8621A5CB'),(2606,'dspLocale',6,0,'The locale in which to return the name. The default is the locale defined for the request.',305,5,106,'D055965CEF6B11DA07EBC6BFFFF07E51'),(2607,'pos',5,1,'The position in a file within a stream where the following read and write operation must occur.',1604,4,106,'0D7E7DC20F17E9BAACE76CACBCE7FBE3'),(2608,'x',5,1,'The x coordinate of the upper-left corner of the arc.',371,14,106,'6248770BA6121A53C8460134051AB3D0'),(2609,'y',5,1,'The y coordinate of the upper-left corner of the arc.',371,15,106,'203AF14E973770948393B36C7224E531'),(2610,'width',5,1,'The width of the arc.',371,16,106,'D8938FE488C507BCD01C19E6C99E8559'),(2611,'height',5,1,'The height of the arc.',371,17,106,'8718A0DDAC1333D55298EC3109BA1653'),(2612,'startAngle',5,1,'The beginning angle in degrees.',371,18,106,'279EE8EB1070B1C4EA9A2210AAC00BA9'),(2613,'arcAngle',5,1,'The angular extent of the arc, relative to the start angle.',371,19,106,'6A51BADA930CF274E6AA2664C8F1C9EE'),(2614,'filled',4,0,'Specify whether the arc is filled:\n- true: The arc is filled with the specified drawing color.\n- false (default): Only the outline of the arc is drawn.',371,20,106,'9892EA26F53C0547A37552BF0E22D4CE'),(2615,'key',6,1,