d by the hash algorithm.',65,6,106,'18A40BC9FDEA368F0A94775F8CB776A2'),(2637,'key',6,1,'Key or seed used to encrypt the string.\n- For the CFMX_COMPAT algorithm, any combination of any number of characters; used as a seed used to generate a 32-bit encryption key.\n- For all other algorithms, a key in the format used by the algorithm. For these algorithms, use the GenerateSecretKey function to generate the key.',436,5,106,'A945B91C9E67D48A9DE3B661334E3994'),(2638,'algorithm',6,0,'The algorithm to use to decrypt the string. Must be the same as the algorithm used to encrypt the string.\n- CFMX_COMPAT(default): the CFML specific algorithm. This algorithm is the least secure option\n- AES: the Advanced Encryption Standard specified by the National Institute of Standards and Technology (NIST) FIPS-197\n- BLOWFISH: the Blowfish algorithm defined by Bruce Schneier\n- DES: the Data Encryption Standard algorithm defined by NIST FIPS-46-3\n- DESEDE: the \"Triple DES\" algorithm defined by NIST FIPS-46-3',436,6,106,'B83EC6C03F4FE6C224D3B1F544955F1B'),(2639,'variable',1,1,'Variable name',2748,1,106,'7E3AC2214CD54F162964BC1273BE23E4'),(2640,'width',6,1,'New width of the image. If this value is blank, the width is calculated proportionately to the height.',362,6,106,'E9624FAA7D2A90DD86DC64A65C11CED4'),(2641,'height',6,0,'New height of the image. If this value is blank, the height is calculated proportionately to the width.',362,7,106,'03BBEF5BF19CA8A9D66C5520CBD8123B'),(2642,'interpolation',6,0,'the interpolation method for resampling. You can specify a specific interpolation algorithm by name (for example, hamming), by image quality (for example, mediumQuality), or by performance (for example, highestPerformance). Valid values are:\n- highestQuality (default)\n- highQuality\n- mediumQuality\n- highestPerformance\n- highPerformance\n- mediumPerformance\n- nearest\n- bilinear\n- bicubic\n- bessel\n- blackman\n- hamming\n- hanning\n- hermite\n- lanczos\n- mitchell\n- quadratic',362,