eger, or an empty string (\"\") if the fitWidth is specified.',3118,2,107,'F8D3D16035BF65D380601C858B9B13EE'),(3000,'interpolation',6,0,'The interpolation method for resampling. You can specify a specific interpolation algorithm by name (for example, hamming), by image quality (for example, mediumQuality), or by performance (for example, highestPerformance). Valid values are:\n- highestQuality (default)\n- highQuality\n- mediumQuality\n- highestPerformance\n- highPerformance\n- mediumPerformance\n- nearest\n- bilinear\n- bicubic\n- bessel\n- blackman\n- hamming\n- hanning\n- hermite\n- lanczos\n- mitchell\n- quadratic',3118,3,107,'7FB76B6CC5E3559FFD7661CC546D10A3'),(3001,'blurFactor',5,0,'The blur factor used for resampling. The higher the blur factor, the more blurred the image (also, the longer it takes to resize the image). Valid values are 1-10.',3118,4,107,'593AA5CEAF83EDB281595C870C17814A'),(3002,'array',7,1,'array to slice',3119,1,107,'CC2BA0886F8D3FDF155C50E8197D48F1'),(3003,'offset',5,1,'start position in the original array to slice',3119,2,107,'BD65DAF8FE87F1AC705E40923CBD1D0E'),(3004,'length',5,0,'maximal elements to slice from offset',3119,3,107,'49335C78841826215E6EC3634781094B'),(3005,'iniPath',6,1,'Absolute path of initialization file',3120,1,107,'D4F7315E53C5007AB60663E3CFB62207'),(3006,'section',6,1,'Section of the initialization file in which the entry is\n            to be set',3120,2,107,'DB21EDF68FFB70DF1629A7D03C99E789'),(3007,'entry',6,1,'Name of the entry to set',3120,3,107,'E0D8497F266730C3B34B336F84E6AB7E'),(3008,'value',6,1,'Value to which to set the entry',3120,4,107,'D4AF050AAA0D7D76DFDCF35A3098D2D3'),(3009,'iniPath',6,1,'Absolute path (drive, directory, filename, extension) of initialization file; for example, C:\\\\boot.ini',3121,1,107,'C616B5A9CDC87FD909CECC32230E15C7'),(3010,'section',6,1,'Section of initialization file from which to extract information',3121,2,107,'7D0FCD5D9A833B33F412533C33D4A0AB'),(3011,'entry',6,1,'Name of value to get',3121,3,107,'64E96E494ADC778D6852B7A22F065340'),(3012,'value',1,1,'A string containing the XML document text',3124,1,107,'FBBA79BCEF8AB756307D0B556B39699F'),(3013,'source1',1,1,'The image that is the bottom layer in the image.',3125,1,107,'D241C206BC4764EDE9F0668E5B1DC018'),(3014,'source2',1,1,'the image that is the top layer (overlaid on the source1 image) in the image.',3125,2,107,'CF4CC4B6CC278174E3F07F44A0638533'),(3015,'date',1,1,'Date object',3127,1,107,'8A81A794019B9676EDB6231A6F4592C8'),(3016,'mask',6,0,'Characters that show how Railo displays a date:\n- d: Day of the month as digits; no leading zero for single-digit days.\n- dd: Day of the month as digits; leading zero for single-digit days.\n- ddd: Day of the week as a three-letter abbreviation.\n- dddd: Day of the week as its full name.\n- m: Month as digits; no leading zero for single-digit months.\n- mm: Month as digits; leading zero for single-digit months.\n- mmm: Month as a three-letter abbreviation.\n- mmmm: Month as its full name.\n- yy: Year as last two digits; leading zero for years less than 10.\n- yyyy: Year represented by four digits.\n- gg: Period/era string. Ignored. Reserved. The following masks tell how to format the full date and cannot be combined with other masks:\n- short: equivalent to m/d/y\n- medium: equivalent to mmm d, yyyy\n- long: equivalent to mmmm d, yyyy\n- full: equivalent to dddd, mmmm d, yyyy',3127,2,107,'3A544B78600C739B6FCF457B8621A5CB'),(3017,'date',15,1,'Date/time object',3128,1,107,'E77595A0ADE1C6E70D25D5F01653636F'),(3018,'dspLocale',6,0,'The locale in which to return the name. The default is the locale defined for the request.',3129,1,107,'D055965CEF6B11DA07EBC6BFFFF07E51'),(3019,'fileObj',1,1,'The file object.',3130,1,107,'368F75A95B2ED961B5520616BB977D9A'),(3020,'pos',5,1,'The position in a file within a stream where the following read and write operation must occur.',3130,2,107,'0D7E7DC20F17E9BAACE76CACBCE7FBE3'),(3021,'x',5,1,'The x coordinate of the uppe