ed by FIPS-180-2.\n- SHA-384: Generates a 64-character string using the SHA-384 algorithm specified by FIPS-180-2.\n- SHA-512: Generates an 88-character string using the SHA-1 algorithm specified by FIPS-180-2.',3152,2,107,'13F564ED9ADE20588428D13F317098AE'),(3063,'encoding',6,0,'A string specifying the encoding to use when converting\n            the string to byte data used by the hash algorithm.',3152,3,107,'18A40BC9FDEA368F0A94775F8CB776A2'),(3064,'bytes',1,1,'Binary data to encrypt.',3153,1,107,'6C018FCE958B96926884A24C51A32BDE'),(3065,'key',6,1,'Key or seed used to encrypt the string.\n- For the CFMX_COMPAT algorithm, any combination of any number of characters; used as a seed used to generate a 32-bit encryption key.\n- For all other algorithms, a key in the format used by the algorithm. For these algorithms, use the GenerateSecretKey function to generate the key.',3153,2,107,'A945B91C9E67D48A9DE3B661334E3994'),(3066,'algorithm',6,0,'The algorithm to use to decrypt the string. Must be the same as the algorithm used to encrypt the string.\n- CFMX_COMPAT(default): the CFML specific algorithm. This algorithm is the least secure option\n- AES: the Advanced Encryption Standard specified by the National Institute of Standards and Technology (NIST) FIPS-197\n- BLOWFISH: the Blowfish algorithm defined by Bruce Schneier\n- DES: the Data Encryption Standard algorithm defined by NIST FIPS-46-3\n- DESEDE: the \"Triple DES\" algorithm defined by NIST FIPS-46-3',3153,3,107,'B83EC6C03F4FE6C224D3B1F544955F1B'),(3067,'width',6,1,'New width of the image. If this value is blank, the width is calculated proportionately to the height.',3154,1,107,'E9624FAA7D2A90DD86DC64A65C11CED4'),(3068,'height',6,0,'New height of the image. If this value is blank, the height is calculated proportionately to the width.',3154,2,107,'03BBEF5BF19CA8A9D66C5520CBD8123B'),(3069,'interpolation',6,0,'the interpolation method for resampling. You can specify a specific interpolation algorithm by name (for