ies read and execute permission.\n- 6 indicates read and write permission.\n- 7 indicates read, write, and execute permission.\n\nFor example, 400 specifies that only the owner can read the file; 004 specifies that anyone can read the file.',3376,1,107,'03F2CE76D552C48727E6186C3FC0713E'),(3407,'structure',11,1,'Structure that contains the value to return',3377,1,107,'D064FF080B0E2BE42F5EF16E000C96EE'),(3408,'key',6,1,'Key whose value to return',3377,2,107,'0E7766599FAEC6FAE53F0A249075B3C9'),(3409,'number',5,1,'Real number to round down to an integer.',3378,1,107,'32C8BD5898EB6E97A18E3328DF4CE9BA'),(3410,'start',5,0,'',3380,1,107,'21736353B23695A7F3B107D67DA3E16D'),(3411,'returnsubexpressions',4,0,'True: if the regular expression is found, the first array\n                element contains the length and position, respectively,\n                of the first match.\n                If the regular expression contains parentheses that\n                    group subexpressions, each subsequent array element\n                    contains the length and position, respectively, of\n                    the first occurrence of each group.\n                If the regular expression is not found, the arrays each\n                    contain one element with the value 0.\n            False: the function returns the position in the string\n                where the match begins. Default.',3380,2,107,'8593BF7AE820FEADF98226D90B4A55EE'),(3412,'path',6,1,'path to the zip file',3382,1,107,'5904A1AACAC1AFBAD7FC89C0782D8E97'),(3413,'var',16,1,'',1500,2,107,'D6DCD0CF8EA74B92BA4C13A71693758A'),(3414,'value',6,1,'file to check',3383,1,107,'7402FA1D68AE7C0126D0DAAA9B8A0EF4'),(3415,'set',6,1,'String that contains one or more characters to search for.',3384,1,107,'4972A6C16958AB8A05E257B120280B37'),(3416,'value',1,1,'A WDDX packet',3385,1,107,'9D0522A9A09FAB161B1015A2108553C1'),(3417,'str',6,1,'the text to draw.',3386,1,107,'30ECCECA40D0FA09747E58CBDA9A65D3'),(3418,'x',5,1,'The x coordinate f