INSERT INTO `attributes` VALUES (1,'expression',6,1,'Any ColdFusion expression that yields a scalar value. ColdFusion converts integers, real numbers, \n		Booleans, and dates to numeric values.',1,1,'02B4F7859CCAB53000F3791ECB46E7A3'),(2,'name',6,0,'The name of your application. This name can be up to 64 characters long.\n   		Required for application and session variables, optional for client variables',2,1,'F690A7248773A1623C453BB51D1586A9'),(3,'loginstorage',6,0,'',2,1,'1982A4D39650F784310C35E606DD6C6B'),(4,'sessionmanagement',4,0,'Yes or No. Yes enables session variables. Default is No.',2,1,'002A61A31CE888E8526B0F98605487AE'),(5,'applicationtimeout',19,0,'Enter the CreateTimeSpan function and values in days, hours, minutes, and seconds, separated \n		by commas, to specify the lifespan of application variables. The default value is specified in\n		the Variables page of the ColdFusion Administrator.',2,1,'F0B965850F0B525FDC9ECF6B8114803A'),(6,'clientmanagement',4,0,'Yes or No. Enables client variables. Default is No.',2,1,'03DD0137EFA06E5D79AA40AB9AE0B214'),(7,'sessiontimeout',19,0,'Enter the CreateTimeSpan function and values in days, hours, minutes, and seconds, separated \n		by commas, to specify the lifespan of session variables. The default value is specified in the\n		Variables page of the ColdFusion Administrator.',2,1,'215C94DE6FAB51D7F705D9A5216512FF'),(8,'clientstorage',6,0,'Specifies how ColdFusion stores client variables',2,1,'E870B6E77CC60A314373FBFC8A795AEB'),(9,'setclientcookies',4,0,'Yes or No. Yes enables client cookies. Default is Yes. If you set this attribute to \n		\"No\", ColdFusion does not automatically send the CFID and CFTOKEN cookies to the client browser;\n		you must manually code CFID and CFTOKEN on the URL for every page that uses Session or Client variables.',2,1,'15E7C71237438738FCF90B047354C2E5'),(10,'setdomaincookies',4,0,'Yes or No. Sets the CFID and CFTOKEN cookies for a domain, not just a single host. \n		Applications that are running on clusters must set this value to Yes. The default is No.',2,1,'A10FAC79B6EFCBCD1AE96BA72D2D87EE'),(11,'expr',16,0,'An expression; the result of the function from which this tag is called.',3,1,'7C0C8107EA64B091E09377B1578BEB45'),(12,'name',6,0,'Specifies the name of the header. Header names are case insensitive. This attribute is mutually \n		exclusive with the file attribute.',5,1,'2F7CA58E2D94F8144876E860EBB1E096'),(13,'file',6,0,'Attaches the specified file to the message. This attribute is mutually exclusive with the \n		name attribute.',5,1,'472818498CE7F7592340C40E90550020'),(14,'type',6,0,'The MIME media type of the part.',5,1,'BA7416C7D1DAB48F10544D5F74FE6FF4'),(15,'value',6,0,'Indicates the value of the header.',5,1,'FD6BA32F5AE90C98D66DF649FE0B0572'),(16,'contentid',6,0,'The Identifier for the attached file. This ID should be globally unique and is used to identify the file in an IMG or other tag in the mail body that references the file content.',5,1,'F05B3672A8E34BAD690903AE18B03D49'),(17,'disposition',6,0,'How the attached file is to be handled. Can be one of the following:\n			attachment: presents the file as an attachment. \n			inline: displays the file contents in the message.',5,1,'642D7E36ED90E2B75C8655F4AA423446'),(18,'isolation',6,0,'ODBC lock type.',6,1,'B77FE6CA5A9C8B54278C5B2E72CC2999'),(19,'directory',6,1,'The name of the directory to perform the action against.',7,1,'80370D105E54B30F90FE864C9183DF85'),(20,'name',6,0,'Required for action = \"list\". Ignored by all other actions. Name of output query for directory \n		listing.',7,1,'49DEA3B08A9571FF911042D4CD4AFE86'),(21,'sort',6,0,'Optional for action = \"list\". Ignored by all other actions. The query columns by which to sort \n		the directory listing. Any combination of columns from query output can be specified in comma-separated list.\n		You can specify ASC (ascending) or DESC (descending) as qualifiers for column names. ASC is the default',7,1,'19F1BF066B3698D5B9D21B5F54D41236'),(22,'filter',6,0,'Optional for action = \"list\". Ignored by all other actions. File extension filter applied to\n		returned names. For example: *m. Only one mask filter can be applied at a time.',7,1,'F2B0F756394C04B15BACA5325F509B5D'),(23,'recurse',4,0,'Whether ColdFusion performs the action on subdirectories',7,1,'C7988A8365BC050DD6E00B7999FC378A'),(24,'newdirectory',6,0,'Required for action = \"rename\". Ignored by all other actions. The new name of the directory \n		specified in the directory attribute.',7,1,'42D5179D289554A04A311E5929649B97'),(25,'action',6,0,'Defines the action to be taken with directory(ies) specified in directory.',7,1,'19BA4B37A004B172417B1463EACF383C'),(26,'mode',5,0,'Used with action = \"Create\" to define the permissions for a directory on UNIX and Linux \n		platforms. Ignored on Windows. Options correspond to the octal values of the UNIX chmod command. From \n		left to right, permissions are assigned for owner, group, and other.',7,1,'6F7A4359DACB7E7FA6541DE4ABA7BA5B'),(27,'thread',6,0,'Specifies whether to log the thread ID. The thread ID identifies which internal service thread logged a \n		message. Since a service thread normally services a CFML page request to completion, then moves on to \n		the next queued request, the thread ID serves as a rough indication of which request logged a message. \n		Leaving thread IDs turned on can help diagnose patterns of server activity.',9,1,'74DD92676ABA51E8F6291F13A6682D29'),(28,'application',4,0,'Specifies whether to log the application name if one has been specified in a cfapplication tag.',9,1,'CCBC328819FF194329F5DC12EC5D3432'),(29,'date',15,0,'Specifies whether to log the system date.',9,1,'436FC33C30778C6A0FD218208D0F25D8'),(30,'type',6,0,'The type or severity of the message.',9,1,'59E5C43E413599B9C4348B821C4BCA20'),(31,'log',6,0,'If you omit the file attribute, specifies the standard log file in which to write the message. \n		Ignored if you specify a file attribute',9,1,'E193260D703A351389D17B390344B5F7'),(32,'time',6,0,'Specifies whether to log the system time.',9,1,'5D11261FBAD7DC536F7F1053EDE81BA6'),(33,'text',6,1,'The message text to log.',9,1,'67A53390DE2736169D750BF451948B3B'),(34,'name',6,1,'name of the argument',11,1,'A5D4152C4F01483D75735AA693AEB0F2'),(35,'value',16,1,'value of the argument',11,1,'E35790AB13322F1E922574C3FA7B8196'),(36,'report',6,1,'Specifies the report path. Store Crystal Reports files in the same directories as ColdFusion \n		page files.',12,1,'4747CAF23BC6C18E72AE754B04E1C9FD'),(37,'password',6,0,'The password that corresponds to a username required for database access. Overrides the default \n		settings for the data source in the ColdFusion Administrator.',12,1,'205A8D0D34519B1AC499048B224CFC97'),(38,'orderby',6,0,'Orders results according to your specifications.',12,1,'B40061C60139A39D9131283CBB91ED7D'),(39,'formula',6,0,'Specifies one or more named formulas. Terminate each formula specification with a semicolon.',12,1,'83C5C9216631C5B2BBDCF2E154564F47'),(40,'username',6,0,'The username required for entry into the database from which the report is created. Overrides \n		the default settings for the data source in the ColdFusion Administrator.',12,1,'A94E34C16F7CEF125517120D88F6158F'),(41,'password',6,0,'Password if URL is protected.',13,1,'50BDE3B71ED3BFBE7C93047A659F3970'),(42,'returnvariable',6,0,'return variable name of action list',13,1,'226B1B82627EFCF78C7F4981688AA0F2'),(43,'username',6,0,'Username if URL is protected.',13,1,'76982CC435BF8F8CDB0E6B66B9C125BD'),(44,'url',6,0,'Required when action = \'update\'. The URL to be executed.',13,1,'9A7EA56AC853B218CD43231F8C01297B'),(45,'starttime',16,0,'Required when creating tasks with action = \'update\'. Enter a value in seconds. The time when \n	scheduling of the task starts.',13,1,'B95494DBAE38FF7F002A7263AA9E86A5'),(46,'requesttimeout',5,0,'Customizes the requestTimeOut for the task operation. Can be used to extend the default timeout \n		for operations that require more time to execute.',13,1,'03EF423F21C48AE5193A5640BEBEB655'),(47,'port',5,0,'The port number on the server from which the task is being scheduled. Default is 80. When used \n		with resolveURL, the URLs of retrieved documents that specify a port number are automatically resolved \n		to preserve links in the retrieved document.',13,1,'4D0E920C99DE6193AB59A90113153991'),(48,'operation',6,0,'The type of operation the scheduler performs when executing this task.',13,1,'578EC8B60E2A33ACDE367292F1A626B7'),(49,'proxyport',5,0,'The port number on the proxy server from which the task is being requested. Default is 80. When \n		used with resolveURL, the URLs of retrieved documents that specify a port number are automatically \n		resolved to preserve links in the retrieved document.',13,1,'FAB9A77551EF4F9FAFC89C98ADD06065'),(50,'enddate',16,0,'The date when the scheduled task ends.',13,1,'0F87CDEA3AD5DB301718044537C54B86'),(51,'path',6,0,'Required with publish =\'Yes\' The path location for the published file.',13,1,'3ED6BA4B2B18FA860243B57E16B683C6'),(52,'action',6,1,'',13,1,'6DD2FD2CFBB12718A94F98F756F65B20'),(53,'publish',4,0,'Specifies whether the result should be saved to a file.',13,1,'54CD236B4FBED6E4B2BC6D3A48D0CDAC'),(54,'proxyserver',6,0,'Host name or IP address of a proxy server.',13,1,'E6737A9F5FC25ABF97563EC507F0A73A'),(55,'resolveurl',4,0,'Specifies whether to resolve links in the result page to absolute references.',13,1,'C39647865369F1FFC5489880A811E849'),(56,'task',6,0,'The name of the task to delete, update, or run.',13,1,'1698092C43C03A4C8B6AB8F075E65239'),(57,'interval',6,0,'Required when creating tasks with action = \'update\'. Interval at which task should be scheduled. \n		Can be set in seconds or as Once, Daily, Weekly, and Monthly. The default interval is one hour. The \n		minimum interval is one minute.',13,1,'542AF2E7937B1E9477CB6FBC110F40B4'),(58,'file',6,0,'Required with publish =\'Yes\' A valid filename for the published file.',13,1,'B497