"\", for this attribute, you can call the custom tags without using a prefix. You must specify and use a prefix for a JSP tag library.',20,1,'9C03F1522AA6C55CC7840677B41CD406'),(114,'groupcasesensitive',4,0,'Boolean indicating whether to group by case. The default value is YES; case is considered while \n		grouping. If the query attribute specifies a query object that was generated by a case-insensitive \n		SQL query, set the groupCaseSensitive attribute to NO to keep the recordset intact.',21,1,'83AF924165CD5FF4B08533E7825034AA'),(115,'maxrows',5,0,'Specifies the maximum number of rows to display in the output section.',21,1,'C1C7FACD2C844BD7632D774AAF4110B7'),(116,'startrow',5,0,'Specifies the row from which to start output.',21,1,'D37757883303CEAE865620CC97BAE835'),(117,'query',6,0,'The name of the cfquery from which to draw data for the output section.',21,1,'D88405DB7FD432003A1222EF5BB55671'),(118,'group',6,0,'Specifies the query column to use when you group sets of records together. Use this attribute \n		if you have retrieved a record set ordered on a certain query column. For example, if a record set is \n		ordered according to \"CustomerID\" in the cfquery tag, you can group the output on \"CustomerID.\" The \n		group attribute, which is case sensitive, eliminates adjacent duplicates when the data is sorted by \n		the specified field. See the groupCaseSensitive attribute for information about specifying a case i\n		nsensitive grouping.',21,1,'1558A2A0DA10F0BA05EA68AFD04B27E2'),(119,'outputfile',6,0,'The file to which to direct the output of the program. If not specified, the output is \n		displayed on the page from which it was called.',23,1,'5AD00A26738DB0ADD451235A55F4C87D'),(120,'variable',6,0,'Variable in which to put program output. \n				If no outputfile or variable attribute is specified, \n				output is displayed on page from which it was called.',23,1,'EB0899B2515E50F0703ABF9ABA493BB5'),(121,'name',6,1,'The full pathname of the application to execute.\n		Note: On Windows, you must specify the extension as part of the application\'s name. For example, \n		myapp.exe,',23,1,'8396E58BCBBD48757FC9DEF82B83FD56'),(122,'timeout',5,0,'Indicates how long, in seconds, the ColdFusion executing thread waits for the spawned process. \n		A timeout of 0 is equivalent to the non-blocking mode of executing. A very high timeout value is \n		equivalent to a blocking mode of execution. The default is 0; therefore, the ColdFusion thread spawns \n		a process and returns without waiting for the process to terminate.If no output file is specified, \n		and the timeout value is 0, the program output is discarded.',23,1,'5AF0DFEC4C78AD27187202A93426D6BF'),(123,'arguments',16,0,'Command-line arguments passed to the application.',23,1,'80099EC217D64831BEA534B24E84F27F'),(124,'wraptext',5,0,'Specifies the maximum line length, in characters of the mail text. If a line has more than the specified number of characters, replaces the last white space character, such as a tab or space, preceding the specified position with a line break. If there are no white space characters, inserts a line break at the specified position. A common value for this attribute is 72.',24,1,'B4957EC82DA786FF01818D14B6F051F2'),(125,'password',6,0,'A password to send to SMTP servers that require authentication. Requires a username attribute.',24,1,'A5CE285BC80484976E4432B8C9E06046'),(126,'to',6,1,'The name of the e-mail message recipient.',24,1,'F6ABB6CBAD2F73AB1D539A76B3FF6C5D'),(127,'type',6,0,'Specifies extended type attributes for the message.',24,1,'D5E05C9C499D949F328D29E8EF8908E1'),(128,'charset',6,0,'Character encoding of the mail message',24,1,'FADC44F1834D9EC0DC0F394399D20693'),(129,'username',6,0,'A user name to send to SMTP servers that require authentication. Requires a password attribute.',24,1,'8B39F52AE69E3039807FB3D79BAC097A'),(130,'query',16,0,'The name of the cfquery from which to draw data for message(s) to send. Specify this \n		attribute to send more than one mail message, or to send the results of a query within a message.',24,1,'0D4CFBA79F7232DF0EC18F2C61334817'),(131,'subject',6,1,'The subject of the mail message. This field may be driven dynamically on \n		a message-by-message basis',24,1,'6B87B5F14F051B2F0A007C8BCEE720CA'),(132,'group',6,0,'Specifies the query column to use when you group sets of records together to send as an e-mail \n		message. For example, if you send a set of billing statements to customers, you might group on \n		\"Customer_ID.\" The group attribute, which is case sensitive, eliminates adjacent duplicates when the \n		data is sorted by the specified field. See the Usage section for exceptions.',24,1,'FB6F6E8100B0D10A714A1933A799C29F'),(133,'timeout',5,0,'The number of seconds to wait before timing out the connection to the SMTP server.',24,1,'41912BED1EA1BE5265CD5B2B09A74212'),(134,'groupcasesensitive',4,0,'Boolean indicating whether to group with regard to case or not. The default value is YES; \n		case is considered while grouping. If the query attribute specifies a query object that was generated \n		by a case-insensitive SQL query, set the groupCaseSensitive attribute to NO to keep the recordset \n		intact.',24,1,'16D88F615DCAB9C01EFB7B6A54EB8ECD'),(135,'port',5,0,'The TCP/IP port on which the SMTP server listens for requests. This is normally 25.',24,1,'6DB3A291DD4355DAD1B104A497E9BB44'),(136,'cc',6,0,'Indicates addresses to copy the e-mail message to; \"cc\" stands for \"carbon copy.\"',24,1,'9EFEAB0B5AD2C90A0B9270AB799E8AC1'),(137,'server',6,0,'The address of the SMTP server to use for sending messages. If no server is specified, the \n		server name specified in the ColdFusion Administrator is used.',24,1,'5C540BBCADA22742A719A8469D15C61C'),(138,'from',6,1,'The sender of the e-mail message.',24,1,'67FD20E4F9B56142B27EAC716D2374A8'),(139,'startrow',5,0,'Specifies the row in the query to start from.',24,1,'4A389D6DFBE24F84E992C54222C8763B'),(140,'replyto',6,0,'Address(es) to w