ource by specifying dbType = \"dynamic\", the connection string must \n	specify all required ODBC connection attributes.',50,1,'835D0B8B7509B6941A0DA71EE91A13CB'),(305,'dbtype',6,0,'The database driver type',50,1,'D2258062A2B6D34F3E8FC6476C0EB459'),(306,'blockfactor',6,0,'Specifies the maximum number of rows to fetch at a time from the server. The range is 1, \n		default to 100. This parameter applies to ORACLE native database drivers and to ODBC drivers. \n		Certain ODBC drivers may dynamically reduce the block factor at runtime.',51,1,'2A580FBE71D0D7B61C8F8FDEF58EA346'),(307,'dbserver',6,0,'For native database drivers and the SQLOLEDB provider, specifies the name of the database server \n		computer. If specified, dbServer overrides the server specified in the data source.',51,1,'CE46FD12E2CB9D2FAEF8067BC27DED72'),(308,'providerdsn',6,0,'Data source name for the COM provider, OLE-DB only.',51,1,'6A6928AFF3C32F1C25B70CDDEA4AFC3D'),(309,'datasource',6,0,'The name of the data source from which this query should retrieve data.',51,1,'72A3700722BC63E65006997B9CC2EEE5'),(310,'cachedwithin',19,0,'',51,1,'B19B1E1CA33D34413A819A6948683DC9'),(311,'timeout',5,0,'The maximum number of milliseconds for the query to execute before returning an error \n		indicating that the query has timed-out. This attribute is not supported by most ODBC drivers. \n		timeout is supported by the SQL Server 6.x or above driver. The minimum and maximum allowable values \n		vary, depending on the driver.',51,1,'D6BA69C3AA72D70E95698C5E25EFA6B0'),(312,'debug',4,0,'Used for debugging queries. Specifying this attribute causes the SQL statement submitted to the \n		data source and the number of records returned from the query to be returned.',51,1,'05E8195BFEC9C76E3F74A33737C44353'),(313,'dbname',6,0,'The database name, Sybase System 11 driver and SQLOLEDB provider only. If specified, dbName \n		overrides the default database specified in the data source.',51,1,'C50A19FAAE480ADD04710B8BA2475F41'),(314,'