 which should return True if validation succeeds and \n		False otherwise.',63,1,'9AA0D59FD4740515453B7EA81BE20076'),(405,'gridlines',4,0,'Yes or No. Yes enables row and column rules (lines) in the grid control. No suppresses rules. \n		Default is Yes.',63,1,'81FB0F6996C50B9E5E61C69D615F8C31'),(406,'colheaderfontsize',5,0,'Size for column header text in the grid control, in points.',63,1,'37DEA84A2D5D959C18467C65BE32258D'),(407,'maxrows',6,0,'Specifies the maximum number of rows to display in the grid.',63,1,'7E470A7F376FB14A1AF2DE069FDFCC23'),(408,'italic',4,0,'Yes displays grid control text in italic. Default is No.',63,1,'A2E0501E4E808CAB85425B3352A2C3D4'),(409,'href',6,0,'URL to associate with the grid item or a query column for a grid that is populated from a query.\n		If href is a query column, the href value is populated by the query. If href is not recognized as a \n		query column, it is assumed that the href text is an actual HTML href.',63,1,'91C0D4656344E95967E02EDA5B68D22E'),(410,'fontsize',5,0,'Font size for text in the grid control, in points.',63,1,'35D975999E56209CFF7E315F725254A8'),(411,'picturebar',4,0,'Yes or No. If Yes, images are used for the Insert, delete, and Sort buttons rather than text. \n		Default is No.',63,1,'3963B96FEA2C1CC0898BC67DC09138ED'),(412,'rowheaderalign',6,0,'Enter Left, Right, or Center to position data within a row header. Default is Left.',63,1,'DF21ED0823651D9FCE64DCEE6266E9E3'),(413,'hspace',5,0,'Horizontal margin spacing to the left and right of the grid control, in pixels.',63,1,'7B1B2CBFB28D73879E731C66E6F9ACC2'),(414,'rowheight',5,0,'Number of pixels for the minimum row height of the grid control. Used with cfgridcolumn \n		type = \"Image\", you can use rowHeight to define enough space for graphics to display in the row.',63,1,'E1625F08572E2D75477B243A570C3BFD'),(415,'colheadertextcolor',6,0,'Color value for the grid control column headers. Valid entries are: black (default), magenta, \n		cyan, orange, darkgray, pink, gray, white, lightgray, yellow.A hex value can be entered in the form: \n		colHeaderTextColor = \"##xxxxxx\" \n		where x is 0-9 or A-F. Use either two pound signs or no pound signs.',63,1,'151AE70BEB7C890EAC9E04E5FB87FB33'),(416,'rowheaderitalic',4,0,'Yes or No. Yes displays row label text in italic. Default is No.',63,1,'733FD9EEE71361F78540E8B9EDC7B0EC'),(417,'griddataalign',6,0,'Enter Left, Right, or Center to position data in the grid within a column. Default is Left.',63,1,'D095FF2D85774C88FC535668F5C94D13'),(418,'colheaderfont',6,0,'Font for the column header in the grid control.',63,1,'FB052CB66CEBBF1A7BA2F7272FF652B4'),(419,'delete',4,0,'Yes lets end users delete row data from the grid. Default is No.',63,1,'D4B8ED9A14F2B679599A2E1B80E247FD'),(420,'colheaderalign',6,0,'Enter Left, Right, or Center to position data within a column header. Default is Left.',63,1,'E796DAB6A657F16AF6B99B8AB1319F22'),(421,'rowheaderwidth',5,0,'The width, in pixels, of the row header column.',63,1,'282F7E620AA99E92CA6E2C6BCC1BC400'),(422,'colheaderitalic',4,0,'Yes or No. Yes displays column header text in italic. Default is No.',63,1,'2D9C6C6090886BC579586EC7BDC9EDA6'),(423,'rowheadertextcolor',6,0,'Text color value for the grid control row headers. Entries are: black (default), magenta, cyan, \n		orange, darkgray, pink, gray, white, lightgray, yellow. A hex value can be entered in the form: rowHeaderTextColor = \"##xxxxxx\" \n		Where x is 0-9 or A-F. Use two pound signs or no pound signs.',63,1,'C68C13AA47F25E87C32870C8EF1286F1'),(424,'selectcolor',6,0,'Background color for a selected item. See bgColor for color options.',63,1,'97F7FAD61AE596EDC407E0D0BD2FF1B7'),(425,'vspace',5,0,'Vertical margin spacing above and below the grid control, in pixels.',63,1,'28DF6110207188FE4D279D24FD3FAC48'),(426,'appendkey',4,0,'When used with href, Yes passes query string value of the selected tree item in the URL to the\n		application page specified in the cfform action attribute. Default is Yes.',63,1,'9D7595A408864EDBA3D80C7CEA0FA0C7'),(427,'colheaderbold',4,0,'Yes or No. Yes displays column header text in boldface. Default is No.',63,1,'403683224FC1D202E29310AA213E979E'),(428,'align',6,0,'Alignment value. Options are: Top, Left, Bottom, Baseline, Texttop, Absbottom, Middle, \n	Absmiddle, Right.',63,1,'ECB4B7B5616290F3626CA78FCAF25162'),(429,'rowheaderfontsize',5,0,'Size for row label text in the grid control, in points.',63,1,'173C9F52A93B62D57DE849D139D8B185'),(430,'font',6,0,'Font to use for column data in the grid control.',63,1,'E89BD3291177A9052C3224D1DC99787C'),(431,'highlighthref',4,0,'Yes highlights links associated with a cfgrid with an href attribute value. No disables\n		highlight. Default is Yes.',63,1,'87B28E6D960620D3A3F798BD9CB80EA8'),(432,'bgcolor',6,0,'Background color value for the grid control. Entries are: black, magenta, cyan, \n		orange, darkgray, pink, gray, white, lightgray, yellow. A hex value can be entered in the form: bgColor = \"##xxxxxx\"\n		where x is 0-9 or A-F. Use either two pound signs or no pound signs.',63,1,'8D5E6D1EE651775627B92D9E448B696B'),(433,'sort',4,0,'If Yes, sort buttons are added to the grid control. When clicked, sort buttons perform a simple \n	text sort on the selected column. Default is No.\n	Note that columns are sortable by clicking the column head, even if no sort button is displayed.',63,1,'DFAA60749B82FA27B0511D3821D2AE9A'),(434,'query',6,0,'Name of the query associated with the grid control.',63,1,'D624EF6308E75087605DD2B557DD3132'),(435,'sortdescendingbutton',6,0,'Text to use for the Sort button. Default is \"Z - A\".',63,1,'B71E1C6F59D97E17392407D664C3D3B5'),(436,'rowheaderfont',6,0,'Font to use for the row label.',63,1,'287BF3236D7D34A2417C57097D76D951'),(437,'name',6,1,'The form variable name for the applet.',64,1,'50ED0AEF8F0C4C03C523F8C8F0A3DF73'),(438,'width',5,0,'The width of the applet, in pixels.',64,1,'D22776A4D4950B2720F074E82ED431CB'),(439,'appletsource',6,1,'The name of the registered applet.',64,1,'52323059AC16D669FD8615C2CEAA5FC5'),(440,'vspace',5,0,'Space above and below applet, in pixels.',64,1,'9C9A766A5A2552AAA1171782EC4DDA32'),(441,'notsupported',6,0,'The text to display if a page containing a Java applet-based cfform control is opened by a browser that does not support Java or has Java support disabled.',64,1,'69861C554F3467BDB0D88C8DEC0CE608'),(442,'paramn',6,0,'The name of a registered parameter for the applet. Specify a parameter only to override parameter values already defined for the applet in the ColdFusion Administrator.',64,1,'32321F9DA329F992EFCF284A43A34C9B'),(443,'align',6,0,'Alignment',64,1,'72F8A34E7409DA5CFCC0DE0A22A2E8FB'),(444,'height',5,0,'The height of the applet, in pixels.',64,1,'A296E2316A0011331EE9C798AE0CFA5F'),(445,'hspace',5,0,'Space on each side of the applet, in pixels.',64,1,'B219B6DFBD91C09398FBB9E1287FDF55'),(446,'variable',6,0,'Name of variable to write time to it',65,1,'CD599C8029711CF06D919DC9AC848493'),(447,'label',6,0,'Label of the stopwatch',65,1,'430DF2A39915F45F9EC74E0907F22D90'),(448,'statustext',6,0,'Text that explains the status code. This attribute is used in conjunction with the \n	statusCode attribute.',66,1,'73744D07C37F00824F3F9F3C86DEC7D8'),(449,'name',6,0,'A name for the header.',66,1,'73600DA7CD6FA52D1619C4A80128A882'),(450,'value',6,0,'A value for the HTTP header. This attribute is used in conjunction with the name attribute.',66,1,'2FDD3D8942B64C48BD8B3D5D706B6948'),(451,'statuscode',5,0,'A number that sets the HTTP status code.',66,1,'4AB819E1D6C3736B384FEF921EF73B49'),(452,'type',6,0,'Type of catch, default:Any',67,1,'CBE33B16216D32F264049ECBAAB9E9D6'),(453,'datacollection',6,0,'The name of the structure in which the base tag stores subtag data.',68,1,'F40C1C6CA8D12C0EC4ADCFBC73F62F09'),(454,'basetag',6,1,'The name of the base tag.',68,1,'713A3C61366D58704DC3B591D66C5FDE'),(455,'errorcode',6,0,'A custom error code that you supply.',69,1,'3A7C861BE7305B268E0D2840137A47DD'),(456,'object',16,0,'a native java exception Object, if this attribute is defined all other will be ignored',69,1,'DE2EB2B0DA3442EFA1E4ED7855C46A06'),(457,'detail',6,0,'A detailed description of the event. The ColdFusion server appends the position of the error to \n		this description; the server uses this parameter if an error is not caught by your code.',69,1,'6D24592070FD67FD6273DDBF4D608AAF'),(458,'type',6,0,'A custom type or the predefined type Application. Do not enter any other predefined types because \n		they are not generated by ColdFusion applications. If you specify the exception type Application, you \n		need not specify a type for cfcatch, because the Application type is the default cfcatch type',69,1,'F7CF122C5AA8B781B33A5835E19F4E71'),(459,'message',6,0,'A message that describes the exceptional event.',69,1,'24C16C38631D559266ECC220A1D7FACA'),(460,'contition',4,0,'Expression Contition',70,1,'AE26B430FEEC2AF36B7C630C07704CB6'),(461,'label',6,0,'string; header for the dump output.',71,1,'E07E8D73BD163BFB462D35F81376ACD9'),(462,'eval',16,0,'Name of Variable to display.',71,1,'7C429B07E0C9D1A7C8CE625BB30CA433'),(463,'var',16,0,'Variable to display. Enclose a variable name in pound signs',71,1,'652BEC3651A036D4CF2EECE8ACABEE1B'),(464,'expand',6,0,'not supported at the moment',71,1,'4F55FC61C2454CB36172DC110145C462'),(465,'password',6,0,'When required by a server, a valid password.',72,1,'BAA2FADE7F1AD756C6A192041F640326'),(466,'proxyuser',6,0,'When required by a proxy server, a valid username.',72,1,'7E1182C1254BE8E0730B2F776AB5FB28'),(467,'columns',6,0,'Specifies the column names for a query when creating a query as a result of a cfhttp GET. \n	By default, the first row of a text file is interpreted as column headings. If there are column \n	headers in the text file from which the query is drawn, do not specify this attribute except to overwrite them. \n	When duplicate column heading names are encountered, ColdFusion appends an underscore character to \n	the duplicate column name to make it unique. If there are no column headers in the text file, or to \n	override those in the file, you must specify the columns attribute. However ColdFusion never treats \n	the first row of the file as data, even if you specify the columns attribute.',72,1,'D5DDEB7251284E0D82A966320EB28A5E'),(468,'textqualifier',6,0,'Required for creating a query. Indicates the start and finish of a column. Should be \n	appropriately escaped when embedded in a column. For example, if the qualifier is a double quotation \n	mark, it should be escaped as \"\"\"\". If there is no text qualifier in the file, specify it as \" \". \n	Default is the double quotation mark (\").',72,1,'B45708625366D4A1C30F7D08D0D08484'),(469,'method',6,1,'GET or POST. Use GET to download a text or binary file or to create a query from the contents \n	of a text file. Use POST to send information to a server page or a CGI program for processing. POST \n	requires the use of a cfhttpparam tag.',72,1,'60CEBC4B731AC0BE67E9B545E9EC958F'),(470,'charset',6,0,'set the charset for the call.',72,1,'F4451A2BA14D9C8DD1AE4CDCD9DE074F'),(471,'username',6,0,'When required by a server, a valid username.',72,1,'4432197B395FE7524918FEDA062F0371'),(472,'url',6,1,'Full URL of the host name or IP address of the server on which the file resides. The URL must be\n	an absolute URL, including the protocol (http or https) and hostname. It may optionally contain a port\n	number. Port numbers specified in the url attribute override the port attribute.',72,1,'B98215D0AEC1B9A66716FF3E1CB4FFCD'),(473,'throwonerror',4,0,'Boolean indicating whether to throw an exception that can be caught by using the cftry and \n	cfcatch tags. The default is NO.',72,1,'C0A29D1B13225233AB142C2925FBAE32'),(474,'timeout',5,0,'A value, in seconds. When a URL timeout is specified in the browser, the timeout attribute setting \n		takes precedence over the ColdFusion Administrator timeout. The ColdFusion server then uses the lesser \n		of the URL timeout and the timeout passed in the timeout attribute, so that the request always times \n		out before or at the same time as the page times out. If there is no URL timeout specified, ColdFusion \n		takes the lesser of the ColdFusion Administrator timeout and the timeout passed in the timeout attribute.\n		If there is no timeout set on the URL in the browser, no timeout set in the ColdFusion Administrator, \n		and no timeout set with the timeout attribute, ColdFusion waits indefinitely for the cfhttp request to \n		process.',72,1,'3AA9204BB8C313C1E5620A84E9916FF4'),(475,'port',5,0,'The port number on the server from which the object is requested. Default is 80. When used with \n	resolveURL, the URLs of retrieved documents that specify a port number are automatically resolved to \n	preserve links in the retrieved document. If a port number is specified in the url attribute, the port\n	value overrides the value of the port attribute.',72,1,'3610A5629E09ACC7BF8287516EADC181'),(476,'result',6,0,'return variable name, default \"cfhhtp\"',72,1,'14026089B6745AAAB4F080322B6F75CA'),(477,'proxyport',5,0,'The port number on the proxy server from which the object is requested. Default is 80. When \n	used with resolveURL, the URLs of retrieved documents that specify a port number are automatically \n	resolved to preserve links in the retrieved document.',72,1,'73448F54394AF032A1387E7602AC7A24'),(478,'redirect',4,0,'Boolean indicating whether to redirect execution or stop execution. The default is Yes. If set \n	to No and throwOnError = \"yes\", execution stops if cfhttp fails, and the status code and associated \n	error message are returned in the variable cfhttp.statuscode. To see where execution would have been \n	redirected, use the variable cfhttp.responseHeader[LOCATION]. The key LOCATION identifies the path of \n	redirection. ColdFusion will follow up to five redirections on a request. if this limit is exceeded, \n	ColdFusion behaves as if redirect = \"no\".',72,1,'98BFB7E03320C906CCE05116DBEB1AD5'),(479,'proxypassword',6,0,'When required by a proxy server, a valid password.',72,1,'B0BAABB3857A0E1011ED52EA925BCB98'),(480,'path',6,0,'The path to the directory in which a file is to be stored. If a path is not specified in a POST \n	or GET operation, a variable is created (cfhttp.fileContent) that you can use to display the results \n	of the POST operation in a cfoutput.',72,1,'97F961FF757C218F617C5F2B7A1AD921'),(481,'firstrowasheaders',4,0,'sets if first row of csv is file',72,1,'897F74552DFD2AB4660D454E4C8B4A86'),(482,'useragent',6,0,'User agent request header.',72,1,'206D2D2DA75961E3F2B707A97A246A44'),(483,'resolveurl',4,0,'Yes or No. Default is No. For GET and POST operations, if Yes, page reference returned into the \n	fileContent internal variable has its internal URLs fully resolved, including port number, so that \n	links remain intact.',72,1,'60DD7DF215B07D8723C4E24796F9D677'),(484,'file',6,0,'The filename to be used for the file that is accessed. For GET operations, defaults to the name \n	pecified in url. Enter path information in the path attribute.',72,1,'B2EA10C7E7A778A8FD6E3275D9D30505'),(485,'delimiter',6,0,'Required for creating a query. Options are a tab or comma. Default is a comma.',72,1,'3AB53BCB3FABC469C5EF007E87A67E3D'),(486,'name',6,0,'The name to assign to a query if the a query is constructed from a file.',72,1,'ACF3F5636EB0A884EE4125F06163AA45'),(487,'href',6,0,'URL to associate with the tree item or a query column for a tree that is populated from a query. \n	If href is a query column, the href value is the value populated by the query. If href is not \n	recognized as a query column, it is assumed that the href text is an actual HTML href.',73,1,'FE384B82F0B66344ADA8A9E9F60D0A7A'),(488,'img',6,0,'Image name or filename for the tree item. When populating a cftree with data from a cfquery, \n	images or filenames for each level of the tree are specified in a comma-separated list.',73,1,'E451862B845832C39E