.',19,104,'D92DB740CBE1784D64A60EC599EF8DE3'),(1138,'value',6,0,'Initial value that displays in the text control.',19,104,'88DA903085376DD552160891D3482B56'),(1139,'align',6,0,'Alignment value.',19,104,'A336B781600A4E3A5A1E48D8D7BE5E3B'),(1140,'notsupported',6,0,'The text to display if the page containing a Java applet-based \n	cfform control is opened by a browser that does not support Java or has Java support disabled.',19,104,'8A6FC9BF65BED27E6F9CBF7A125BD313'),(1141,'maxlength',5,0,'The maximum length of text entered.',19,104,'9A95D8BFDA91E65A029C319854D50364'),(1142,'fontsize',5,0,'Font size for text.',19,104,'940C72DC8E8F352C7C3C88D7692E7267'),(1143,'textcolor',6,0,'Text color for the control. See bgColor for color options.',19,104,'A168EDC7C1893FEBD4C8B1DDB6810DD3'),(1144,'name',6,1,'A name for the cftextinput control.',19,104,'60C67ED691CB57C5E9ABA4B435AA9352'),(1145,'taglib',6,0,'Path to a custom tag libraray or a jsp tld',20,104,'FB7CFB88DDE62FFCC1895164711E293D'),(1146,'prefix',6,0,'Prefix by which to access the imported custom CFML tags JSP tags. \n\nIf you import a CFML custom tag directory and specify an empty value, \"\", for this attribute, you can call the custom tags without using a prefix. You must specify and use a prefix for a JSP tag library.',20,104,'F179C469149E77676AA19273EF31D92F'),(1147,'groupcasesensitive',4,0,'Boolean indicating whether to group by case. The default value is YES; case is considered while \n		grouping. If the query attribute specifies a query object that was generated by a case-insensitive \n		SQL query, set the groupCaseSensitive attribute to NO to keep the recordset intact.',21,104,'159928C7369A20F22F640BA17DEE683E'),(1148,'maxrows',5,0,'Specifies the maximum number of rows to display in the output section.',21,104,'C26424E9A61A6F3B919CCBA0CEAD221A'),(1149,'startrow',5,0,'Specifies the row from which to start output.',21,104,'B4769D87E863E7FBB901E44559854BDA'),(1150,'query',6,0,'The name of the cfquery from which to draw data for the output section.',21,104,'A323DC333EECC1455D791AE0EF712945'),(1151,'group',6,0,'Specifies the query column to use when you group sets of records together. Use this attribute \n		if you have retrieved a record set ordered on a certain query column. For example, if a record set is \n		ordered according to \"CustomerID\" in the cfquery tag, you can group the output on \"CustomerID.\" The \n		group attribute, which is case sensitive, eliminates adjacent duplicates when the data is sorted by \n		the specified field. See the groupCaseSensitive attribute for information about specifying a case i\n		nsensitive grouping.',21,104,'E434315B6D2A91E22071B487B0A4B254'),(1152,'outputfile',6,0,'The file to which to direct the output of the program. If not specified, the output is \n		displayed on the page from which it was called.',23,104,'6568895DF351F9F951732619DA5C0D8A'),(1153,'terminateontimeout',4,0,'terminate execution of proccess when timeout occur',23,104,'C3A59354E2FC592AFEC843F3803D1E60'),(1154,'name',6,0,'The full pathname of the application to execute.\n		Note: On Windows, you must specify the extension as part of the application\'s name. For example, \n		myapp.exe,',23,104,'541C32DE5B32C02DE85A8D3B258B2C14'),(1155,'variable',6,0,'Variable in which to put program output. \n				If no outputfile or variable attribute is specified, \n				output is displayed on page from which it was called.',23,104,'AC8992BD9EE60AA03EFFD058BECC8697'),(1156,'arguments',1,0,'Command-line arguments passed to the application.',23,104,'FAFE33D38AD6B1D796A21F0A300B51C1'),(1157,'timeout',5,0,'Indicates how long, in seconds, the executing thread waits for the spawned process. \n		A timeout of 0 is equivalent to the non-blocking mode of executing. A very high timeout value is \n		equivalent to a blocking mode of execution. The default is 0; therefore, the thread spawns \n		a process and returns without waiting for the process to terminate.If no output file is specified, \n		and the timeout value is 0, the program output is discarded.',23,104,'65C931732BC40D879AB2D3A53678B353'),(1158,'wraptext',5,0,'Specifies the maximum line length, in characters of the mail text. If a line has more than the specified number of characters, replaces the last white space character, such as a tab or space, preceding the specified position with a line break. If there are no white space characters, inserts a line break at the specified position. A common value for this attribute is 72.',24,104,'2B1C606A1D1EC3037883158605926CCC'),(1159,'password',6,0,'A password to send to SMTP servers that require authentication. Requires a username attribute.',24,104,'662F22E76B7123853E1620620A7F9BA7'),(1160,'proxyuser',6,0,'When required by a proxy server, a valid username.',24,104,'AD715C876DE7693FA7CC095D927C471F'),(1161,'to',16,1,'The name of the e-mail message recipient.',24,104,'104AA185C60D6087C554FA89A7B5D781'),(1162,'type',6,0,'Specifies extended type attributes for the message.',24,104,'0DF23A0225C9E7FBE490B0C42C87750B'),(1163,'charset',6,0,'Character encoding of the mail message',24,104,'11CEED999CB0720EAD106349C9DCFE04'),(1164,'username',6,0,'A user name to send to SMTP servers that require authentication. Requires a password attribute.',24,104,'52573F78C29DA06248E745528409C084'),(1165,'query',6,0,'The name of the cfquery from which to draw data for message(s) to send. Specify this \n		attribute to send more than one mail message, or to send the results of a query within a message.',24,104,'EB8BBF734C3F0A37F58645A13479E140'),(1166,'subject',6,1,'The subject of the mail message. This field may be driven dynamically on \n		a message-by-message basis',24,104,'CA970DC1EB31070E64D33C7BC7F02244'),(1167,'group',6,0,'Specifies the query column to use when you group sets of records together to send as an e-mail \n		message. For example, if you send a set of billing statements to customers, you might group on \n		\"Customer_ID.\" The group attribute, which is case sensitive, elimi