height',5,0,'Height value of the grid control, in pixels.',63,104,'FF838DCF76695FD4A07361BA63225550'),(1516,'autowidth',4,0,'Optional. Yes or No. Default is No.\n	If Yes, automatically sets the width of each column so that all the columns are visible within the \n	grid\'s specified width. All columns are initially set to equal widths. Users can resize any column. \n	No horizontal scroll bars are available since all columns are visible.',63,104,'992413D33D30F3312C573C641DF1D27E'),(1517,'rowheaders',4,0,'Yes or No. Yes displays a column of numeric row labels in the grid control. \n		Defaults to Yes.',63,104,'1AC00951DFBA71454473778138ACEAD1'),(1518,'colheaders',4,0,'Yes or No. Yes displays column headers in the grid control. Default is Yes.',63,104,'BFD849F04D4A0771EB18F64BDFC39336'),(1519,'bold',4,0,'Yes displays grid control text in boldface. Default is No.',63,104,'2D019B5D20E24B3DF0F106E1FE312C82'),(1520,'insertbutton',6,0,'Text to use for the Insert action button. The default is Insert.',63,104,'BFB99C0A735C11C2C785F293B12E6AAB'),(1521,'sortascendingbutton',6,0,'Text to use for the Sort button. Default is \"A - Z\".',63,104,'47AD262E6575B688DBCDE3C18605BE55'),(1522,'deletebutton',6,0,'Text to use for the delete action button. The default is delete.',63,104,'A053E8B5CC6EC948C9DAD186AD2F32D3'),(1523,'rowheaderbold',4,0,'Yes or No. Yes displays row label text in boldface. Default is No.',63,104,'852F42668AC6E931D893C02291913609'),(1524,'insert',4,0,'Yes lets end users insert row data into the grid. Default is No.',63,104,'C7AA26B02E234A8158AC5B4AF681D845'),(1525,'name',6,1,'A name for the grid element.',63,104,'7BA6FD906158F6ACD5383E3658327D3C'),(1526,'onvalidate',6,0,'The name of a JavaScript function used to validate user input. The form object, input object, \n		and input object value are passed to the routine, which should return True if validation succeeds and \n		False otherwise.',63,104,'63BB0DA388F327DF7438FDD30C323310'),(1527,'gridlines',4,0,'Yes or No. Yes