ogical path is the key and the absolute path is the value.',2,106,'70FA91D0646D952C65CF06B01574E16C'),(1846,'securejson',4,0,'A Boolean value that specifies whether to add a security prefix in front of the value that a function returns in JSON-format \n			in response to a remote call.',2,106,'373799CAACD00A1BB4DB67EABD27F657'),(1847,'customtagpaths',1,0,'Contains custom tag paths.',2,106,'C3DFCCD2718F6DBAC3077A88BE25EBEC'),(1848,'tags',6,0,'A comma-delimited list of tags or tag-attribute combinations for which to import the supporting JavaScript files on this page.',173,106,'03EA16A389464CF87C8845B6CFB56BE7'),(1849,'csssrc',6,0,'Specifies the URL, relative to the web root, of the directory that contains the CSS files used by AJAX features',173,106,'69E7A67D90CC67FDF9A2F9AF6FC733BF'),(1850,'scriptsrc',6,0,'Specifies the URL, relative to the web root, of the directory that contains the JavaScript files used used by Railo.',173,106,'B8EEA6C84B33BB66D42749BC0E37D8F3'),(1851,'name',6,0,'The name of the thread to which the action applies:\n            terminate The name of the thread to stop.\n            join The name of the thread or threads to join to the current thread.\n            To specify multiple threads, use a comma-delimited list.\n            run The name to use to identify the thread being created.',191,106,'004FC9CA603EEE21950F046AAABC13E0'),(1852,'priority',6,0,'The priority level at which to run the thread.\n            The following values are valid:\n            HIGH, LOW, NORMAL\n            Higher priority threads get more processing time than lower priority\n            threads. Page-level code, the code that is outside of cfthread tags,\n            always has NORMAL priority. (optional, default=NORMAL)',191,106,'F65FB73D3C5FD7CB306A393898AABAA5'),(1853,'type',6,0,'type of the thread\n			- deamon (default): executes as deamon of the current thread\n			- task: executed by the task manager',191,106,'3401AA5253B29D6C6F10AAE53281E2E4'),(1854,'action',6,0,'The action to take, one of the following values:\n            join Makes the current thread wait until the thread or threads\n            specified in the name attribute complete processing, or until the\n            period specified in the timeout attribute passes, before continuing\n            processing. If you dont specify a timeout and thread you are joining\n            to doesnt finish, the current thread also cannot finish processing.\n            run Creates a thread and starts it processing.\n            sleep Suspends the current threads processing for the time specified\n            by the duration attribute. This action is useful if one thread must wait\n            for another thread to do processing without joining the threads.\n            terminate Stops processing of the thread specified in the name attribute.\n            If you terminate a thread, the thread scope includes an ERROR metadata\n            structure with information about the termination. (optional, default=run)',191,106,'1C87DA803FE28905DBF2011781979387'),(1855,'timeout',5,0,'The number of milliseconds that the current thread waits for\n            the thread or threads being joined to finish. If any thread does not\n            finish by the specified time, the current thread proceeds.\n            If the attribute value is 0, the default, the current thread continues\n            waiting until all joining threads finish. If the current thread is the\n            page thread, the page continues waiting until the threads are joined,\n            even if you specify a page timeout. (optional, default=0)',191,106,'AEB47A0811544747689FA6DE91C430CF'),(1856,'duration',5,0,'(sleep) The number of milliseconds for which to suspend thread processing. (required)',191,106,'80E9B6AA2174DA2FB5055C3964D29B60'),(1857,'retryinterval',1,0,'when type task, this attribute define a execution plan for additional tries of execution.\n			you can define a single rule or multiple rules as array\n			\n			Example single rule:\n			#{interval:createTimeSpan(0,0,0,5),tries:5}#\n			\n			in this case Railo replay the thread for maximal 5 times, when the execution fails, Railo waits for 5 seconds before doing the next try.\n			\n			Example multiple rules:\n			#[{interval:createTimeSpan(0,0,0,5),tries:5},{interval:createTimeSpan(0,0,0,10),tries:5}]#\n			\n			in this case Railo replay the thread for maximal 10 times, when the execution fails, 5 times every 5 seconds, then 5 times every 10 seconds.',191,106,'95F6F4764F61FAF81B60766829C07619'),(1858,'action',6,0,'<ul>\n            <li>begin: the start of the block of code to execute</li>\n            <li>commit: commits a pending transaction</li>\n            <li>rollback: rolls back a pending transaction</li>\n            </ul>',6,106,'D726FE2FC7071D2F30695447F93736DA'),(1859,'type',6,0,'-  file: includes only filenames.\n    - dir: includes only directory names.\n    - all: includes both filenames and directory names.',7,106,'FB8F1EB75C016775C0074A8C4AABD2A5'),(1860,'listinfo',6,0,'-  all: includes all information in the result set.\n    		- name: includes only filenames in the result set.',7,106,'F23F213F0B2FB5970E36A22134564085'),(1861,'file',6,0,'Message file. Specify only the main part of the filename.\n            For example, to log to the Testing.log file, specify\n            \"Testing\".\n\n            The file must be located in the default log directory. You\n            cannot specify a directory path. If the file does not\n            exist, it is created automatically, with the suffix .log.',9,106,'E433B026779F2CD37F19C9B8F57145FF'),(1862,'omit',4,0,'Enables you to omit a parameter when invoking a web service',11,106,'567E9C53935C25DDF537F9BBED6A4520'),(1863,'proxyuser',6,0,'User name to provide to the proxy server.',13,106,'DEAB42CDA56465B7932608E4F3E68010'),(1864,'readonly',4,0,'if set to true the scheduled task can not be modified or deleted in the Railo Administrator.',13,106,'C5DB9BD013E62F4180559A55398F4DD4'),(1865,'proxypassword',6,0,'Password to provide to the proxy server.',13,106,'C07A4B5D7F4B20C43DB711F5BEA150C8'),(1866,'action',6,1,'delete: deletes the specified task\n            update: updates an existing task or creates a new task,\n                if one with the name specified by the task attribute\n                does not exist\n            run: executes the specified task',13,106,'1A5D08A11ECED1899FE74D9554EB252B'),(1867,'hidden',4,0,'if set to true the scheduled task is not displayed in the Railo Administrator.',13,106,'B0D8D880085B8C0D5344EDB3F9BFF086'),(1868,'paused',4,0,'if set to true the scheduled task is paused.',13,106,'6EE76CA31A18F03B70390CA8DDF347B3'),(1869,'width',6,0,'The width of the form. Use a number to specify\n            pixels, In Flash, you can use a percentage value to\n            specify a percentage of the available width.',14,106,'7E4A214106D09D18496863D8A9B3F5A6'),(1870,'height',6,0,'The height of the form. Use a number to specify\n            pixels, In Flash, you can use a percentage value to\n            specify a percentage of the available width. The\n            displayed height might be less than the specified size.',14,106,'83411097C750CA423D5DD67E077D9E98'),(1871,'lang',6,0,'passed through to form tag created, only used for type html.',14,106,'921EC6D95B1AC50280D12F24A13795EE'),(1872,'preloader',4,0,'Specifies whether to display a progress bar when\n            loading the Flash form. Default is: true.',14,106,'8E43F799800D07237F83F6758048A237'),(1873,'skin',6,0,'',14,106,'9F36508E3E37D1FE7328C743496A12AE'),(1874,'preservedata',4,0,'Optional. \"Yes\" or \"No.\" Specifies whether to display the data that was entered into cfform \n		controls in the action page. \"Yes\" resets the value of the control to the value submitted when the \n		form is submitted to itself. This works as expected for the cftextinput and cfslider controls.\n		This attribute can be used only if the form and action are on a single page, or if the action page has\n		a form that contains controls with the same names as the corresponding controls on the form page.',14,106,'4F870FE8F11EBA4042130BBAAFB0D569'),(1875,'wmode',6,0,'Specifies how the Flash form appears relative to\n            other displayable content that occupies the same\n            space on an HTML page.\n             - window: The Flash form is the topmost layer on the\n            page and obscures anything that would share the\n            space, such as drop-down dynamic HTML lists.\n             - transparent: The Flash form honors the z-index of\n            dhtml so you can float items above it. If the Flash\n            form is above any item, transparent regions in the\n            form show the content that is below it.\n             - opaque: The Flash form honors the z-index of\n            dhtml so you can float items above it. If the Flash\n            form is above any item, it blocks any content that is\n            below it.\n            Default is: window.',14,106,'706E87099A8DC9CCDB011F365498A61F'),(1876,'scriptsrc',6,0,'Specifies the URL, relative to the web root, of the\n            directory that contains the cfform.js file with the\n            client-side JavaScript used by this tag and its child\n            tags. For XML format forms, this directory is also the\n            default directory for XSLT skins.',14,106,'0F50D7EF88100A482C6976CE96E966AC'),(1877,'accessible',4,0,'Specifies whether to include support screen readers\n            in the Flash form. Screen reader support adds\n            approximately 80KB to the SWF file sent to the\n            client. Default is: false.',14,106,'F297B1A945AAEF57EC155400144FE003'),(1878,'id',6,0,'HTML id passed through to form tag created, only used for type html.',14,106,'27279683AF194E88A0161B724A2E5100'),(1879,'onreset',6,0,'JavaScript to execute when the user clicks a reset button.',14,106,'EC86A38E5BED2E5760FCAEBFB2B032D5'),(1880,'style',6,0,'Styles to apply to the form. In HTML or XML format,\n            Railo passes the style attribute to the browser\n            or XML. In Flash format, must be a style specification\n            in CSS format (XML and Flash type no supported).',14,106,'9F576450A77037B944857AF93B1BD499'),(1881,'timeout',5,0,'Integer number of seconds for which to keep the\n            form data in the Flash cache on the server. A value of\n            0 prevents the data from being cached.',14,106,'D1F499B846CEA51813177711AEC8D439'),(1882,'onload',6,0,'JavaScript to execute when the form loads.',14,106,'AD15A0359B097FACF4B65A66EEDC68EB'),(1883,'hint',6,0,'Text to be displayed when using introspection to show information about the interface.\n            The hint attribute value follows the syntax line in the function description.',202,106,'60EB5E9E942FA1306D5448CA8005D5C3'),(1884,'xmlconform',4,0,'if set to true generate valid xml, if set to false (default) the xml generated is comaptible to other engines, but not valid xml (use for example single quotes for attribute values)',16,106,'C2EC4C80E162D0918896AC90F19E99C0'),(1885,'validate',4,0,'Applies if action = \"wddx2cfml\" or \"wddx2js\".\n                - Yes: validates WDDX input with an XML parser using\n                    WDDX DTD. If parser processes input without error,\n                    packet is deserialized. Otherwise, an error is\n                    thrown.\n                - No: no input validation',16,106,'55DE0DC7062A1433F939871216354B4F'),(1886,'validate',4,0,'date: verifies format mm/dd/yy.\n            eurodate: verifies date format dd/mm/yyyy.\n            time: verifies time format hh:mm:ss.\n            float: verifies floating point format.\n            integer: verifies integer format.\n            telephone: verifies telephone format ###-###-####. The\n                separator can be a blank. Area code and exchange must\n                begin with digit 1 - 9.\n            zipcode: verifies, in U.S. formats only, 5- or 9-digit\n                format #####-####. The separator can be a blank.\n            creditcard: strips blanks and dashes; verifies number using\n                mod10 algorithm. Number must have 13-16 digits.\n            social_security_number: verifies format ###-##-####. The\n                separator can be a blank.\n            regular_expression: matches input against pattern\n                attribute.',19,106,'85679689CFC406ADDAF3D61DA84E1148'),(1887,'path',6,0,'path of CFC to be imported',20,106,'5599D7A829C93A1820743557A9E50C76'),(1888,'language',6,0,'language used inside cfscript (only cfml supported in this version)',22,106,'116B99F55268F8C0A23D743979CC988D'),(1889,'name',6,0,'used only for type bookmark, name of the bookmark to define.',114,106,'E557A34F366CD773BD8E704E24F2B479'),(1890,'type',6,1,'Specifies the action:\n- pagebreak (starts a new page at the location of the tag)\n- header (uses the text between in the body of the tag as the running header)\n- footer (uses the text between the the body of the tag as the running footer)\n- bookmark (set a boomark, use the attribute name to define the name of the bookmark)',114,106,'7B27F7532B43615C698F2613D6C4E183'),(1891,'bindonload',4,0,'- true (executes the bind attribute expression when first loading the tag. \r\n		- false (does not execute the bind attribute expression until the first bound event)\r\n		To use this attribute, you must also specify a bind attribute',175,106,'7CC11647CF2E123516A9A7B32515C4D8'),(1892,'tagname',6,0,'The HTML container tag to create.',175,106,'19A26B0A488546203187282A35399AE7'),(1893,'onbinderror',6,0,'The name of a JavaScript function to execute if evaluating a bind expression results in an error. The function must take two attributes: an HTTP status code and a message.',175,106,'C2E6BD2B85C8C65CF8A5FD187D0913CC'),(1894,'bind',6,0,'A bind expression that returns the container contents. Note: If a CFML page specified in this attribute contains tags that use AJAX features, such as cfform, cfgrid, and cfwindow, you must use a tag on the page with the tag. For more information, see cfajaximport.',175,106,'4FAB85946EE3F3ABDBFF0AC284167FCB'),(1895,'id',6,0,'The HTML ID attribute value to assign to the generated container tag.',175,106,'DFE7CFE1EBF1B4BAD35E824A0C08ADA5'),(1896,'spoolenable',4,0,'Specifies whether to spool mail or always send it\n            Immediately. Overrides the Railo Administrator spool mail messages to disk for delivery setting.',24,106,'A522811CE777AB1203A32002D06482C3'),(1897,'query',6,0,'The name of the cfquery from which to draw data for message(s) to send. Specify this \n		attribute to send more than one mail message, or to send the results of a query within a message.',24,106,'CAEE0B7840E0E24DC39DD9E140DDEF93'),(1898,'group',6,0,'Specifies the query column to use when you group sets of records together to send as an e-mail \n		message. For example, if you send a set of billing statements to customers, you might group on \n		\"Customer_ID.\" The group attribute, which is case sensitive, eliminates adjacent duplicates when the \n		data is sorted by the specified field. See the Usage section for exceptions.',24,106,'7B57907E5DEA8FB44B33CCF55C3EE3F7'),(1899,'groupcasesensitive',4,0,'Boolean indicating whether to group with regard to case or not. The default value is YES; \n		case is considered while grouping. If the query attribute specifies a query object that was generated \n		by a case-insensitive SQL query, set the groupCaseSensitive attribute to NO to keep the recordset \n		intact.',24,106,'950D18406D5A97860CAC873FD43A9F9F'),(1900,'ssl',4,0,'alias for usessl',24,106,'1A82EED98B52E5162252CEDE5D957CE8'),(1901,'tls',4,0,'alias for usetls',24,106,'86F36856EC2488C858CE407BD86C4C6A'),(1902,'startrow',5,0,'Specifies the row in the query to start from.',24,106,'03AB48FD36102B67607BA91FE20C003B'),(1903,'maxrows',5,0,'Specifies the maximum number of e-mail messages to send.',24,106,'B1FA9441B8E3C1840DD08AFF0AB497D2'),(1904,'usessl',4,0,'Whether to use Secure Sockets Layer.',24,106,'D357934C6BBCE2FF489388948D96DDD4'),(1905,'usetls',4,0,'Whether to use Transport Level Security.',24,106,'F9F64CC5FC7F66976EFFBF3BC2034E4C'),(1906,'starttls',4,0,'alias for useTls',24,106,'7C18E061D34B5F1175A36FBA0738B235'),(1907,'priority',6,0,'The message priority level. Can be one of the following values:\n    * An integer in the range 1-5; 1 represents the highest priority.\n    * One of the following string values, which correspond to the numeric values: highest or urgent, high, normal, low, and lowest or non-urgent.',24,106,'D9F2DEEED7D0984953AFF7EC02C3C039'),(1908,'tickmarklabels',6,0,'label used for tickmarks',26,106,'C6D1628D83B047B2B1D4C27EAA7C09B0'),(1909,'tickmarkminor',4,0,'Yes to render minor tickmarks in the slider scale.',26,106,'6A6631301332C03B4985B61BD24BCD54'),(1910,'tickmarkimages',6,0,'image used for tickmarks',26,106,'7C2BF218E364C802259F00ADC3DFDBA5'),(1911,'tickmarkmajor',4,0,'Yes to render major tickmarks in the slider scale.',26,106,'4D2F95361CD2C6BCB8DFE819E27E9614'),(1912,'method',6,0,'exittag: aborts processing of currently executing tag\n            exittemplate: exits page of currently executing tag\n            loop: reexecutes body of currently executing tag',29,106,'1423657CD5A7F940EB21A993825760A3'),(1913,'margintop',5,0,'Specifies the top margin in inches (default) or\n            centimeters. To specify the top margin in centimeters,\n            include the unit=\"cm\" attribute in the parent cfdocument\n            tag.',116,106,'036D6A33FA72270B18DA72BBDFA47E62'),(1914,'marginbottom',5,0,'Specifies the bottom margin in inches (default) or\n            centimeters. To specify the bottom margin in\n            centimeters, include the unit=\"cm\" attribute in the\n            parent cfdocument tag.',116,106,'7241FE1F436C49B92137FFBF02673C84'),(1915,'marginright',5,0,'Specifies the right margin in inches (default) or\n            centimeters. To specify the right margin in centimeters,\n            include the unit=\"cm\" attribute in the parent cfdocument\n            tag.',116,106,'B687AACD6E14C59BAFBFA449F1DA7F4E'),(1916,'marginleft',5,0,'Specifies the left margin in inches (default) or\n            centimeters. To specify the left margin in centimeters,\n            include the unit=\"cm\" attribute in the parent cfdocument\n            tag.',116,106,'78AE1F22445D926732EF619A29715B3E'),(1917,'previouscriteria',6,0,'The name of a result set from an existing set of search\n            results. Verity searches the result set for criteria\n            without regard to the previous search score or rank.\n            Use this attribute to implement searching within result\n            sets.',31,106,'CA7B663BA44276814FD1746E255DD1BE'),(1918,'category',6,0,'A list of categories, separated by commas, to which\n            the search is limited. If specified, and the collection\n            does not have categories enabled, Railo\n\n            throws an exception.',31,106,'0FCE7C6D434C30D5DB62563938DCEE6A'),(1919,'contexthighlightend',6,0,'The HTML to prepend to search terms in the context\n            summary. Use this attribute in conjunction with\n            contextHighlightEnd to highlight search terms in the\n            context summary.\n            Default: </b>',31,106,'C23573226CF3183C7716D59097E4162A'),(1920,'status',6,0,'Specifies the name of the structure variable into\n            which Railo places search information, including\n            alternative criteria suggestions (spelling corrections).',31,106,'5C65D07BCCDF433BADB848454C766E35'),(1921,'language',6,0,'Deprecated. This attribute is now ignored and the language of the collection is used to perform the search.',31,106,'5EF5E567C831E60D99228EAE88C14BF7'),(1922,'contextbytes',5,0,'The maximum number of bytes Verity returns in the\n            context summary.\n            Default: 300',31,106,'E11857806067BC6A4B34431A5F12CBBA'),(1923,'contextpassages',5,0,'The number of passages/sentences Verity returns in\n            the context summary (that is, the context column of\n            the results).\n            Default: 3',31,106,'5A1F4986CEB4DDD9861DA2B7351F8692'),(1924,'suggestions',6,0,'Specifies whether Verity/SOLR returns spelling suggestions\n            for possibly misspelled words.',31,106,'4FF0542D840D68CDF1DD3720B2FEDD5E'),(1925,'contexthighlightbegin',6,0,'The HTML to prepend to search terms in the context\n            summary. Use this attribute in conjunction with\n            contextHighlightEnd to highlight search terms in the\n            context summary.\n            Default: <b>',31,106,'9D0B7AAD22B5A7A706CEDBDD7F29745F'),(1926,'categorytree',6,0,'The location in a hierarchical category tree at which\n            to start the search. Railo searches at and\n            below this level. If specified, and the collection does\n            not have categories enabled, Railo throws an\n            exception. Can be used in addition to category\n            attribute.',31,106,'63D86895FCB33B4C6E42585CEEF68540'),(1927,'entrypath',6,0,'Pathanme used:\n             For cfzip action=\"zip\", it is the entrypath used. This is valid only\n            when the source is a file. The entrypath creates a subdirectory within\n            the ZIP or JAR file.\n             For cfzip action=\"unzip\", it is the pathname to unzip.\n             For cfzip action=\"delete\", it is the pathname to delete from the\n            ZIP or JAR file.',176,106,'A869E3B52C139A7952F20C2CE2710AF3'),(1928,'filter',6,0,'File filter applied to the action. For example, for the zip action,\n            all the files in the source directory matching the filter are zipped.',176,106,'0D97FBC72F3A4179B0A13A3D73831B3A'),(1929,'content',1,0,'Content written to the ZIP or JAR entry. Used only when cfzip action=\"zip\".\n            Valid content data types are binary and string. If you specify the content\n            attribute, you must specify the entrypath attribute.',176,106,'15FCB3CE90F0531B20F44E7E325B7C33'),(1930,'recurse',4,0,'Recurse the directory to be zipped, unzipped, or deleted,\n            as specified by the cfzip parent tag. (optional, default=yes)',176,106,'2BAC2D4993A1C6E5CE0CF03120283570'),(1931,'source',6,0,'Source directory or file. Used only when cfzip action=\"zip\".\n            Specified file(s) are added to the ZIP or JAR file:\n             If you specify source attribute for the cfzip tag, the\n            cfzipparam source is relative to it.\n             If you do not specify a source attribute for the cfzip\n            tag, the cfzipparam source must be an absolute path.',176,106,'5403B534BE664A1D84332EA136F69913'),(1932,'prefix',6,0,'String added as a prefix to the ZIP or JAR entry. Used only\n            when cfzip action=\"zip\".',176,106,'27A6CFA80823C9517B3622C7BA9BCC04'),(1933,'charset',6,0,'Converts string content into binary data before putting\n            it into a ZIP or JAR file. Used only when cfzip\n            action=\"zip\" and the cfzipparam content is a string.\n            Examples of character sets are:\n             JIS\n             RFC1345\n             UTF-16 (optional, default=encoding of the host machine)',176,106,'9CFDD36A7CD36EAF5AAEFE5C7E195B8A'),(1934,'fixnewline',4,0,'- true: changes embedded line-ending characters in string\n            variables to operating-system specific line endings\n            - false: (default) do not change embedded line-ending\n            characters in string variables.',36,106,'FE0BD9E6E406A86650CE5F4033395965'),(1935,'method',6,0,'Name of a method. For a web service, the name of an\n            operation.',38,106,'B6DF18CB6ECADD69F4AAFB66D3876AF6'),(1936,'serviceport',6,0,'The port name for the web service. This value is\n            case-sensitive and corresponds to the port element\'s\n            name attribute under the service element. Specify this\n            attribute if the web service contains multiple ports.\n            Default: first port found in the WSDL.',38,106,'A6153CD12022B5FA62B18D884B54DBC0'),(1937,'username',6,0,'Overrides username specified in Administrator > Web Services',38,106,'2CB734C704633BE0C77CA6B6C14159FF'),(1938,'returnvariable',6,0,'Name of a variable for the invocation result.',38,106,'1D16D0082FB4B73E6BAFB2DC348DDBEB'),(1939,'webservice',6,0,'The URL of the WSDL file for the web service.',38,106,'F8129276D1260305E29A63F7F9767F5B'),(1940,'proxyport',5,0,'The port to use on The proxy server.',38,106,'D524E11F2419CBB6993A209B5088BD87'),(1941,'timeout',5,0,'The timeout for the web service request, in seconds',38,106,'48635896A2CDEB055D412DFA1BBB4669'),(1942,'component',1,0,'String or component object; a reference to a component, or\n            component to instantiate.',38,106,'4A353418F6A7AFACE57E6EECBB42E59C'),(1943,'proxyuser',6,0,'The user ID to send to the proxy server.',38,106,'75B9BA748D59EF071F5776D94E9E3215'),(1944,'password',6,0,'Overrides passowrd specified in Administrator > Web Services',38,106,'DD09ABC3098059CC5F423600240D3D80'),(1945,'proxyserver',6,0,'The proxy server required to access the webservice URL.',38,106,'16867BCC37DF64538DAA31D3A0E44245'),(1946,'proxypassword',6,0,'The user\'s password on the proxy server.',38,106,'D1D8DAED55649602D074F561009E7F2A'),(1947,'bufferoutput',4,0,'if set to true (default) the output written to the body of the tag is buffered and in case of a exception also outputed.\n			if set to false the content to body is ignored and not disbled when a failure in the body of the tag occur.',39,106,'45490FF42AF8F057EEA7865A1E6DC8EF'),(1948,'rebind',4,0,'If you set rebind to Yes, cfldap attempts to rebind the referral callback and reissue the query \n		by the referred address using the original credentials. The default is No, which means referred \n		connections are anonymous.',40,106,'3880523EF62143C4D380EB8D3DE9746A'),(1949,'attributes',6,0,'Required if action = \"Query\", \"Add\", \"ModifyDN\", or \"Modify\"\n            For queries: comma-delimited list of attributes to return. For\n            queries, to get all attributes, specify \"*\".\n            \n            If action = \"add\" or \"modify\", you can specify a list of update\n            columns. Separate attributes with a semicolon.\n            \n            If action = \"ModifyDN\", CFML passes attributes to the\n            LDAP server without syntax checking.',40,106,'3DD55156F9BD75C161BDB643EBEA03D7'),(1950,'filter',6,0,'Search criteria for action = \"Query\".\n            List attributes in the form:\n            \"(attribute operator value)\" Example: \"(sn = Smith)\"',40,106,'BF144CF36542D983F8417676F2B28F11'),(1951,'directory',6,0,'Absolute path of cache directory.',41,106,'646A92D849E8141C8D7807557886F0DC'),(1952,'password',6,0,'When required for basic authentication, a valid password.',41,106,'EF77497E0F19881EA964F207E3FBB9CF'),(1953,'username',6,0,'When required for basic authentication, a valid username.',41,106,'FA0907B735B871B8081B694F77F558DD'),(1954,'cachedirectory',6,0,'Absolute path of cache directory (alias for directory).',41,106,'3762132917A56642434BFC740958D40F'),(1955,'throwonerror',4,0,'A Boolean value specifying whether t throw an error if the\nflush\naction encounters an error. Otherwise the action does not generate an error if it fails. If this attribute is\ntrue\nyou can handle the error in a\ncfcatch\nblock, for example, if a specified id value is invalid',41,106,'BEFE17747EB74D0E4E81FC9EEF714397'),(1956,'port',5,0,'Port number of the web server from which the URL for the cached page is requested. \n			In the internal call from cfcache to cfhttp, Railo resolves each URL variable in the page; this ensures that links in the page remain functional.',41,106,'27DD710E1F5C95EC89DE725831CE2DF0'),(1957,'metadata',6,0,'Name of the struct variable',41,106,'2A6301867025E58E9D9879E4B9748932'),(1958,'timespan',19,0,'The interval until the item is flushed from the cache.\nA decimal number of days, for example: \".25\", for one-fourth day (6 hours); \"1\", for one day; \"1.5\", for one and one half days\nA return value from the CreateTimeSpan function, for example, \"#CreateTimeSpan(0,6,0,0)#\".\nThe default action is to flush the item when it is idle for the time specified by the idleTime attribute, or cfcache action=\"flush\" executes.',41,106,'6A46E5A77E72D73C21787D6BBF16642D'),(1959,'id',1,0,'Id of the cached object',41,106,'77B77D45F8890CA35303F7B2507102D6'),(1960,'value',1,0,'For action=\"set\", object which needs to be stored',41,106,'C9DA1DA8ECCF08C88168061776128B5F'),(1961,'action',6,0,'- cache: server-side and client-side template caching.\n            - flush: refresh cached pages (template caching).\n            - clientcache: browser-side caching only. To cache a personalized page, use this option.\n            - servercache: server-side caching only. Not recommended.\n            - optimal: same as \"cache\".\n            - content: same as cache, but cache only the body of the tag, not the complete template (template caching).\n            - put: adds a key value pair to object cache (see function cachePut for more details)\n            - get: gets value matching given key from object cache (see function cacheGet for more details)',41,106,'E8AEC2B42FC154AE66348DCF3D966601'),(1962,'cachename',6,0,'definition of the cache used by name, when not set the \"default Object Cache\" defined in Railo Administrator is used instead.',41,106,'278C315B3767DD55E6C5D6BB27C2348D'),(1963,'expireurl',6,0,'A URL reference. Can include wildcards, for example: \"*/view.cfm?id=*\". Railo flushes, from the cache, pages that match the specified URL or pattern.',41,106,'908E7C094A7F27061E2258961E5D664D'),(1964,'idletime',19,0,'Flushes the cached item if it is not accessed for the specified time span:\nA decimal number of days, for example: \".25\", for one-fourth day (6 hours); \"1\", for one day; \"1.5\", for one and one half days\nA return value from the CreateTimeSpan function, for example, \"#CreateTimeSpan(0,6,0,0)#\".',41,106,'F90B35B479531DA2D56B38A9417681B4'),(1965,'name',6,0,'name of return variable, valid with action=\"get\"',41,106,'D1A869EF2382A0D6EE0223D1D4C967AC'),(1966,'key',6,0,'key to access cache',41,106,'55BE43D03E949A58152B02BE4DAC0153'),(1967,'cachedwithin',19,0,'Timespan, using the CreateTimeSpan function. If original\n            query date falls within the time span, cached query data is\n            used. CreateTimeSpan defines a period from the present,\n            back. Takes effect only if query caching is enabled in the\n            Administrator.\n\n            To use cached data, the current query must use the same SQL\n            statement, data source, query name, user name, and password.',43,106,'F613F77115F682862C6B01447A531698'),(1968,'securejson',4,0,'A Boolean value that specifies whether to add a security prefix in front of any value that the function returns in JSON-format in response to a remote call.',47,106,'9EBA2A19605A38CF9C10EB6CABAB876A'),(1969,'returnformat',6,0,'The format in which to return values to a remote caller.',47,106,'80F15909FEAA6E26F6AFCE93FA19606D'),(1970,'verifyclient',4,0,'A Boolean value that specifies whether to require remote function calls to include an encrypted security token. For use with AJAX applications only.',47,106,'BA02FF4C50A6FD9CC2B4D1CB8F0B605B'),(1971,'description',6,0,'Supplies a short text description of the function.',47,106,'237BEEC77E7A75D59F6285575F07B4CC'),(1972,'ormoptions',11,0,'Object parameter for the entity.',51,106,'73FF67C43DF5D0224982BF81E5AED3FB'),(1973,'result',6,0,'Specifies a name for the structure in which cfquery returns\n            the result variables.\n            - SQL: The SQL statement that was executed. (string)\n            - Cached: If the query was cached. (boolean)\n            - SqlParameters: An ordered Array of cfqueryparam values. (array)\n            - RecordCount: Total number of records in the query. (numeric)\n            - ColumnList: Column list, comma seperated. (numeric)\n            - ExecutionTime: Execution time for the SQL request. (numeric)',51,106,'19630392B9119215200C6C5A3DA1F286'),(1974,'returntype',6,0,'one of the following values:\n			- query: default for all dbtype expect \"hql\", returns a query object\n			- array_of_entity: works only with dbtype \"hql\" and is also the default value for dbtype \"hql\"',51,106,'E0A46BF909DCBFE77015F568BDCAFEEE'),(1975,'dbtype',6,0,'support the following values:\n			- query: for doing a query on a existing query object\n			- hql: for doing a query on orm',51,106,'80564CBAF83570AE6C71B5288DFA549F'),(1976,'userpassword',6,0,'Specifies a user password (format=\"PDF\" only).',128,106,'C0205B88E93F3A62AC9F5A5298E41A8B'),(1977,'ownerpassword',6,0,'Specifies an owner password (format=\"PDF\" only).',128,106,'0420AE815C249108B00E1E7EF9715440'),(1978,'backgroundvisible',4,0,'Specifies whether the background prints when the user prints the document',128,106,'5876C2C0180FB214A916AC0E1DE99DC9'),(1979,'marginleft',5,0,'Specifies the left margin in inches (default) or\n            centimeters. To specify left margin in centimeters,\n            include the unit=cm attribute.',128,106,'0ACAA2DF3D2E310838012D2D25288C5F'),(1980,'marginbottom',5,0,'Specifies the bottom margin in inches (default) or\n            centimeters. To specify bottom margin in\n            centimeters, include the unit=cm attribute.',128,106,'87ABBF7D403A3CA713B328DBA76AD796'),(1981,'margintop',5,0,'Specifies the top margin in inches (default) or\n            centimeters. To specify top margin in centimeters,\n            include the unit=cm attribute.',128,106,'89A4CBA66E26DA964769ED4D94E5637F'),(1982,'scale',5,0,'define a scale factor as a percentage. this option is used to reduce the size of the HTML output so that it fits on that paper. define a number less than 100.',128,106,'77534A0A34623F8311F4A7FCD7FB5018'),(1983,'marginright',5,0,'Specifies the right margin in inches (default) or\n            centimeters. To specify right margin in centimeters,\n            include the unit=cm attribute.',128,106,'6439CB0664BBFABC90EE25A711ADA564'),(1984,'label',6,0,'Label to display with timing information.\n            Default: \" \"',129,106,'7DBCED2197FB0E629A7A1E2399512F26'),(1985,'type',6,0,'- inline: displays timing information inline, following the\n              resulting HTML.\n            - outline: displays timing information and also displays a line\n              around the output produced by the timed code. The browser\n              must support the FIELDSET tag to display the outline.\n            - comment: displays timing information in an HTML comment\n              in the format <!-- label: elapsed-time ms -->. The default label\n              is cftimer.\n            - debug: displays timing information in the debug output\n              under the heading CFTimer Times.\n            Default: debug',129,106,'9E95D8BC52B5ED94E1FF31C495ED7772'),(1986,'var',6,0,'The name of a simple or complex variable to display.\n\n            Useful for displaying a temporary value, or a value that\n            does not display on any CFM page.',130,106,'0DF2EBB71BA5F4744B893984117EDE5D'),(1987,'variable',6,0,'The name of a simple or complex variable to display.\n\n            Useful for displaying a temporary value, or a value that\n            does not display on any CFM page (alias for attribute \"var\").',130,106,'F87863C61607DA8514EE3BE19D6D074F'),(1988,'type',6,0,'Corresponds to the cflog type attribute; displays an\n            appropriate icon.\n            - Information\n            - Warning\n            - Error\n            - Fatal',130,106,'A0B6C6E23768FEABC20D3D4F0D96C8DD'),(1989,'category',6,0,'User-defined string for identifying trace groups',130,106,'F5AAF22104AC604DE6E654C6B37933E1'),(1990,'inline',4,0,'Displays trace code in line on the page in the\n            location of the cftrace tag, addition to the debugging\n            information output.',130,106,'680D191D0ACBDAAE531C4D85CAC92EBF'),(1991,'text',6,0,'User-defined string, which can include simple variable,\n            but not complex variables such as arrays. Outputs to cflog\n            text attribute',130,106,'DE333D25404A8EE5884CDE8F5F3445E3'),(1992,'abort',4,0,'Calls cfabort tag when the tag is executed',130,106,'207BD5CAEC123C61EA7FE76394CAC946'),(1993,'domain',6,0,'Domain in which cookie is valid and to which cookie content\n            can be sent from the user\'s system. By default, the cookie\n            is only available to the server that set it. Use this\n            attribute to make the cookie available to other servers.\n\n            Must start with a period. If the value is a subdomain, the\n            valid domain is all domain names that end with this string.\n            This attribute sets the available subdomains on the site\n            upon which the cookie can be used.',54,106,'E902DCE8ECB003FAEAB20FC3D88658D4'),(1994,'path',6,0,'URL, within a domain, to which the cookie applies;\n            typically a directory. Only pages in this path can use the\n            cookie. By default, all pages on the server that set the\n            cookie can access the cookie.\n\n            path = \"/services/login\"',54,106,'02BD6DD5D29AF4DEADC639CE5DF73C6C'),(1995,'style',6,0,'Specifies whether a CFC used for web services uses RPC-encoded style or document-literal style',58,106,'C40B6342888DC052E983A0E2A284EAE6'),(1996,'output',4,0,'- true: permits component method output\n				- false: suppresses component method output',58,106,'F8A1B8E97EEAD84073C0752FE73FCA7A'),(1997,'serviceaddress',6,0,'Specifies the SOAP URL of the web service. If you donÕt specify this attribute, Railo uses the URL of the CFC in the WSDL service description. \n			Use this attribute to specify the protocol, for example, by specifying a URL that starts with https://. This attribute applies only for web services.',58,106,'C5A8BEC5DD2051810167623FADBECCD9'),(1998,'namespace',6,0,'Specifies the namespace used in the WSDL when\n            using the CFC as a document-literal style web service.\n            If you don\'t specify this attribute, Railo\n            derives the namespace from the CFC class name.\n            This attribute applies only when style=\"document\".',58,106,'B987315BD4218CAF86C33DE931E4B859'),(1999,'persistent',4,0,'Specifies CFC is persistent or not',58,106,'F6FD68DA2DD685A8F4D70D5ECE511484'),(2000,'hint',6,0,'Text that displays when you use introspection to show information about the CFC. The hint attribute value appears below the component name heading. Use this attribute to describe the purpose of the component.',58,106,'0811497DBADF69A667267485C43E5077'),(2001,'displayname',6,0,'A string to be displayed when using introspection to show\n            information about the CFC. The information appears on the\n            heading, following the component name.\n            If the style attribute is set to document, the displayname\n            attribute is used as the name of the service element in the WSDL.',58,106,'AC2DA82057B2CF73D9C10982E0905766'),(2002,'synchronized',4,0,'If set to true all calls to an instance of a component are synchronized. This setting allows a method to be executed only by one single thread at a time.',58,106,'83AE4CCC3C9E8C905A375BF99944F387'),(2003,'wsdlfile',6,0,'A properly formatted WSDL file to be used instead of\n            WSDL generated by Railo.\n            This attribute applies only when style=\"document\".',58,106,'65C05379D5B21F482591DEAFB0624DD5'),(2004,'mappedsuperclass',4,0,'',58,106,'E272E75316F5A8F0A949BD2E106D03A0'),(2005,'porttypename',6,0,'Specifies the name of the porttype element in the WSDL.\n            This attribute applies only when style=\"document\".',58,106,'1E4FEA869A699783215DB945F5681272'),(2006,'display',6,0,'A string to be displayed when using introspection to show\n            information about the CFC. The information appears on the\n            heading, following the component name.\n            If the style attribute is set to document, the displayname\n            attribute is used as the name of the service element in the WSDL (alias for displayname).',58,106,'91F6CD64BF76AA020024E8146FBEEAB5'),(2007,'serviceportname',6,0,'Specifies the name of the port element in the WSDL.\n            This attribute applies only when style=\"document\".',58,106,'205F2AB08BCA4727641F6C7E9A807493'),(2008,'bindingname',6,0,'Specifies the name of the binding element in the WSDL.\n            This attribute applies only when style=\"document\".',58,106,'9435B69AD20EE24E7EE45E0D8892819A'),(2009,'source',6,0,'Source directory to be zipped. Not required\n            if cfzipparam is specified.',177,106,'55D064053F718627A5B4D472403E9B12'),(2010,'recurse',4,0,'Specifies whether the action\n            applies to subdirectories:\n            yes: includes subdirectories.\n            no: does not include subdirectories. (optional, default=yes)',177,106,'00B008760EB0135C04EBC5D8BEC3E323'),(2011,'name',6,0,'Record set name in which the result of the list action is stored.\n            The record set columns are:\n            name: filename of the entry in the JAR file. For example, if the entry is\n            help/docs/index.htm, the name is index.htm.\n            directory: directory containing the entry. For the example above, the\n            directory is help/docs. You can obtain the full entry name by concatenating\n            directory and name. If an entry is at the root level, the directory is empty (\'\').\n            size: uncompressed size of the entry, in bytes.\n            compressedSize: compressed size of the entry, in bytes.\n            type: type of entry (directory or file).\n            dateLastModified: last modified date of the entry, cfdate object.\n            comment: any comment, if present, for the entry.\n            crc: crc-32 checksum of the uncompressed entry data.',177,106,'183732ADDC36D0E70D14A8D901D00021'),(2012,'filter',6,0,'File filter applied to the action. The action\n            applies to all files in the pathname specified that match the filter.',177,106,'FBC3824A5E365AB94AF690182DB14A14'),(2013,'file',6,0,'Absolute pathname of the file on which the action is performed.\n            For example, the full pathname of the ZIP file: c:\\temp\\log.zip.',177,106,'0C5FD5DC9496AC5C96F19616B3C96892'),(2014,'entrypath',6,0,'Pathname on which the action is performed.',177,106,'1259C931E15553A2D2DB88AC3FF0E0AC'),(2015,'storepath',4,0,'zip: Specifies whether pathnames are stored in the ZIP or JAR file:\n            yes: pathnames of entries are stored in the ZIP or JAR file.\n            no: pathnames of the entries are not stored in the ZIP or JAR file.\n            All the files are placed at the root level. In case of a name conflict,\n            the last file in the iteration is added.\n            unzip: Specifies whether files are stored at the entrypath:\n            yes: the files are extracted to the entrypath.\n            no: the entrypath is ignored and all the files are extracted\n            at the root level. (optional, default= yes)',177,106,'DD24A1698FD62F247D05A3C6A52CC4A8'),(2016,'charset',6,0,'The character set used to translate the ZIP or JAR\n            entry into a text string. Examples of character sets are:\n            JIS\n            RFC1345\n            UTF-16 (optional, default=encoding of the host machine)',177,106,'422FCEE3EFDB33AF864A6DCE4247E24D'),(2017,'action',6,0,'The action to take. Must be one of the following:\n            delete\n            list\n            read\n            readBinary\n            unzip\n            zip\n            If you do not specify an action, Railo\n            applies the default action, zip.',177,106,'53BBA02436A402698351BF47E413735D'),(2018,'variable',6,0,'Variable in which the read content is stored.',177,106,'CC8C94475EF46DE4D8FAB3600C10C569'),(2019,'showdirectory',4,0,'yes: lists the directories.\n            no: does not list directories. (optional, default= no)',177,106,'3C4ACCC4C24D52DE172D99F24A781570'),(2020,'prefix',6,0,'String added as a prefix to the ZIP or JAR entry.\n            The string is the name of a subdirectory in which the\n            entries are added.',177,106,'FC8740E1BA88EFB81EDB23240729367B'),(2021,'overwrite',4,0,'unzip: Specifies whether to overwrite the extracted files:\n            yes: if the extracted file already exists at the destination specified,\n            the file is overwritten.\n            no: if the extracted file already exists at the destination specified,\n            the file is not overwritten and that entry is not extracted. The remaining\n            entries are extracted.\n            zip: Specifies whether to overwrite the contents of a ZIP or JAR file:\n            yes: overwrites all of the content in the ZIP or JAR file if it exists.\n            no: updates existing entries and adds new entries to the ZIP or JAR file\n            if it exists. (optional, default=no)',177,106,'C05D1DDB5508E95EC58D8B84897B8B22'),(2022,'destination',6,0,'Destination directory where the ZIP or JAR file is extracted.',177,106,'FF92141C9CDF94BBB47086073BA5BB73'),(2023,'name',6,1,'The form variable name for the applet.',64,106,'1B4D2B082010EEBB67313FA93120780F'),(2024,'width',5,0,'The width of the applet, in pixels.',64,106,'DAE041175DBFEA93A5CDFB113E12F69A'),(2025,'appletsource',6,1,'The name of the registered applet.',64,106,'8B8019DC21AB0B782488D1AAA18DECFF'),(2026,'vspace',5,0,'Space above and below applet, in pixels.',64,106,'9773E503C7D9CE6AE3F0E6BAC40D0217'),(2027,'notsupported',6,0,'The text to display if a page containing a Java applet-based cfform control is opened by a browser that does not support Java or has Java support disabled.',64,106,'F4CB5588A991C35734E1FB6F4753C29E'),(2028,'paramn',6,0,'The name of a registered parameter for the applet.',64,106,'978C282A7F85834A01FD314EA8180CE0'),(2029,'align',6,0,'Alignment',64,106,'77CFEC1B4BB7ED11B9CC349733581C60'),(2030,'height',5,0,'The height of the applet, in pixels.',64,106,'841267CEFE3CEAF23CA83774A9BB0124'),(2031,'hspace',5,0,'Space on each side of the applet, in pixels.',64,106,'163519726D3E609396FFE14C5FEF96CF'),(2032,'onsuccess',6,0,'The name of a JavaScript function to invoke when a bind, specified by the bind attribute succeeds. The function must take one argument, the bind function return value. If the bind function is a CFC function, the return value is automatically converted to a JavaScript variable before being passed to the onSuccess function.',178,106,'6D4C6E33DBF941726ADEACC8967265C1'),(2033,'onerror',6,0,'The name of a JavaScript function to invoke when a bind, specified by the bind attribute fails. The function must take two arguments: an error code and an error message.',178,106,'EB0C9B335B1FE76BF98C558A6B1C475A'),(2034,'jsclassname',6,0,'The name to use for the JavaScript proxy class.',178,106,'3FFD380585E0CDBD4E5AD4BABE4C2E16'),(2035,'cfc',6,0,'the CFC for which to create a proxy. You must specify a dot-delimited path to the CFC. The path can be absolute or relative to location of the CFML page. For example, if the myCFC CFC is in the cfcs subdirectory of the Railox page, specify cfcs.myCFC. On UNIX based systems, the tag searches first for a file whos name or path corresponds to the specified name or path, but is in all lower case. If it does not find it, Railox then searches for a file name or path that coresponds to the attribute value exactly, with identical character casing.',178,106,'6652CD78344AB85F7064F671A5F0DA08'),(2036,'bind',6,0,'A bind expression that specifies a CFC method, JavaScript function, or URL to call.\r\n',178,106,'E8A81FD6073294792C6F58C9F35C02EE'),(2037,'overwriteenclosure',4,0,'Used only for the read action.\n            Whether to overwrite files in the enclosure directory if they already exist.\n            If you do not set this attribute to true and the cffeed tag tries to write to a file that exists, Railo\n            generates an error. (optional, default=false)',184,106,'81D9F8C2F86D9BB8DA232C19D76F2FAB'),(2038,'overwrite',4,0,'Whether to overwrite the XML feed file if it already exists.\n            If you do not set this attribute to true and the cffeed tag tries to write to a file that exists, Railo\n            generates an error. (optional, default=false)',184,106,'D236817265897DFC412973C851A69168'),(2039,'query',1,0,'A query object containing the Atom entries or RSS items in the feed. Can contain either of the following:\n             The output of a read action.\n             Input to a create action.\n            The properties and query attributes combined provide complete feed information.\n            When you specify the query attribute for a create action, you must put it in pound signs (#)',184,106,'790956032BB28F8321C429D17CFBD31F'),(2040,'enclosuredir',6,0,'Used only for the read action.\n            Path to the directory in which to save any enclosures that are available in the feed being read.\n            The path can be absolute or relative to the CFML file.\n            If the directory does not exist, Railo generates an error.\n            If you omit this attribute, Railo does not save enclosures.\n            To specify the directory that contains the current page, set this attribute to .(period).',184,106,'F0377893D356B48D5C3C573D76A0F4F3'),(2041,'properties',1,0,'A structure containing the feed metadata, the information about the entire feed.\n            Can contain either of the following:\n             The output of a read action.\n             Input to a create action.\n            The properties and query attributes combined provide complete feed information.\n            When you specify the properties attribute for a create action, you must put it in pound signs (#)',184,106,'929D9469B2D246BDF2204557997834BF'),(2042,'timeout',5,0,'The number of seconds to wait for a response from the feed source. A value of 0 specifies that the request does not time out.',184,106,'F74ED2D9185E340B961E880BB1820CB1'),(2043,'proxyport',5,0,'The port to connect to on the proxy server.',184,106,'066C463EE82F608EC39EA881981BE1C5'),(2044,'proxypassword',6,0,'Password required by the proxy server.',184,106,'B7AD82C9BA7A49A99147FDAC8CF1BB38'),(2045,'source',6,0,'Used only for the read action.\n            The URL of the feed or the path to the XML file that contains the feed contents.\n            A path can be absolute, or relative to the CFML file.',184,106,'CD5A5F665E0C4AAD49D242800EB79E8E'),(2046,'ignoreenclosureerror',4,0,'If this attribute is true, Railo attempts to save all enclosures.\n            If it encounters an error downloading one enclosure, it continues downloading other enclosures and writes the\n            error information in the server log.\n            If this attribute is false, Railo stops downloading all enclosures and generates an error when it encounters\n            an error downloading an enclosure.\n            Note: Enclosure errors can occur if the specified enclosure is of a type that the web server does not allow to be\n            downloaded. (optional, default=false)',184,106,'FE2D33CA661DD31C76449453A2AA5DA6'),(2047,'action',6,0,'The name to use for the JavaScript proxy class.\n        The action to take, one of the following values:\n        \"create\" Creates an RSS 2.0 or Atom 1.0 feed XML document and saves it in a variable, writes it to a file, or both.\n        \"read\" Parses an RSS or Atom feed from a URL or an XML file and saves it in a structure or query.\n        You can also get query metadata in a separate structure. (optional, default= read)',184,106,'E38127CFB505C0C6F78D17FC5697624C'),(2048,'outputfile',6,0,'Path of the file in which to write the feed as XML text.\n            The path can be absolute, or relative to the CFML file.',184,106,'8711E89DFAE6FB50FF80C52D610D0848'),(2049,'proxyserver',6,0,'Host name or IP address of a proxy server to which to send the request.',184,106,'7B86D6FCCF4ED76E69AC2A120BD224E1'),(2050,'xmlvar',6,0,'A variable in which to save the read or created feed as XML text.',184,106,'F0D3FC94D5F3442761A3A71B68AD05D0'),(2051,'name',1,0,'A structure that contains complete feed data:\n             The output of a read action.\n             The input definition of the feed to create.\n            This structure contains complete feed information.\n            When you specify the name attribute for a create action, you must put it in pound signs (#).',184,106,'BD9BDC02A501FACD0EEB79F467C8DE13'),(2052,'columnmap',11,0,'Used only for the create action with a query attribute.\n            A structure specifying a mapping between the names of the columns in the object specified by the query attribute\n            and the columns of the feed format, as described in the Query attribute section.\n            The key for each field must be a column name listed in the Query columns section. The value of the field must be\n            the name of the corresponding column in the query object used as input to the create action.',184,106,'3A848F57BCEC5BCA2A9E2FFF8E48EB74'),(2053,'charset',6,0,'The character encoding in which to encode the header value.\n\n            For more information on character encodings, see:\n            www.w3.org/International/O-charset.html.',66,106,'F749CAB7E2FC246F5F4003C32A0455D2'),(2054,'colorlist',6,0,'Applies if chartseries type attribute = \"pie\". Sets pie\n            slice colors.\n\n            Comma-delimited list of hex values or supported, named web\n            colors; see name list in the cfchart Usage section.\n\n            For a hex value, use the form \"##xxxxxx\", where x = 0-9 or\n            A-F; use two pound signs or none.',137,106,'B8B5CBB3612B080D0D98D6D05A881680'),(2055,'datalabelstyle',6,0,'Specifies the way in which the color is applied to the\n            item in the series:\n 