titalic',4,0,'Yes: displays grid control text in italics',153,106,'6BC18DF8F9CFFF4BEDB32F22866314EA'),(2166,'style',6,0,'XML file or string to use to specify the style of the chart.',153,106,'DA1D474CA6294DEFE6F5563E328BABBB'),(2167,'showlegend',4,0,'yes: if chart contains more than one data series, display\n            legend',153,106,'38D3FC800CB89F7B56E3112C4C29F72A'),(2168,'font',6,0,'Font of data in column.',153,106,'5556B064E03BD5D8EEDD4835E5E5E662'),(2169,'show3d',4,0,'Display chart with three-dimensional appearance.',153,106,'FC000BF85BB6D15DF98CA04287522502'),(2170,'tipstyle',6,0,'Determines the action that opens a popup window to display\n            information about the current chart element.\n            - mouseDown: display if the user positions the cursor at the element\n            and clicks the mouse. Applies only to Flash format graph files (Flash not supported).\n            - mouseOver: displays if the user positions the cursor at the element\n            - none: suppresses display',153,106,'EB603CA84CEA30D1F1416CEFBCD987B0'),(2171,'showygridlines',4,0,'yes: display Y-axis gridlines',153,106,'230C48F5AB330F6BDCE0CB1C20086F85'),(2172,'body',6,0,'- ASCII text to index\n            - Query column name(s), if name is specified in query\n\n            You can specify columns in a delimited list. For example:\n            - emp_name, dept_name, location\"',93,106,'4EDB9AD881355377A958ABDAC4A06CCE'),(2173,'language',6,0,'language used to index',93,106,'68371189DAEBC81A9E4CFE86A5F86265'),(2174,'status',6,0,'The name of the structure into which Railo\n            returns status information.',93,106,'8BBE1A6AF01B14343AA429146634A37B'),(2175,'category',6,0,'A string value that specifies one or more search categories\n            for which to index the data. You can define multiple\n            categories, separated by commas, for a single index.',93,106,'8163BEEEBF5F18F63D678DC3531CD51F'),(2176,'prefix',6,0,'Specifies the location of files to index when the computer that contains the K2 Search Service is not the computer on which you installed Railo, and when you index files with the type attribute set to path.',93,106,'429AB270FE6E9DF93B7965BD6EA097E2'),(2177,'categorytree',6,0,'A string value that specifies a hierarchical category or\n            category tree for searching. It is a series of categories\n            separated by forward slashes (\"/\"). You can specify only\n            one category tree.',93,106,'557BF3E0758E3AFA111A4500CB93A7EE'),(2178,'throwontimeout',4,0,'Specifies how timeout conditions are handled. If the value is true, an exception is enerated to provide notification of the timeout. If the value is No, execution continues. Default is no.',93,106,'47F9BE562BE4FFB508AE8420F6629F2A'),(2179,'name',6,0,'name of the variable generated by action \"list\" to return the query containg all indexes of a collection.',93,106,'D6A4D46ACE18AFA229F85E6F0190B05E'),(2180,'key',6,0,'- Absolute path and filename, if type = \"file\"\n            - Absolute path, if type = \"path\"\n            - A query column name (typically, the primary key column\n                name), if type = \"custom\"\n            - A query column name, if type = any other value\n\n            This attribute is required for the actions listed, unless\n            you intend for its value to be an empty string.',93,106,'CB42B4D508E5482B7D121331CC76CE8B'),(2181,'casesensitive',4,0,'if set to true maintains the case of document elements and attributes',98,106,'64659CAF96AA75BA5A85C784C1273BFA'),(2182,'validator',6,0,'Any of the following:\n- A string containing a DTD or Schema\n- The name of a DTD or Schema file\n- The URL of a DTD or Schema file; valid protocol identifiers include http, https, ftp, and file',98,106,'A6CBCECF004F7D8D41965DC0AC531B53'),(2183,'validate',6,0,'date: verifies format mm/dd/yy.\n            eurodate: verifies date format dd/mm/yyyy.\n            time: verifies time format hh:mm:ss.\n            float: verifies floating point format.\n            integer: verifies integer format.\n            telephone: verifies telephone format ###-###-####. The\n                separator can be a blank. Area code and exchange must\n                begin with digit 1 - 9.\n            zipcode: verifies, in U.S. formats only, 5- or 9-digit\n                format #####-####. The separator can be a blank.\n            creditcard: strips blanks and dashes; verifies number using\n                mod10 algorithm. Number must have 13-16 digits.\n            social_security_number: verifies format ###-##-####. The\n                separator can be a blank.\n            regular_expression: matches input against pattern\n                attribute.',99,106,'F0C8E20CA775D994662C6758570DEA50'),(2184,'showautosuggestloadingicon',4,0,'A Boolean value that specifies whether to display an animated icon when loading an autosuggest value for a text input.',99,106,'01990CF3A0F89FD17EF9701A96924AC9'),(2185,'firstdayofweek',5,0,'Integer in the range 0-6 specifying the first day of the\n            week in the calendar, 0 indicates Sunday, 6 indicates Saturday.\n            Default is: 0',99,106,'1C350D21E79BDC12A3E170B04E8D5FEF'),(2186,'enabled',6,0,'Flash only: Boolean value specifying whether the control is\n            enabled. A disabled control appears in light gray. The\n            inverse of the disabled attribute. Flash only.\n            Default: true',99,106,'45338B1C25159226CF7B3F177A281F3E'),(2187,'accept',6,0,'passed through to input tag created, only used for type html.',99,106,'7B5CAE6A7AD317132797AFC104B261AE'),(2188,'autosuggestbinddelay',5,0,'The minimum time between autosuggest bind \n                    expression invocations, in seconds. Use this \n                    attribute to limit the number of requests that are \n                    sent to the server when a user types. \n                    Valid only for cfinput type=\"text\"',99,106,'AB504D81F41536D749680E48940C3D9B'),(2189,'label',6,0,'Label to put next to the control on a Flash or XML form.\n            Not used for button, hidden, image, reset, or submit types.',99,106,'FF512FFD4F035C05318D8511EEE8E40B'),(2190,'height',6,0,'Applies to most Flash types, HTML image type on\n            some browsers. The height of the control, in pixels. The\n            displayed height might be less than the specified size.',99,106,'27004B867391A81D965BF154C116C9D3'),(2191,'bindonload',4,0,'A Boolean value that specifies whether to \n                        execute the bind attribute expression when first \n                        loading the form. \n                        Ignored if there is no bind attribute. \n                        Valid only for cfinput type=\"text\".',99,106,'C5A0C823D6D25630BA2CC418488CAA72'),(2192,'visible',6,0,'Flash only: Boolean value specifying whether to show the\n            control. Space that would be occupied by an invisible\n            control is blank.\n            Default: true',99,106,'5BA8BACD1BF066CB69D3615FE2B9A75D'),(2193,'tooltip',6,0,'Flash only: Text to display when the mouse pointer hovers\n            over the control.',99,106,'0CCCF194774117CF4A0A88850787ECE5'),(2194,'maxresultsdisplayed',5,0,'The maximum number suggestions to display in the autosuggest list.\nValid only for cfinput type=\"text\".',99,106,'ED4EE73F6F60FE05A665D1E8F5F47E7D'),(2195,'src',6,0,'Applies to Flash button, reset, submit, and image types,\n            and the HTML image type. URL of an image to use on\n            the button. Flash does not support GIF images.',99,106,'D458D279B4D2D6E30DC6E244B9B0DB97'),(2196,'bindattribute',6,0,'Specifies the HTML tag attribute whose value is \n                    set by the bind attribute. You can only specify \n                    attributes in the browser\'s HTML DOM tree, not \n                    Railo-specific attributes. \n                    Ignored if there is no bind attribute. \n                    Valid only for cfinput type=\"text\".',99,106,'4D4A3EC6071F4AB45A05D5A0A9B7BB8A'),(2197,'validateat',6,0,'How to do the validation; one or more of the following:\n            onSubmit, onServer or onBlur.\n            onBlur and onSubmit are identical in Flash forms. For\n            multiple values, use a comma-delimited list.\n            Default: onSubmit',99,106,'8A5DD10C7ADCAD44670B261BDA04B584'),(2198,'type',6,0,'The input control type to create:\n            - button: push button.\n            - checkbox: check box.\n            - file: file selector; not supported in Flash.\n            - hidden: invisible control.\n            - image: clickable button with an image.\n            - password: password entry control; hides input values.\n            - radio: radio button.\n            - reset: form reset button.\n            - submit: form submission button.\n            - text: text entry box.\n            - datefield: Flash only; date entry field with an\n              expanding calendar for selecting dates.',99,106,'39979877DD88E20B925E037E1737060E'),(2199,'mask',6,0,'A mask pattern that controls the character pattern that\n            users can enter, or that the form sends to Railo.\n            In HTML and Flash for type=text use:\n             - A = [A-Za-z]\n             - X = [A-Za-z0-9]\n             - 9 = [0-9]\n             - ? = Any character\n             - all other = the literal character\n            In Flash for type=datefield use:\n             - D = day; can use 0-2 mask characters.\n             - M = month; can use 0-4 mask characters.\n             - Y = year; can use 0, 2, or 4 characters.\n             - E = day in week; can use 0-4 characters.',99,106,'BE0B30A0EBA2BD0995F4C2E410FFE321'),(2200,'typeahead',4,0,'A Boolean value that specifies whether the autosuggest feature should automatically complete a user\'s entry with the first result in the suggestion list.\nValid only for cfinput type=\"text\".',99,106,'1E5DD180DA3FBB43DA29075F65626468'),(2201,'daynames',6,0,'A comma-delimited list that sets the names of the\n            weekdays displayed in the calendar. Sunday is the\n            first day and the rest of the weekday names follow in\n            the normal order.\n            Default is: S,M,T,W,Th,F,S',99,106,'2D7704FEE218CAC948C6102C2B87BCF4'),(2202,'onbinderror',6,0,'The name of a JavaScript function to execute if evaluating a bind expression, including an autosuggest bind expression, results in an error. The function must take two attributes: an HTTP status code and a message.',99,106,'AA38B5FE28A14028595AD86F654085E8'),(2203,'autosuggestminlength',5,0,'The minimum number of characters required in \n                    the text box before invoking a bind expression to \n                    return items for suggestion. \n                    Valid only for cfinput type=\"text\".',99,106,'F65F1294C06C26277B76D0424A6757EE'),(2204,'delimiter',6,0,'The delimiter to use to separate entries in a static autosuggest list. This attribute is meaningful only if the autosuggest attribute is a string of delimited values.',99,106,'C6DD53A37A271A82983C661851A19B96'),(2205,'disabled',6,0,'Disables user input, making the control read-only. To\n            disable input, specify disabled without an attribute or\n            disabled=\"true\". To enable input, omit the attribute\n            or specify disabled=\"false\".',99,106,'AB6D15CBEA0EC074E0C8797C7721567F'),(2206,'width',6,0,'Applies to most Flash types, HTML image type on\n            some browsers. The width of the control, in pixels. For\n            Flash forms, Railo ignores this attribute if you also\n            specify a size attribute value.',99,106,'55AB12C4B555F0A51878CFCC2E5D178E'),(2207,'checked',6,0,'Selects a control. No value is required. Applies if\n            type=radio or checkbox.\n            Default: false',99,106,'6D669BA4C9991CD95917AFDE7C48844C'),(2208,'monthnames',6,0,'A comma-delimited list of the month names that are\n            displayed at the top of the calendar.',99,106,'4D09D1BD24060BA72FD317D8B90EB577'),(2209,'bind',6,0,'A Flash bind expression that populates the field with\n            information from other form fields.',99,106,'90841A383AADAD6E996D5E6A89E92F0B'),(2210,'sourcefortooltip',6,0,'The URL of a page to display as a tool tip. The page can include HTML markup to control the format, and the tip can include images.\nIf you specify this attribute, an animated icon appears with the text \"Loading...\" while the tip is being loaded.',99,106,'C5ED9C28F36CFE60D4DCC57A20BA835B'),(2211,'autosuggest',6,0,'Specifies entry completion suggestions to \n                    display as the user types into a text input. The \n                    user can select a suggestion to complete the text \n                    entry. \n                    The valid value can be either of the following: \n                    - A string consisting of the suggestion values \n                    separated by the delimiter specified by the \n                    delimiter attribute. \n                    - A bind expression that gets the suggestion \n                    values based on the current input text. \n                    Valid only for cfinput type=\"text\".',99,106,'866B527396B1B833E7E880D69DBC2CDB'),(2212,'uid',6,0,'Specifies the unique ID or a comma-delimited list of Uids to retrieve or delete. If you set invalid Uids, then they are ignored.',316,106,'91BAA85775E8860BD88F83F9921395E4'),(2213,'extendedinfo',6,0,'extended information to the exception.',69,107,'6DE68876B89855E45FB6F6CF1460C591'),(2214,'output',6,0,'Where to send the results:\r\n- console: the result is written to the console (System.out).\r\n- browser (default): the result is written the the browser response stream.',71,107,'5337621E9C79FE825D3D25ED3D296151'),(2215,'abort',4,0,'stops further processing of request.',71,107,'6EAE792E95BECAC740AAF249EE6AD5AE'),(2216,'label',6,0,'header for the dump output.',71,107,'C0E0B7E0509496061D4AF34906DFF16C'),(2217,'format',6,0,'specify the output format of the dump, the following formats are supported:\r\n- simple: - a simple html output (no javascript or css)\r\n- text (default when output equal console): plain text output (no html)\r\n- html (default when output  equal \"browser\"): regular output with html/css/javascript\r\n- classic: classic view with html/css/javascript',71,107,'0B5320DEC52DD75DE2A3F2AB4A337409');
;
